INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(1, NULL, '2021-06-04 19:30:49.902770', 1, '56874', 'Q000000981', 'Qualifier', 1, 'DG', '[{\"@language\": \"en\", \"@value\": \"diagnostic imaging\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico por imagen\"}, {\"@language\": \"pt-br\", \"@value\": \"diagnóstico por imagem\"}, {\"@language\": \"fr\", \"@value\": \"imagerie diagnostique\"}, {\"@language\": \"es-es\", \"@value\": \"diagnóstico por imagen\"}]', '[\"Q20.010\",\"Y04.010\"]', '[\"M0030904\",\"M0030903\",\"M0030734\",\"M0030733\"]', 'M000614856', 'T000895609', '[{\"@language\": \"es\", \"@value\": \"resonancia magnética\"}, {\"@language\": \"es\", \"@value\": \"resonancia magnética nuclear\"}, {\"@language\": \"pt-br\", \"@value\": \"ressonância magnética\"}, {\"@language\": \"pt-br\", \"@value\": \"ressonância magnética nuclear\"}, {\"@language\": \"en\", \"@value\": \"ultrasound\"}, {\"@language\": \"es\", \"@value\": \"ultrasonido\"}, {\"@language\": \"pt-br\", \"@value\": \"ultrassom\"}, {\"@language\": \"en\", \"@value\": \"ultrasonography\"}, {\"@language\": \"en\", \"@value\": \"ultrasonic diagnosis\"}, {\"@language\": \"en\", \"@value\": \"echotomography\"}, {\"@language\": \"en\", \"@value\": \"echography\"}, {\"@language\": \"es\", \"@value\": \"ultrasonografía\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico por ultrasonido\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico ultrasónico\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico por ultrasonidos\"}, {\"@language\": \"es\", \"@value\": \"ecografía\"}, {\"@language\": \"es\", \"@value\": \"ecotomografía\"}, {\"@language\": \"es\", \"@value\": \"ecocardiografía\"}, {\"@language\": \"pt-br\", \"@value\": \"ultrassonografia\"}, {\"@language\": \"pt-br\", \"@value\": \"diagnóstico por ultrassom\"}, {\"@language\": \"pt-br\", \"@value\": \"diagnóstico ultrassônico\"}, {\"@language\": \"pt-br\", \"@value\": \"ecografia\"}, {\"@language\": \"pt-br\", \"@value\": \"ecotomografia\"}, {\"@language\": \"pt-br\", \"@value\": \"ecocardiografia\"}, {\"@language\": \"en\", \"@value\": \"radionuclide imaging\"}, {\"@language\": \"en\", \"@value\": \"radioisotope scanning\"}, {\"@language\": \"es\", \"@value\": \"cintigrafía\"}, {\"@language\": \"es\", \"@value\": \"imagen por radionúclidos\"}, {\"@language\": \"es\", \"@value\": \"medicina nuclear\"}, {\"@language\": \"es\", \"@value\": \"rastreo por radioisótopos\"}, {\"@language\": \"es\", \"@value\": \"gammagrafía\"}, {\"@language\": \"es\", \"@value\": \"gammagrafía con radioisótopos\"}, {\"@language\": \"es\", \"@value\": \"escanografía nuclear\"}, {\"@language\": \"pt-br\", \"@value\": \"cintilografia\"}, {\"@language\": \"pt-br\", \"@value\": \"cintigrafia\"}, {\"@language\": \"pt-br\", \"@value\": \"medicina nuclear\"}, {\"@language\": \"pt-br\", \"@value\": \"varredura por radioisótopos\"}, {\"@language\": \"en\", \"@value\": \"radiography\"}, {\"@language\": \"en\", \"@value\": \"X-ray image\"}, {\"@language\": \"en\", \"@value\": \"X-ray diagnosis\"}, {\"@language\": \"en\", \"@value\": \"roentgenography\"}, {\"@language\": \"en\", \"@value\": \"X-ray\"}, {\"@language\": \"es\", \"@value\": \"radiografía\"}, {\"@language\": \"es\", \"@value\": \"imagen por rayos X\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico por rayos X\"}, {\"@language\": \"es\", \"@value\": \"roentgenografía\"}, {\"@language\": \"es\", \"@value\": \"rayo X\"}, {\"@language\": \"es\", \"@value\": \"rayos X\"}, {\"@language\": \"pt-br\", \"@value\": \"radiografia\"}, {\"@language\": \"pt-br\", \"@value\": \"imagem por raios X\"}, {\"@language\": \"pt-br\", \"@value\": \"diagnóstico por raios X\"}, {\"@language\": \"pt-br\", \"@value\": \"roentgenografia\"}, {\"@language\": \"pt-br\", \"@value\": \"raio X\"}, {\"@language\": \"pt-br\", \"@value\": \"raios X\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; coordinate with specific  imaging technique if pertinent\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; coordene com técnica de imagem específica se pertinente\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; coordine con técnica de imagen específica si pertinente\"}]', NULL, '[{\"@language\": \"en\", \"@value\": \"2017(1967)\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the visualization of an anatomical structure or for the diagnosis of disease.  Commonly used imaging techniques include radiography, radionuclide imaging, thermography, tomography, and ultrasonography\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la visualisation des structures anatomiques ou pour le diagnostic des maladies. Les techniques d\'imagerie fréquemment utilisées comprennent l\'échographie, la radiographie, la scintigraphie, la thermographie et la tomographie.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la visualización de estructuras anatómicas o para el diagnóstico de enfermedades. Las técnicas de imagen que se usan habitualmente son la radiografía, las técnicas de medicina nuclear, la tomografía computarizada, la resonancia magnética y la ecografía.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la visualización de una estructura anatómica o para el diagnóstico de enfermedades. Las técnicas de imagen que se usan habitualmente son la radiografía, las técnicas de medicina nuclear, la termografía, la tomografía computarizada, la resonancia magnética y la ecografía.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a visualização de uma estrutura anatômica ou para o diagnóstico de doença. Técnicas de imagem comumente usadas incluem a radiografia, a cintilografia, a termografia, a tomografia e a ultrassonografia.\"}]', '2016-06-29', '2016-06-08', '2017-01-01', NULL, NULL),
(2, NULL, '2021-06-04 19:30:49.918365', 1, '22005', 'Q000002', 'Qualifier', 1, 'AB', '[{\"@language\": \"en\", \"@value\": \"abnormalities\"}, {\"@language\": \"es\", \"@value\": \"anomalías\"}, {\"@language\": \"pt-br\", \"@value\": \"anormalidades\"}, {\"@language\": \"fr\", \"@value\": \"malformations\"}, {\"@language\": \"es-es\", \"@value\": \"anomalías\"}]', '[\"Q10.030.010\",\"Y02.030.010\"]', '[\"M0030203\",\"M0030209\",\"M0030210\",\"M0030208\",\"M0030207\",\"M0030206\",\"M0030211\",\"M0030204\",\"M0030205\"]', 'M0030203', 'T060543', '[{\"@language\": \"en\", \"@value\": \"anomalies\"}, {\"@language\": \"es\", \"@value\": \"anormalidades\"}, {\"@language\": \"pt-br\", \"@value\": \"anomalias\"}, {\"@language\": \"en\", \"@value\": \"aplasia\"}, {\"@language\": \"es\", \"@value\": \"aplasia\"}, {\"@language\": \"pt-br\", \"@value\": \"aplasia\"}, {\"@language\": \"en\", \"@value\": \"atresia\"}, {\"@language\": \"es\", \"@value\": \"atresia\"}, {\"@language\": \"pt-br\", \"@value\": \"atresia\"}, {\"@language\": \"en\", \"@value\": \"malformations\"}, {\"@language\": \"es\", \"@value\": \"malformaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"malformações\"}, {\"@language\": \"pt-br\", \"@value\": \"malformação\"}, {\"@language\": \"pt-br\", \"@value\": \"má-formação\"}, {\"@language\": \"pt-br\", \"@value\": \"má-formações\"}, {\"@language\": \"en\", \"@value\": \"defects\"}, {\"@language\": \"es\", \"@value\": \"defectos\"}, {\"@language\": \"pt-br\", \"@value\": \"defeitos\"}, {\"@language\": \"en\", \"@value\": \"deformities\"}, {\"@language\": \"es\", \"@value\": \"deformidades\"}, {\"@language\": \"pt-br\", \"@value\": \"deformidades\"}, {\"@language\": \"en\", \"@value\": \"hypoplasia\"}, {\"@language\": \"es\", \"@value\": \"hipoplasia\"}, {\"@language\": \"pt-br\", \"@value\": \"hipoplasia\"}, {\"@language\": \"en\", \"@value\": \"agenesis\"}, {\"@language\": \"es\", \"@value\": \"agenesia\"}, {\"@language\": \"pt-br\", \"@value\": \"agenesia\"}, {\"@language\": \"en\", \"@value\": \"congenital defects\"}, {\"@language\": \"en\", \"@value\": \"birth defects\"}, {\"@language\": \"es\", \"@value\": \"defectos de nacimiento\"}, {\"@language\": \"es\", \"@value\": \"defectos congénitos\"}, {\"@language\": \"pt-br\", \"@value\": \"defeitos de nascença\"}, {\"@language\": \"pt-br\", \"@value\": \"defeitos congênitos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; congenital & structural only: does not include abnormal function ( = /physiopathology or disease heading); includes \\\"deformity\\\", \\\"malformation\\\", \\\"anomalous\\\", includes agenesis, aplasia, atresia, ectopy, hypoplasia, etc.; includes more or less than the normal number of organs (as one ureter, six fingers); see MeSH scope note in Introduction; indexing policy: Manual 19.8.1; DF: /abnorm or /AB\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente congénitas & estructurales: no incluye funciones anormales ( = /fisiopatología o descriptor de enfermedad); incluye deformidad, malformación, anomalías, teratología, agenesia, aplasia, atresia, ectopia, hipoplasia, etc.; incluye más o menos que el número normal de órganos (como un uréter, seis dedos); vea definición; regla de indización: Manual de la NLM 19.8.1\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente congênitas & estruturais: não inclui funções anormais ( = /fisiopatologia ou descritor de doença); inclui deformidade, malformação, anormalidade, teratologia, agenesia, aplasia, atresia, ectopia, hipoplasia, etc.; inclui mais ou menos que o número normal de órgãos (como um ureter, seis dedos); veja definição; regra de indexação: Manual da NLM 19.8.1\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AB or AB (SH) or SUBS APPLY AB\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966-74; A1-9 & A13-15 1975-88; A1-9, A13-15 & B2 1989; A1-10, A13-14, A16 & B2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs for congenital defects producing changes in the morphology of the organ. It is used also for abnormalities in animals.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes pour les anomalies congénitales responsables de modifications morphologiques de ces organes. Il s’emploie aussi pour les malformations chez les animaux.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos para defectos congénitos que producen cambios en la morfología del órgano. Se usa también para anormalidades en animales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos para defectos congénitos que producen cambios en la morfología del órgano. Se usa también para anormalidades en animales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos para defeitos congênitos que produzem alterações na morfologia do órgão. Também usado para anormalidades em animais.\"}]', '1973-12-27', '2015-07-01', '1966-01-01', NULL, NULL),
(3, NULL, '2021-06-04 19:30:49.934021', 1, '22000', 'Q000008', 'Qualifier', 1, 'AD', '[{\"@language\": \"en\", \"@value\": \"administration & dosage\"}, {\"@language\": \"es\", \"@value\": \"administración & dosificación\"}, {\"@language\": \"pt-br\", \"@value\": \"administração & dosagem\"}, {\"@language\": \"fr\", \"@value\": \"administration et posologie\"}, {\"@language\": \"es-es\", \"@value\": \"administración & dosificación\"}]', '[\"Q45.010\",\"Q60.010\",\"Y07.010\",\"Y10.010\"]', '[\"M0030212\"]', 'M0030212', 'T060555', '[{\"@language\": \"en\", \"@value\": \"administration and dosage\"}, {\"@language\": \"es\", \"@value\": \"administración y dosificación\"}, {\"@language\": \"pt-br\", \"@value\": \"administração e dosagem\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for routes of administration, timing, amounts of doses; not for \\\"dosage\\\" in Romance languages ( =  /analysis)\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para rutas de administración, \\\"timing\\\", cantidad de las dosis; no para dosificación en lenguas Romances ( = /análisis)\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para vias de administração, \\\"timing\\\", quantidade das doses; não para \\\"dosagem\\\" em linguas Românicas ( = /análise)\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AD or AD (SH) or SUBS APPLY AD\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966-90 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs for dosage forms, routes of administration, frequency and duration of administration, quantity of medication, and the effects of these factors.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments pour les présentations pharmaceutiques, les voies d\'administration, la fréquence et la durée d\'administration, la quantité administrée, ainsi que pour les effets de ces différents facteurs.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con medicamentos para formas de dosificación, vías de administración, frecuencia y duración de la administración, cantidad del medicamento y los efectos de estos factores.\"}, {\"@language\": \"es\", \"@value\": \"Usado con medicamentos para formas de dosificación, vías de administración, frecuencia y duración de la administración, cantidad del medicamento y los efectos de estos factores.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com medicamentos para formas de dosagem, vias de administração, frequência e duração da administração, quantidade de medicação e os efeitos destes fatores.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(4, NULL, '2021-06-04 19:30:49.934021', 1, '22020', 'Q000009', 'Qualifier', 1, 'AE', '[{\"@language\": \"en\", \"@value\": \"adverse effects\"}, {\"@language\": \"es\", \"@value\": \"efectos adversos\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos adversos\"}, {\"@language\": \"fr\", \"@value\": \"effets indésirables\"}, {\"@language\": \"es-es\", \"@value\": \"efectos adversos\"}]', '[\"Q45.020\",\"Q60.020\",\"Y07.020\",\"Y10.020\"]', '[\"M0030213\"]', 'M0030213', 'T060556', '[{\"@language\": \"en\", \"@value\": \"side effects\"}, {\"@language\": \"es\", \"@value\": \"efectos colaterales\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos colaterais\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; see also /poisoning & /toxicity\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; vea también /envenamiento y /toxicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; veja também /envenenamento e /toxicidade\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AE or AE (SH) or SUBS APPLY AE\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D, E & H 1966-69; D, E, H & J 1970-74; D, E, F4, H & J 1975-81; D, E, F4, G3, H & J 1982-87; D, E, F4, H, J, & SMOKING 1988; D, E, F4, H, J, & 1982-87; D, E, F4, H, J & SMOKING 1988; D, E, F4, H, J & SMOKING+ 1989; D, E & J 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs, chemicals, or biological agents in accepted dosage - or with physical agents or manufactured products in normal usage - when intended for diagnostic, therapeutic, prophylactic, or anesthetic purposes. It is used also for adverse effects or complications of diagnostic, therapeutic, prophylactic, anesthetic, surgical, or other procedures.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments, aux substances chimiques et aux agents biologiques aux doses communément admises, ainsi qu’aux agents physiques et aux produits manufacturés dans leur usage normal, lors de leur utilisation dans un but diagnostique, thérapeutique, prophylactique ou anesthésique. Il s’emploie aussi pour les effets secondaires et les complications des procédures diagnostiques, thérapeutiques, prophylactiques, anesthésiques, chirurgicales ou autres. Il exclut les contrindications, pour lesquelles le qualificatif \'contrindications\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Se usa con medicamentos, compuestos químicos o agentes biológicos administrados en dosis adecuadas, o con agentes físicos o productos manufacturados usados de manera habitual, cuando se pretende con fines de diagnóstico, terapéuticos, profilácticos o anestésicos. Se usa también para efectos adversos o complicaciones de procedimientos diagnósticos, terapéuticos, profilácticos, anestésicos, quirúrgicos u otros.\"}, {\"@language\": \"es\", \"@value\": \"Se usa con medicamentos, compuestos químicos o agentes biológicos administrados en dosis adecuadas, o con agentes físicos o productos manufacturados usados de manera habitual, cuando se pretende con fines de diagnóstico, terapéuticos, profilácticos o anestésicos. Se usa también para efectos adversos o complicaciones de procedimientos diagnósticos, terapéuticos, profilácticos, anestésicos, quirúrgicos u otros.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com medicamentos, compostos químicos ou agentes biológicos em dosagens adequadas - ou com agentes físicos ou produtos manufaturados usados de modo habitual - quando destinados a fins diagnósticos, terapêuticos, profiláticos ou anestésicos. É usado também para efeitos adversos ou complicações de procedimentos diagnósticos, terapêuticos, profiláticos, anestésicos, cirúrgicos ou outros.\"}]', '1973-12-27', '2017-07-05', '1966-01-01', NULL, NULL),
(5, NULL, '2021-06-04 19:30:49.949648', 1, '22003', 'Q000031', 'Qualifier', 1, 'AA', '[{\"@language\": \"en\", \"@value\": \"analogs & derivatives\"}, {\"@language\": \"es\", \"@value\": \"análogos & derivados\"}, {\"@language\": \"pt-br\", \"@value\": \"análogos & derivados\"}, {\"@language\": \"fr\", \"@value\": \"analogues et dérivés\"}, {\"@language\": \"es-es\", \"@value\": \"análogos & derivados\"}]', '[\"Q15.020\",\"Y03.020\"]', '[\"M0030233\",\"M0030235\"]', 'M0030233', 'T060581', '[{\"@language\": \"en\", \"@value\": \"analogs and derivatives\"}, {\"@language\": \"es\", \"@value\": \"análogos e derivados\"}, {\"@language\": \"pt-br\", \"@value\": \"análogos e derivados\"}, {\"@language\": \"en\", \"@value\": \"derivatives\"}, {\"@language\": \"es\", \"@value\": \"derivados\"}, {\"@language\": \"pt-br\", \"@value\": \"derivados\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AA or AA (SH) or SUBS APPLY AA\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category D1-7 & D9-26 1975-89; D2-7, D9, D11 & D14-23 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs and chemicals for substances that share the same parent molecule or have similar electronic structure but differ by the addition or substitution of other atoms or molecules. It is used when the specific chemical heading is not available and no appropriate group heading exists.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments et aux substances chimiques pour les substances qui dérivent de la même molécule ou qui ont des structures électroniques similaires, mais qui diffèrent par l\'addition ou la substitution d\'atomes ou de molécules. Il s\'emploie quand il n\'existe pas de descripteur chimique spécifique ou de descripteur de groupe approprié.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con fármacos o compuestos químicos para sustancias que derivan de la misma molécula o tienen una estructura electrónica similar, pero que difieren por la adición o sustitución de otros átomos o moléculas. Usado cuando el descriptor específico o de grupo apropiado no existe en el DeCS.\"}, {\"@language\": \"es\", \"@value\": \"Usado con fármacos o compuestos químicos para sustancias que derivan de la misma molécula o tienen una estructura electrónica similar, pero que difieren por la adición o sustitución de otros átomos o moléculas. Usado cuando el descriptor específico o de grupo apropiado no existe en el DeCS.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fármacos ou compostos químicos para substâncias que derivam da mesma molécula ou têm estrutura eletrônica similar, mas que diferem pela adição ou substituição de outros átomos ou moléculas. Usado quando o descritor específico ou do grupo apropriado não existe no DeCS.\"}]', '1974-10-23', '2017-04-11', '1975-01-01', NULL, NULL),
(6, NULL, '2021-06-04 19:30:49.965285', 1, '22002', 'Q000032', 'Qualifier', 1, 'AN', '[{\"@language\": \"en\", \"@value\": \"analysis\"}, {\"@language\": \"es\", \"@value\": \"análisis\"}, {\"@language\": \"pt-br\", \"@value\": \"análise\"}, {\"@language\": \"fr\", \"@value\": \"analyse\"}, {\"@language\": \"es-es\", \"@value\": \"análisis\"}]', '[\"Q05\",\"Y01\"]', '[\"M0030239\",\"M0030240\",\"M0030238\"]', 'M0030237', 'T060585', '[{\"@language\": \"en\", \"@value\": \"chemical analysis\"}, {\"@language\": \"es\", \"@value\": \"análisis química\"}, {\"@language\": \"pt-br\", \"@value\": \"análise química\"}, {\"@language\": \"en\", \"@value\": \"determination\"}, {\"@language\": \"es\", \"@value\": \"determinación\"}, {\"@language\": \"pt-br\", \"@value\": \"determinação\"}, {\"@language\": \"en\", \"@value\": \"assay\"}, {\"@language\": \"es\", \"@value\": \"ensayo\"}, {\"@language\": \"pt-br\", \"@value\": \"ensaio\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"assay\\\", \\\"determination\\\", \\\"chemical analysis\\\"; for qualitative or quantitative analysis of substances; chemical composition of organs, organisms & plants, as \\\"chemical composition of the liver\\\" = LIVER /chemistry; for analysis of chemical substances in the blood use /blood; in the cerebrospinal fluid, use /cerebrospinal fluid; in the urine, use /urine; see MeSH scope note in Introduction; indexing policy: Manual 19.8.6; DF: /anal or /AN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"ensayo\\\", \\\"determinación\\\", \\\"análisis química\\\"; para análisis cualitativa o cuantitativa de sustancias; composición química de órganos, organismos & plantas, como \\\"composición química del hígado\\\" = HÍGADO /química; para análisis de sustancias químicas en la sangre use /sangre; en el líquido cefalorraquideo, use /líquido cefalorraquídeo; en la orina, use /orina; vea definición; regla de indización: Manual de la NLM 19.8.6\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"ensaio\\\", \\\"determinação\\\", \\\"análise química\\\"; para análise qualitativa ou quantitativa de substâncias; composição química de órgãos, organismos & plantas, como \\\"composição química do fígado\\\" = FÍGADO /química; para análise de substâncias químicas no sangue use /sangue; no líquido cefalorraquidiano, use /líquido cefalorraquidiano; na urina, use /urina; veja definição; regra de indexação: Manual da NLM 19.8.6\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AN or AN (SH) or SUBS APPLY AN\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category A, B & D 1967; A, B, D, G & J 1968-74; A, B1, B3-6, C4, D, G3 & J 1975-86; A, B1, B3-6, C4, D, G3, J, ASCITIC FLUID & CALCULI+ 1987; A, B1, B3-6, C4, D, G3, J, ASCITIC FLUID, BRONCHOALVEOLAR LAVAGE FLUID & CALCULI+ 1988-89; A2-16; B1, B3-6, C4, D & J 1990-91; D 1992 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the identification or quantitative determination of a substance or its constituents and metabolites; includes the analysis of air, water, or other environmental carrier. It excludes the chemical analysis of tissues, tumors, body fluids, organisms, and plants for which \\\"chemistry\\\" is used. The concept applies to both methodology and results. For analysis of substances in blood, cerebrospinal fluid, and urine the specific subheading designating the fluid is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour l\'identification ou la quantification d\'une substance ou de ses constituants et métabolites. Il comprend l\'analyse de l\'air, de l\'eau et autres vecteurs environnementaux. Il exclut l\'analyse chimique des tissus, des tumeurs, des liquides biologiques, des organismes et des végétaux, pour lesquels le qualificatif \'composition chimique\' est employé. Il s\'applique à la fois à la méthodologie et aux résultats. Pour l\'analyse des substances du sang, du liquide cérébrospinal et de l\'urine, les qualificatifs \'sang\', \'liquide cérébrospinal\' et \'urine\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la identificación o determinación cuantitativa de una sustancia o sus componentes y metabolitos; incluye el análisis del aire, agua u otro portador ambiental. Excluye el análisis químico de tejidos, tumores, fluidos corporales, organismos y plantas para los cuales se usa /química. El concepto se aplica tanto a la metodología como a los resultados. Para el análisis de sustancias en la sangre, líquido cefalorraquídeo y orina se usa el calificador específico que designa al fluido.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la identificación o determinación cuantitativa de una sustancia o sus componentes y metabolitos; incluye el análisis del aire, agua u otro portador ambiental. Excluye el análisis químico de tejidos, tumores, fluidos corporales, organismos y plantas para los cuales se usa /química. El concepto aplica tanto a metodología y resultados. Para el análisis de sustancias en la sangre, líquido cefalorraquídeo y orina se usa el calificador específico que designa al fluido.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para identificação ou determinação quantitativa de uma substância ou seus componentes e metabólitos; inclui a análise do ar, água ou outro agente ambiental. Exclui a análise química dos tecidos, tumores, fluidos corporais, organismos e plantas, para os quais se usa /química. O conceito se aplica a metodologia e a resultados. Para análise de substâncias no sangue, líquido cefalorraquidiano e urina, é usado o qualificador específico que designa o fluido.\"}]', '1973-12-27', '2003-07-24', '1967-01-01', NULL, NULL),
(7, NULL, '2021-06-04 19:30:49.965285', 1, '22004', 'Q000033', 'Qualifier', 1, 'AH', '[{\"@language\": \"en\", \"@value\": \"anatomy & histology\"}, {\"@language\": \"es\", \"@value\": \"anatomía & histología\"}, {\"@language\": \"pt-br\", \"@value\": \"anatomia & histologia\"}, {\"@language\": \"fr\", \"@value\": \"anatomie et histologie\"}, {\"@language\": \"es-es\", \"@value\": \"anatomía & histología\"}]', '[\"Q10\",\"Y02\"]', '[\"M0030241\",\"M0030242\",\"M0030244\",\"M0030243\"]', 'M0030241', 'T060589', '[{\"@language\": \"en\", \"@value\": \"anatomy and histology\"}, {\"@language\": \"es\", \"@value\": \"anatomía e histología\"}, {\"@language\": \"pt-br\", \"@value\": \"anatomia e histologia\"}, {\"@language\": \"en\", \"@value\": \"histology\"}, {\"@language\": \"es\", \"@value\": \"histología\"}, {\"@language\": \"pt-br\", \"@value\": \"histologia\"}, {\"@language\": \"en\", \"@value\": \"morphology\"}, {\"@language\": \"es\", \"@value\": \"morfología\"}, {\"@language\": \"pt-br\", \"@value\": \"morfologia\"}, {\"@language\": \"en\", \"@value\": \"anatomy\"}, {\"@language\": \"es\", \"@value\": \"anatomía\"}, {\"@language\": \"pt-br\", \"@value\": \"anatomia\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; normal structure only; for disordered structural change use /pathology; see also  /cytology &  /ultrastructure; see also  ‌/‌blood ‌supply &  /innervation; see also  /abnormalities\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente estructura normal; para cambio estructural desordenado use /patología; vea también /citología & /ultraestructura; vea también /irrigación sanguínea & /inervación; vea también /anomalías\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente estrutura normal; para alteração estrutural desordenada use /patologia; veja também /citologia & /ultraestrutura; veja também /irrigação sanguínea & /inervação; veja também /anormalidades\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AH or AH (SH) or SUBS APPLY AH\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A & B 1966-74; A, B1-2 & B5-6 1975-89; A1-10, A13-14, A16, B1-2 & B6 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, regions, and tissues for normal descriptive anatomy and histology, and for the normal anatomy and structure of animals and plants.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux régions anatomiques et aux tissus pour l\'anatomie et l\'histologie descriptives normales, ainsi que pour l\'anatomie et la structure normales des animaux et des végétaux.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, regiones y tejidos para anatomía e histología descriptiva normal y para la anatomía y estructura normal de animales y plantas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones y tejidos para anatomía e histología descriptiva normal y para la anatomía y estructura normal de animales y plantas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões e tecidos para anatomia e histologia descritiva normal e para anatomia e estrutura normal de animais e plantas.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(8, NULL, '2021-06-04 19:30:49.986447', 1, '22006', 'Q000037', 'Qualifier', 1, 'AI', '[{\"@language\": \"en\", \"@value\": \"antagonists & inhibitors\"}, {\"@language\": \"es\", \"@value\": \"antagonistas & inhibidores\"}, {\"@language\": \"es\", \"@value\": \"antagonistas e inhibidores\"}, {\"@language\": \"pt-br\", \"@value\": \"antagonistas & inibidores\"}, {\"@language\": \"fr\", \"@value\": \"antagonistes et inhibiteurs\"}, {\"@language\": \"es-es\", \"@value\": \"antagonistas & inhibidores\"}]', '[\"Q15.030\",\"Q45.040\",\"Y03.030\",\"Y07.040\"]', '[\"M0030247\",\"M0030249\",\"M0030248\"]', 'M0030247', 'T060595', '[{\"@language\": \"en\", \"@value\": \"antagonists and inhibitors\"}, {\"@language\": \"pt-br\", \"@value\": \"antagonistas e inibidores\"}, {\"@language\": \"en\", \"@value\": \"inhibitors\"}, {\"@language\": \"es\", \"@value\": \"inhibidores\"}, {\"@language\": \"pt-br\", \"@value\": \"inibidores\"}, {\"@language\": \"en\", \"@value\": \"antagonists\"}, {\"@language\": \"es\", \"@value\": \"antagonistas\"}, {\"@language\": \"pt-br\", \"@value\": \"antagonistas\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for exogenous & endogenous substances; do not confuse with /agonists\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para substâncias exógenas & endógenas; não confunda com /agonistas\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para sustancias exógenas & endógenas; no confunda con /agonistas\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AI or AI (SH) or SUBS APPLY AI\"}]', '[{\"@language\": \"en\", \"@value\": \"68; used with Category D 1968-89; D1-24 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with chemicals, drugs, and endogenous substances to indicate substances or agents which counteract their biological effects by any mechanism.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux substances chimiques, aux médicaments et aux substances endogènes pour désigner les substances ou les agents qui neutralisent leurs effets biologiques par un mécanisme quelconque.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con compuestos químicos, fármacos y sustancias endógenas para indicar sustancias o agentes que neutralizan sus efectos biológicos por cualquier mecanismo.\"}, {\"@language\": \"es\", \"@value\": \"Usado con compuestos químicos, fármacos y sustancias endógenas para indicar sustancias o agentes que neutralizan sus efectos biológicos por cualquier mecanismo.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com compostos químicos, fármacos e substâncias endógenas para indicar substâncias ou agentes que neutralizam seus efeitos biológicos por qualquer mecanismo.\"}]', '1973-12-27', '2017-04-11', '1968-01-01', NULL, NULL),
(9, NULL, '2021-06-04 19:30:49.986447', 1, '22007', 'Q000096', 'Qualifier', 1, 'BI', '[{\"@language\": \"en\", \"@value\": \"biosynthesis\"}, {\"@language\": \"es\", \"@value\": \"biosíntesis\"}, {\"@language\": \"pt-br\", \"@value\": \"biossíntese\"}, {\"@language\": \"fr\", \"@value\": \"biosynthèse\"}, {\"@language\": \"es-es\", \"@value\": \"biosíntesis\"}]', '[\"Q50.040.010\",\"Y08.040.010\"]', '[\"M0030287\"]', 'M0030287', 'T060639', '[{\"@language\": \"en\", \"@value\": \"bioformation\"}, {\"@language\": \"en\", \"@value\": \"anabolism\"}, {\"@language\": \"es\", \"@value\": \"anabolismo\"}, {\"@language\": \"es\", \"@value\": \"bioformación\"}, {\"@language\": \"pt-br\", \"@value\": \"anabolismo\"}, {\"@language\": \"pt-br\", \"@value\": \"bioformação\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"formation\\\" & \\\"production\\\" of substances by living tissue or organisms; see MeSH scope note in Introduction; indexing policy: Manual 19.8.9; DF /biosyn or /BI\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye formación & producción de sustancias por tejidos u organismos vivos; vea definición; política de indización: Manual 19.8.9\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui formação & produção de substâncias por tecidos ou organismos vivos; veja definição; política de indexação: Manual 19.8.9\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/BI or BI (SH) or SUBS APPLY BI\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966-89; D8-9, D12-13 & D24 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the anabolic formation of chemical substances in organisms, in living cells, or by subcellular fractions.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour l\'anabolisme des substances chimiques chez les organismes, dans les cellules vivantes ou les fractions subcellulaires.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la formación anabólica de sustancias químicas en organismos, en células vivas o en fracciones subcelulares.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la formación anabólica de sustancias químicas en organismos, en células vivas o en fracciones subcelulares.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a formação anabólica de substâncias químicas em organismos, em células vivas ou frações subcelulares.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(10, NULL, '2021-06-04 19:30:50.002291', 1, '22062', 'Q000097', 'Qualifier', 1, 'BL', '[{\"@language\": \"en\", \"@value\": \"blood\"}, {\"@language\": \"es\", \"@value\": \"sangre\"}, {\"@language\": \"pt-br\", \"@value\": \"sangue\"}, {\"@language\": \"fr\", \"@value\": \"sang\"}, {\"@language\": \"es-es\", \"@value\": \"sangre\"}]', '[\"Q05.010\",\"Q50.040.020\",\"Y01.010\",\"Y08.040.020\"]', NULL, 'M0030288', 'T060642', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for \\\"in blood\\\" or \\\"blood in\\\" animals or diseases; includes the presence of cells, coagulating elements, endogenous & exogenous chemical substances; not for \\\"serology\\\" ( = /immunology), nor for \\\"serodiagnosis\\\" ( = /diagnosis), nor for the presence of microbes or parasites in the blood in disease ( = /microbiology or /parasitology); see MeSH scope note in Introduction; indexing policy: Manual 19.8.10; DF: /blood or /BL\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para en la sangre o sangre en animales o enfermedades; incluye la presencia de células, elementos coagulantes, sustancias químicas endógenas & exógenas; no para serología ( = /inmunología), no para serodiagnóstico ( = /diagnóstico), no para la presencia de microbios o parásitos en la sangre en enfermedad ( = /microbiología o /parasitología); vea definición; política de indización: Manual 19.8.10\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para no sangue ou sangue em animais ou doenças; inclui a presença de células, elementos coagulantes, substâncias químicas endógenas & exógenas; não para sorologia ( = /imunologia), não para sorodiagnóstico ( = /diagnóstico), não para a presença de micróbios ou parasitos no sangue em doença ( = /microbiologia ou /parasitologia); veja definição; política de indexação: Manual 19.8.10\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/BL or BL (SH) or SUBS APPLY BL\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C, D & F 1967-74; B2, C, D, F3 1975-86; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; B2, C, D1-24 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the presence or analysis of substances in the blood; also for examination of, or changes in, the blood in disease states. It excludes serodiagnosis, for which the subheading \\\"diagnosis\\\" is used, and serology, for which \\\"immunology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la présence de substances dans le sang ou leur analyse. Il s\'emploie également pour l\'examen ou les modifications du sang dans les états pathologiques. Il exclut le sérodiagnostic et la sérologie, pour lesquels les qualificatifs \'diagnostic” et \'immunologie\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la presencia o análisis de sustancias en la sangre. Usado también para el examen de la sangre y sus alteraciones en condiciones patológicas. Excluye el serodiagnóstico, para el que usa el calificador \\\"/diagnóstico\\\" y la serología, para la que se usa /inmunología.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la presencia o análisis de sustancias en la sangre. Usado también para el examen de la sangre y sus alteraciones en condiciones patológicas. Excluye el serodiagnóstico, para el que se usa el calificador /diagnóstico, y la serología, para la que se usa /inmunología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para presença ou análise de substâncias no sangue. Usado também para o exame do sangue e suas alterações em estados patológicos. Exclui o sorodiagnóstico, para o qual o qualificador /diagnóstico é usado, e a sorologia, para o qual /imunologia é usado.\"}]', '1973-12-27', '2003-07-22', '1967-01-01', NULL, NULL),
(11, NULL, '2021-06-04 19:30:50.002291', 1, '22040', 'Q000098', 'Qualifier', 1, 'BS', '[{\"@language\": \"en\", \"@value\": \"blood supply\"}, {\"@language\": \"es\", \"@value\": \"irrigación sanguínea\"}, {\"@language\": \"pt-br\", \"@value\": \"irrigação sanguínea\"}, {\"@language\": \"fr\", \"@value\": \"vascularisation\"}, {\"@language\": \"es-es\", \"@value\": \"irrigación sanguínea\"}]', '[\"Q10.010\",\"Y02.010\"]', '[\"M0030289\",\"M0030290\"]', 'M0030289', 'T060643', '[{\"@language\": \"en\", \"@value\": \"vasculature\"}, {\"@language\": \"es\", \"@value\": \"vasculatura\"}, {\"@language\": \"pt-br\", \"@value\": \"vasculatura\"}, {\"@language\": \"en\", \"@value\": \"microvasculature\"}, {\"@language\": \"es\", \"@value\": \"microvasculatura\"}, {\"@language\": \"pt-br\", \"@value\": \"microvasculatura\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes arteries, veins, capillaries & microvasculature; covers vascular anatomy, circulation & pressure; see MeSH scope note in Introduction; indexing policy: Manual 19.8.11; DF: /blood supply or /BS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye arterias, venas, capilares & microvasculatura; cubre anatomía vascular, circulación & presión; vea definición; política de indización: Manual 19.8.11\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui artérias, veias, capilares & microvasculatura; cobre anatomia vascular, circulação & pressão; veja definição; política de indexação: Manual 19.8.11\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/BS or BS (SH) or SUBS APPLY BS\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966-74; A1-6, A8-10 & A13-16 1975; A1-6, A8-10, A13-16 & C4 1976-89; A1-6, A8-10, A13-14 & C4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for arterial, capillary, and venous systems of an organ or region whenever the specific heading for the vessel does not exist. It includes blood flow through the organ.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les systèmes artériel, capillaire et veineux d\'un organe ou d\'une région anatomique quand il n\'existe pas de descripteur spécifique du vaisseau concerné. Il s’emploie aussi pour le débit sanguin dans un organe.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los sistemas arterial, capilar y venoso de un órgano o región siempre que no exista el descriptor específico para ese vaso. Incluye el flujo sanguíneo a través de un órgano.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los sistemas arterial, capilar y venoso de un órgano o región siempre que no exista el descriptor específico ese vaso. Incluye el flujo sanguíneo a través de un órgano.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para os sistemas arterial, capilar e venoso de um órgão ou região sempre que não exista o descritor específico para esse vaso. Inclui o fluxo sanguíneo através de um órgão.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(12, NULL, '2021-06-04 19:30:50.017912', 1, '22043', 'Q000134', 'Qualifier', 1, 'CF', '[{\"@language\": \"en\", \"@value\": \"cerebrospinal fluid\"}, {\"@language\": \"es\", \"@value\": \"líquido cefalorraquídeo\"}, {\"@language\": \"pt-br\", \"@value\": \"líquido cefalorraquidiano\"}, {\"@language\": \"fr\", \"@value\": \"liquide cérébrospinal\"}, {\"@language\": \"es-es\", \"@value\": \"líquido cefalorraquídeo\"}]', '[\"Q05.020\",\"Q50.040.030\",\"Y01.020\",\"Y08.040.030\"]', NULL, 'M0030318', 'T060681', '[{\"@language\": \"fr\", \"@value\": \"liquide céphalorachidien\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for \\\"in cerebrospinal fluid\\\" or \\\"cerebrospinal fluid in\\\" animals or diseases; includes the presence of cells & endogenous & exogenous chemical substances; not for the presence of microbes or parasites in the cerebrospinal fluid in disease ( = /microbiology or /parasitology); see MeSH scope note in Introduction; indexing policy: Manual 19.8.12; DF: /csf or /CF\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para \\\"en líquido cefalorraquídeo\\\" o \\\"líquido cefalorraquídeo en\\\" animales o enfermedades; incluye la presencia de células y sustancias químicas endógenas y exógenas; no para la presencia de microbios o parásitos en el líquido cefalorraquídeo en enfermedad ( = /microbiología o /parasitología); vea definición; regla de indización: Manual de la NLM 19.8.12\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para \\\"em líquido cefalorraquidiano\\\" ou \\\"líquido cefalorraquidiano em\\\" animais ou doenças; inclui a presença de células e substâncias químicas endógenas e exógenas; não para a presença de micróbios ou parasitos no líquido cefalorraquidiano em doença ( = /microbiologia ou /parasitologia); veja definição; regra de indexação: Manual da NLM 19.8.12\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CF or CF (SH) or SUBS APPLY CF\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C, D & F 1967-74; B2, C, D & F3 1975-86; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1989; B2, C, D1-24 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the presence or analysis of substances in the cerebrospinal fluid; also for examination of or changes in cerebrospinal fluid in disease states.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la présence de substances dans le liquide cérébrospinal ou leur analyse, ainsi que pour l\'examen ou les modifications du liquide cérébrospinal dans les états pathologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la presencia o el análisis de sustancias en el líquido cefalorraquídeo. También se usa para el examen del líquido cefalorraquídeo y sus alteraciones en las enfermedades.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la presencia o el análisis de sustancias en el líquido cefalorraquídeo. También se usa para el examen del líquido cefalorraquídeo y sus alteraciones en las enfermedades.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a presença ou a análise de substâncias no líquido cefalorraquidiano. Também se usa para exames do ou alterações no líquido cefalorraquidiano em estados de doenças.\"}]', '1973-12-27', '2003-07-22', '1967-01-01', NULL, NULL),
(13, NULL, '2021-06-04 19:30:50.017912', 1, '22065', 'Q000138', 'Qualifier', 1, 'CS', '[{\"@language\": \"en\", \"@value\": \"chemical synthesis\"}, {\"@language\": \"es\", \"@value\": \"síntesis química\"}, {\"@language\": \"pt-br\", \"@value\": \"síntese química\"}, {\"@language\": \"fr\", \"@value\": \"synthèse chimique\"}, {\"@language\": \"es-es\", \"@value\": \"síntesis química\"}]', '[\"Q15.040\",\"Y03.040\"]', NULL, 'M0030321', 'T060684', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for chemical preparation or production of substances in vitro only, in laboratories or industry; not for formation of substances in living tissue ( = /biosynthesis); see MeSH scope note in Introduction; indexing policy: Manual 19.8.13; DF: /chem syn or /CS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para preparación o producción química de sustancias in vitro, en laboratorios o industria; no para formación de sustancias en tejidos vivos ( = /biosíntesis); vea definición; regla de indización: Manual de la NLM 19.8.13\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para preparação ou produção química de substâncias in vitro, em laboratórios ou indústria; não para formação de substâncias em tecidos vivos ( = /biossíntese); veja definição; regra de indexação: Manual da NLM 19.8.13\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CS or CS (SH) or SUBS APPLY CS\"}]', '[{\"@language\": \"en\", \"@value\": \"68; used with Category D 1968 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the chemical preparation of molecules in vitro. For the formation of chemical substances in organisms, living cells, or subcellular fractions, \\\"biosynthesis\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la préparation chimique de molécules in vitro. Pour la synthèse de substances chimiques chez les organismes, dans les cellules vivantes ou les fractions subcellulaires, le qualificatif \'biosynthèse” est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la preparación química de moléculas in vitro. Para la formación de sustancias químicas en organismos, células vivas o fracciones subcelulares, usar /biosíntesis.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la preparación química de moléculas in vitro. Para la formación de sustancias químicas en organismos, células vivas o fracciones subcelulares, usar /biosíntesis.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a preparação química de moléculas in vitro. Para a formação de substâncias químicas em organismos, células vivas ou frações subcelulares, usar /biossíntese.\"}]', '1973-12-27', '2003-07-22', '1968-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(14, NULL, '2021-06-04 19:30:50.033541', 1, '22036', 'Q000139', 'Qualifier', 1, 'CI', '[{\"@language\": \"en\", \"@value\": \"chemically induced\"}, {\"@language\": \"es\", \"@value\": \"inducido químicamente\"}, {\"@language\": \"pt-br\", \"@value\": \"induzido quimicamente\"}, {\"@language\": \"fr\", \"@value\": \"induit chimiquement\"}, {\"@language\": \"es-es\", \"@value\": \"inducido químicamente\"}]', '[\"Q35.010\",\"Y05.010\"]', NULL, 'M0030322', 'T060685', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for biol phenomena or diseases induced by endogenous or exogenous substances; indexing policy: Manual 19.8.14; DF: /chem ind or /CI\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para fenónmenos biológicos o enfermedades inducidas por sustancias endógenas o exógenas; política de indización: Manual 19.8.14\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para fenômenos biológicos ou doenças induzidas por substâncias endógenas ou exógenas; política de indexação: Manual 19.8.14\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CI or CI (SH) or SUBS APPLY CI\"}]', '[{\"@language\": \"en\", \"@value\": \"1967; used with Category C & F 1967-1974; C & F3 1975-2000; C, F, & G 2001 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for biological phenomena, diseases, syndromes, congenital abnormalities, or symptoms caused by endogenous or exogenous substances.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les phénomènes biologiques, les maladies, les syndromes, les malformations congénitales et les symptômes provoqués par des substances endogènes ou exogènes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para fenómenos biológicos, enfermedades, síndromes, anormalidades congénitas o síntomas causados por sustancias endógenas o exógenas.\"}, {\"@language\": \"es\", \"@value\": \"Usado para fenómenos biológicos, enfermedades, síndromes, anormalidades congénitas o síntomas causados por sustancias endógenas o exógenas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fenômenos biológicos, doenças, síndromes, anormalidades congênitas ou sintomas causados por substâncias endógenas ou exógenas.\"}]', '1973-12-27', '2003-07-22', '1967-01-01', NULL, NULL),
(15, NULL, '2021-06-04 19:30:50.049173', 1, '22011', 'Q000145', 'Qualifier', 1, 'CL', '[{\"@language\": \"en\", \"@value\": \"classification\"}, {\"@language\": \"es\", \"@value\": \"clasificación\"}, {\"@language\": \"pt-br\", \"@value\": \"classificação\"}, {\"@language\": \"fr\", \"@value\": \"classification\"}, {\"@language\": \"es-es\", \"@value\": \"clasificación\"}]', '[\"Q17\",\"Y19\"]', '[\"M0030329\",\"M0030330\",\"M0030331\"]', 'M0030329', 'T060692', '[{\"@language\": \"en\", \"@value\": \"taxonomy\"}, {\"@language\": \"es\", \"@value\": \"taxonomía\"}, {\"@language\": \"pt-br\", \"@value\": \"taxonomia\"}, {\"@language\": \"en\", \"@value\": \"systematics\"}, {\"@language\": \"es\", \"@value\": \"sistemática\"}, {\"@language\": \"pt-br\", \"@value\": \"sistemática\"}, {\"@language\": \"en\", \"@value\": \"hierarchies\"}, {\"@language\": \"en\", \"@value\": \"hierarchy\"}, {\"@language\": \"es\", \"@value\": \"jerarquías\"}, {\"@language\": \"es\", \"@value\": \"jerarquía\"}, {\"@language\": \"pt-br\", \"@value\": \"hierarquias\"}, {\"@language\": \"pt-br\", \"@value\": \"hierarquia\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"taxonomy\\\", \\\"systematics\\\", \\\"hierarchies\\\"; indexing policy: Manual 19.8.16; DF: /class or /CL\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"taxonomia\\\", \\\"sistemática\\\", \\\"hierarquias\\\"; regra de indexação: Manual da NLM 19.8.16\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"taxonomía\\\", \\\"sistemática\\\", \\\"jerarquías\\\"; regla de indización: Manual de la NLM 19.8.16\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CL or CL (SH) or SUBS APPLY CL\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B 1966; B-I 1967; B-I & N 1968-74; B-N 1975-79; A11 & B-N 1980-89; B-E, F2-4, G1-2, G12, I, J, M & N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for taxonomic or other systematic or hierarchical classification systems.\"}, {\"@language\": \"fr\", \"@value\": \"S’emploie pour les systèmes de classification taxinomique et autres systèmes de classification systématique ou hiérarchique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para taxonomía u otros sistemas de clasificación sistemáticos o jerárquicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para taxonomía u otros sistemas de clasificación sistemáticos o jerárquicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para taxonomia ou outros sistemas de classificação sistemáticos ou hierárquicos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(16, NULL, '2021-06-04 19:30:50.064772', 1, '22012', 'Q000150', 'Qualifier', 1, 'CO', '[{\"@language\": \"en\", \"@value\": \"complications\"}, {\"@language\": \"es\", \"@value\": \"complicaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"complicações\"}, {\"@language\": \"fr\", \"@value\": \"complications\"}, {\"@language\": \"es-es\", \"@value\": \"complicaciones\"}]', '[\"Q35.020\",\"Y05.020\"]', '[\"M0030336\",\"M0030337\",\"M0030342\",\"M0030339\",\"M0030340\",\"M0030341\",\"M0030335\",\"M0030338\"]', 'M0030334', 'T060699', '[{\"@language\": \"en\", \"@value\": \"associated disease\"}, {\"@language\": \"es\", \"@value\": \"enfermedades asociadas\"}, {\"@language\": \"pt-br\", \"@value\": \"doenças associadas\"}, {\"@language\": \"en\", \"@value\": \"coexistent conditions\"}, {\"@language\": \"es\", \"@value\": \"afecciones coexistentes\"}, {\"@language\": \"pt-br\", \"@value\": \"afecções coexistentes\"}, {\"@language\": \"en\", \"@value\": \"sequels\"}, {\"@language\": \"en\", \"@value\": \"concomitant conditions\"}, {\"@language\": \"es\", \"@value\": \"afecciones concomitantes\"}, {\"@language\": \"pt-br\", \"@value\": \"afecções concomitantes\"}, {\"@language\": \"en\", \"@value\": \"concomitant disease\"}, {\"@language\": \"es\", \"@value\": \"enfermedades concomitantes\"}, {\"@language\": \"pt-br\", \"@value\": \"doenças concomitantes\"}, {\"@language\": \"en\", \"@value\": \"sequelae\"}, {\"@language\": \"es\", \"@value\": \"secuelas\"}, {\"@language\": \"pt-br\", \"@value\": \"sequelas\"}, {\"@language\": \"en\", \"@value\": \"associated conditions\"}, {\"@language\": \"es\", \"@value\": \"afecciones asociadas\"}, {\"@language\": \"pt-br\", \"@value\": \"afecções associadas\"}, {\"@language\": \"en\", \"@value\": \"coexistent disease\"}, {\"@language\": \"es\", \"@value\": \"enfermedades coexistentes\"}, {\"@language\": \"pt-br\", \"@value\": \"doenças coexistentes\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"sequelae\\\"; also for \\\"co-existent\\\" or \\\"associated\\\" diseases; see MeSH scope note in Introduction; indexing policy: Manual 19.8.17; DF: /compl or /CO\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye secuelas; también para enfermedades coexistentes o asociadas; vea definición; regla de indización: Manual de la NLM 19.8.17\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui sequelas; também para doenças coexistentes ou associadas; veja definição; regra de indexação: Manual da NLM 19.8.17\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CO or CO (SH) or SUBS APPLY CO\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases to indicate conditions that co-exist or follow, i.e., co-existing diseases, complications, or sequelae.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour désigner les affections qui apparaissent avec ou à la suite de ces maladies, c’est-à-dire les maladies coexistantes, les complications ou les séquelles.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para indicar afecciones que coexisten o suceden a otra, es decir, enfermedades coexistentes, complicaciones o secuelas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para indicar afecciones que coexisten o suceden a otra, es decir, enfermedades coexistentes, complicaciones o secuelas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para indicar afecções que coexistem ou sucedem uma outra, ou seja, doenças coexistentes, complicações ou sequelas.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(17, NULL, '2021-06-04 19:30:50.064772', 1, '22013', 'Q000151', 'Qualifier', 1, 'CN', '[{\"@language\": \"en\", \"@value\": \"congenital\"}, {\"@language\": \"es\", \"@value\": \"congénito\"}, {\"@language\": \"pt-br\", \"@value\": \"congênito\"}, {\"@language\": \"fr\", \"@value\": \"congénital\"}, {\"@language\": \"es-es\", \"@value\": \"congénito\"}]', '[\"Q35.030\",\"Y05.030\"]', '[\"M0030343\"]', 'M0030343', 'T060708', '[{\"@language\": \"en\", \"@value\": \"connatal\"}, {\"@language\": \"es\", \"@value\": \"connatural\"}, {\"@language\": \"pt-br\", \"@value\": \"conatural\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; diseases existing at or before birth; not for structural abnormalities ( = /abnormalities) nor for birth injuries ( = /injuries); indexing policy: Manual 19.8.18; DF: /congen or /CN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; enfermedades existentes al nacimiento o antes del nacimiento; no para anomalías estructurales ( = /anomalías) ni para traumatismos del nacimiento ( = /lesiones); política de indización: Manual 19.8.18\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; doenças existentes ao nascimento ou antes do nascimento; não para anormalidades estruturais ( = /anormalides) nem para traumatismos do nascimento ( = /lesões); política de indexação: Manual 19.8.18\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CN or CN (SH) or SUBS APPLY CN\"}]', '[{\"@language\": \"en\", \"@value\": \"66\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings to indicate those conditions existing at, and usually before, birth. It excludes morphologic abnormalities and birth injuries, for which \\\"abnormalities\\\" and \\\"injuries\\\" are used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour indiquer les affections existant à la naissance et généralement avant. Il exclut les malformations et les traumatismes obstétricaux, pour lesquels les qualificatifs \'malformations” et \'traumatismes” sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores de enfermedades para indicar afecciones existentes en, y generalmente antes, del nacimiento; excluye anormalidades morfológicas y lesiones en el parto para los cuales se usan /anomalías y /lesiones.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores de enfermedades para indicar afecciones existentes en, y generalmente antes, del nacimiento; excluye anormalidades morfológicas y lesiones en el parto para los cuales se usan /anomalías y /lesiones.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores de doenças para indicar afecções existentes ao nascimento e geralmente antes do nascimento. Exclui anormalidades morfológicas e traumatismos do nascimento, para os quais os qualificadores /anormalidades e /lesões são usados.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(18, NULL, '2021-06-04 19:30:50.086978', 1, '22010', 'Q000166', 'Qualifier', 1, 'CY', '[{\"@language\": \"en\", \"@value\": \"cytology\"}, {\"@language\": \"es\", \"@value\": \"citología\"}, {\"@language\": \"pt-br\", \"@value\": \"citologia\"}, {\"@language\": \"fr\", \"@value\": \"cytologie\"}, {\"@language\": \"es-es\", \"@value\": \"citología\"}]', '[\"Q10.020\",\"Y02.020\"]', '[\"M0030350\",\"M0030351\",\"M0030352\"]', 'M0030350', 'T060717', '[{\"@language\": \"en\", \"@value\": \"cellular aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos celulares\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos celulares\"}, {\"@language\": \"en\", \"@value\": \"cellular morphology\"}, {\"@language\": \"en\", \"@value\": \"cell morphology\"}, {\"@language\": \"es\", \"@value\": \"morfología celular\"}, {\"@language\": \"es\", \"@value\": \"morfología de la célula\"}, {\"@language\": \"pt-br\", \"@value\": \"morfologia celular\"}, {\"@language\": \"pt-br\", \"@value\": \"morfologia da célula\"}, {\"@language\": \"en\", \"@value\": \"cell structure\"}, {\"@language\": \"en\", \"@value\": \"cellular structure\"}, {\"@language\": \"es\", \"@value\": \"estructura de la célula\"}, {\"@language\": \"es\", \"@value\": \"estructura celular\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura da célula\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura celular\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; normal structure only; for non-normal, use /pathology; includes cellular & intracellular structure, morphology, multiplication, cell cycle, differentiation, etc.; see also /ultrastructure; indexing policy: Manual 19.8.20; DF: /cytol or /CY\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente estructura normal; para no normal, use /patología; incluye estructura celular & intracelular, morfología, multiplicación, ciclo celular, diferenciación, etc.; vea también /ultraestructura; vea definición; política de indización: Manual 19.8.20\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente estrutura normal; para não normal, use /patologia; inclui estrutura celular & intracelular, morfologia, multiplicação, ciclo celular, diferenciação, etc.; veja também /ultraestrutura; veja definição; política de indexação: Manual 19.8.20\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/CY or CY (SH) or SUBS APPLY CY\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category A & B 1966-85; A, B1, B3 & B5-6 1986; A, B1, B3, B5-6 & ASCITIC FLUID 1987; A, B1, B3, B5-6, ASCITIC FLUID & BRONCHOALVEOLAR LAVAGE FLUID 1988-89; A2-10, A12-16, B1, B3 & B5-6 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for cellular appearance of unicellular and multicellular organisms.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la morphologie cellulaire des organismes unicellulaires ou pluricellulaires.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la morfología celular normal de organismos unicelulares y multicelulares.\"}, {\"@language\": \"es\", \"@value\": \"Usado para morfologia celular normal de organismos unicelulares y multicelulares.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para morfologia celular normal de organismos unicelulares e multicelulares.\"}]', '1973-12-27', '2004-07-09', '1967-01-01', NULL, NULL),
(19, NULL, '2021-06-04 19:30:50.086978', 1, '22015', 'Q000172', 'Qualifier', 1, 'DF', '[{\"@language\": \"en\", \"@value\": \"deficiency\"}, {\"@language\": \"es\", \"@value\": \"deficiencia\"}, {\"@language\": \"pt-br\", \"@value\": \"deficiência\"}, {\"@language\": \"fr\", \"@value\": \"déficit\"}, {\"@language\": \"es-es\", \"@value\": \"deficiencia\"}]', '[\"Q50.040.040\",\"Y08.040.040\"]', NULL, 'M0030357', 'T060727', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for deficient or inadequate intake or biosynthesis; also for deficient secretion of endogenous substances; see MeSH scope note in Introduction; indexing policy: Manual 19.8.21; /DF: /defic or /DF\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para ingestión deficiente o inadecuada o biosíntesis; también para secreción deficiente de sustancias endógenas; vea definición; política de indización: Manual 19.8.21\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para ingestão deficiente ou inadequada ou biossíntese; também para secreção deficiente de substâncias endógenas; veja definição; política de indexação: Manual 19.8.21\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/DF or DF (SH) or SUBS APPLY DF\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category D 1975-89; D8, D12-13 & D24 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with endogenous and exogenous substances which are absent or in diminished amount relative to the normal requirement of an organism or a biologic system.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux substances endogènes ou exogènes qui sont absentes ou en quantité réduite par rapport aux besoins normaux d\'un organisme ou d\'un système biologique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con sustancias endógenas y exógenas que están ausentes o en cantidad reducida en relación con las necesidades normales de un organismo o un sistema biológico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con sustancias endógenas y exógenas que están ausentes o en cantidad reducida en relación con las necesidades normales de un organismo o un sistema biológico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com substâncias endógenas e exógenas que estão ausentes ou em quantidade reduzida em relação às necessidades normais de um organismo ou sistema biológico.\"}]', '1974-10-23', '2003-07-22', '1975-01-01', NULL, NULL),
(20, NULL, '2021-06-04 19:30:50.102614', 1, '22016', 'Q000175', 'Qualifier', 1, 'DI', '[{\"@language\": \"en\", \"@value\": \"diagnosis\"}, {\"@language\": \"es\", \"@value\": \"diagnóstico\"}, {\"@language\": \"pt-br\", \"@value\": \"diagnóstico\"}, {\"@language\": \"fr\", \"@value\": \"diagnostic\"}, {\"@language\": \"es-es\", \"@value\": \"diagnóstico\"}]', '[\"Q20\",\"Y04\"]', '[\"M0030365\",\"M0030363\",\"M0030364\",\"M0030362\"]', 'M0030360', 'T060730', '[{\"@language\": \"es\", \"@value\": \"uso diagnóstico\"}, {\"@language\": \"pt-br\", \"@value\": \"uso diagnóstico\"}, {\"@language\": \"en\", \"@value\": \"symptoms\"}, {\"@language\": \"es\", \"@value\": \"síntomas\"}, {\"@language\": \"pt-br\", \"@value\": \"sintomas\"}, {\"@language\": \"en\", \"@value\": \"signs\"}, {\"@language\": \"es\", \"@value\": \"señales\"}, {\"@language\": \"pt-br\", \"@value\": \"sinais\"}, {\"@language\": \"en\", \"@value\": \"findings\"}, {\"@language\": \"es\", \"@value\": \"hallazcos\"}, {\"@language\": \"pt-br\", \"@value\": \"achados\"}, {\"@language\": \"en\", \"@value\": \"screening\"}, {\"@language\": \"es\", \"@value\": \"tamizaje\"}, {\"@language\": \"es\", \"@value\": \"rastreo\"}, {\"@language\": \"pt-br\", \"@value\": \"triagem\"}, {\"@language\": \"pt-br\", \"@value\": \"rastreamento\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only;  includes \\\"examination\\\", \\\"symptoms\\\"\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"exámenes\\\" y \\\"síntomas\\\"\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"exames\\\" e \\\"sintomas\\\"\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/DI or DI (SH) or SUBS APPLY DI\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for all aspects of diagnosis, including examination, differential diagnosis and prognosis. Excludes diagnosis using imaging techniques (e.g. radiography, scintigraphy, and ultrasonography) for which \\\"diagnostic imaging\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les différents aspects du diagnostic, y compris l\'examen, le diagnostic différentiel et le pronostic. Il exclut le dépistage de masse, pour lequel le qualificatif \'prévention et contrôle\' est employé. Il exclut les diagnostics radiographique, scintigraphique et échographique, pour lesquels les qualificatifs \'radiographie\', \'scintigraphie\' et \'échographie\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para referirse a todos los aspectos del diagnóstico, incluidos la exploración física, el diagnóstico diferencial y el pronóstico; se excluyen los cribados masivos, para los que se reserva el calificador \\\"/prevención & control\\\". Excluye también el radiodiagnóstico, el diagnóstico escintigráfico y el diagnóstico por ultrasonidos, para los que se utiliza \\\"/diagnóstico por imagen\\\".\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para referirse a todos los aspectos del diagnóstico, incluidos la exploración física, el diagnóstico diferencial y el pronóstico; se excluyen los cribados masivos, para los que se reserva el calificador \\\"/prevención y control\\\". Excluye también el radiodiagnóstico, el diagnóstico escintigráfico y el diagnóstico por ultrasonidos, para los que se utiliza \\\"/diagnóstico por imagen\\\".\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para todos os tipos de diagnóstico, incluindo exames, diagnóstico diferencial e prognóstico; exclui programas de rastreamento em massa para os quais \\\"/prevenção e controle\\\" é usado. Exclui os diagnósticos radiográfico, cintilográfico e ultrassônico para os quais \\\"/diagnóstico por imagem\\\" é usado.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(21, NULL, '2021-06-04 19:30:50.102614', 1, '22017', 'Q000178', 'Qualifier', 1, 'DH', '[{\"@language\": \"en\", \"@value\": \"diet therapy\"}, {\"@language\": \"es\", \"@value\": \"dietoterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"dietoterapia\"}, {\"@language\": \"fr\", \"@value\": \"diétothérapie\"}, {\"@language\": \"es-es\", \"@value\": \"dietoterapia\"}]', '[\"Q65.010\",\"Y11.010\"]', '[\"M0030367\"]', 'M0030367', 'T060737', '[{\"@language\": \"en\", \"@value\": \"nutritional management\"}, {\"@language\": \"en\", \"@value\": \"dietary management\"}, {\"@language\": \"es\", \"@value\": \"manejo dietético\"}, {\"@language\": \"es\", \"@value\": \"manejo nutricional\"}, {\"@language\": \"pt-br\", \"@value\": \"manejo dietético\"}, {\"@language\": \"pt-br\", \"@value\": \"manejo nutricional\"}, {\"@language\": \"fr\", \"@value\": \"thérapie diététique\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for dietary & nutritional management of a disease by a physician; not for self diets; not for vitamin or mineral supplements prescribed by a physician ( = /drug therapy); indexing policy: Manual 19.8.24; DF: /diet ther or /DH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para administración dietética & nutricional de una enfermedad por un médico; no para auto dietas; no para vitaminas & suplementos minerales prescribidos por un médico ( = /trat farm); política de indización: Manual 19.8.24\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para administração dietética & nutricional de uma doença por um médico; não para auto dietas; não para vitaminas & suplementos minerais prescritos por um médico ( = /trat farm); política de indexação: Manual 19.8.24\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/DH or DH (SH) or SUBS APPLY DH\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category C & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for dietary and nutritional management of the disease. The concept does not include vitamin or mineral supplements, for which \\\"drug therapy\\\" may be used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour leur prise en charge alimentaire ou nutritionnelle. Il exclut la supplémentation vitaminique ou minérale, pour laquelle le qualificatif \'traitement médicamenteux\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores de enfermedades para el control dietético y nutricional de las mismas. El concepto no incluye suplementos de vitaminas o minerales, para los que debe utilizarse el calificador /farmacoterapia.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores de enfermedades para el control dietético y nutricional de las mismas. No incluye suplemento de vitaminas o minerales para los que debe utilizarse \\\"/tratamiento farmacológico\\\".\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores de doenças para conduta dietética e nutricional. Não inclui suplementos vitamínicos e minerais, para os quais deve ser usado o qualificador \\\"/tratamento farmacológico\\\".\"}]', '1974-10-23', '2015-12-15', '1975-01-01', NULL, NULL),
