\", \"@value\": \"Usado con órganos, regiones anatómicas, tejidos, organismos y procesos fisiológicos y psicológicos para los efectos de los fármacos y las sustancias químicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas, tejidos, organismos y procesos fisiológicos y psicológicos para los efectos de los fármacos y las sustancias químicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anâtômicas, tecidos, organismos, processos fisiológicos e psicológicos para os efeitos de fármacos e substâncias químicas.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(23, NULL, '2021-06-04 19:30:50.133887', 1, '22057', 'Q000188', 'Qualifier', 1, 'DT', '[{\"@language\": \"en\", \"@value\": \"drug therapy\"}, {\"@language\": \"es\", \"@value\": \"tratamiento farmacológico\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento farmacológico\"}, {\"@language\": \"pt-br\", \"@value\": \"quimioterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"quimiotratamento\"}, {\"@language\": \"fr\", \"@value\": \"traitement médicamenteux\"}, {\"@language\": \"es-es\", \"@value\": \"farmacoterapia\"}]', '[\"Q65.020\",\"Y11.020\"]', '[\"M0030372\"]', 'M0030372', 'T060746', '[{\"@language\": \"en\", \"@value\": \"pharmacologic therapy\"}, {\"@language\": \"en\", \"@value\": \"pharmacotherapy\"}, {\"@language\": \"en\", \"@value\": \"chemotherapy\"}, {\"@language\": \"es\", \"@value\": \"quimioter\"}, {\"@language\": \"es\", \"@value\": \"quimioterapia\"}, {\"@language\": \"es\", \"@value\": \"quimiotratamiento\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia medicamentosa\"}, {\"@language\": \"es\", \"@value\": \"tratamiento medicamentoso\"}, {\"@language\": \"es\", \"@value\": \"terapia con medicamentos\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con medicamentos\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con fármacos\"}, {\"@language\": \"es\", \"@value\": \"terapia farmacológica\"}, {\"@language\": \"es\", \"@value\": \"farmacoter\"}, {\"@language\": \"es\", \"@value\": \"farmacoterapia\"}, {\"@language\": \"es\", \"@value\": \"terapia por drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia con drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia con fármacos\"}, {\"@language\": \"pt-br\", \"@value\": \"chemother\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia medicamentosa\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento medicamentoso\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com medicamentos\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com medicamentos\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com fármacos\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia farmacológica\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacoter\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacoterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com fármacos\"}, {\"@language\": \"fr\", \"@value\": \"chimiothérapie\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes treatment or prevention by drugs &  chemicals; includes therapy with antibiotics; not for immunotherapy nor for tissue therapy  ( = /therapy); see MeSH scope note in Introduction; indexing policy: Manual 19.8.26;  DF: /drug ther or /DT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye tratamiento o prevención por medicamentos & sustancias químicas; incluye terapia con antibióticos; no para inmumoterapia ni para terapia tisular ( = /terap); vea definición; no use para homeopatia, en esos casos la coord correcta es medicamento /uso terap con enfermedad /terap; política de indización: Manual 19.8.26\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui tratamento ou prevenção por medicamentos & substâncias químicas; inclui terapia com antibióticos; não para imumoterapia nem para terapia tissular ( = /terap); veja definição; não use para homeopatia, nesses casos a coord correta é medicamento /uso terap com doença /terap; política de indexação: Manual 19.8.26\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/DT or DT (SH) or SUBS APPLY DT\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975-87; C, F3 & SMOKING 1988; C, F3 & SMOKING+ 1989; C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for the treatment of disease by the administration of drugs, chemicals, and antibiotics. For diet therapy and radiotherapy, use  specific subheadings. Excludes immunotherapy for which \\\"therapy\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour leur traitement par l\'administration de médicaments, de substances chimiques ou d\'antibiotiques. Pour le régime alimentaire et la radiothérapie, les qualificatifs \'diétothérapie\' et \'radiothérapie\' sont respectivement utilisés. Il exclut l\'immunothérapie, pour laquelle le qualificatif \'thérapie\' est employé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para su tratamiento con fármacos, productos químicos y antibióticos. Para dietoterapia y radioterapia debe usarse sus calificadores específicos. Para inmunoterapia, usar el calificador /terapia.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para su tratamiento con fármacos, productos químicos y antibióticos. Para dietoterapia y radioterapia debe usarse estos calificadores específicos. Para inmunoterapia, usar el calificador /terapia.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para o seu tratamento com fármacos, produtos químicos e antibióticos. Para dietoterapia e radioterapia usar estes qualificadores específicos. Para imunoterapia usar o qualificador /terapia.\"}]', '1999-11-03', '2003-07-22', '1966-01-01', NULL, NULL),
(24, NULL, '2021-06-04 19:30:50.149485', 1, '22018', 'Q000191', 'Qualifier', 1, 'EC', '[{\"@language\": \"en\", \"@value\": \"economics\"}, {\"@language\": \"es\", \"@value\": \"economía\"}, {\"@language\": \"pt-br\", \"@value\": \"economia\"}, {\"@language\": \"fr\", \"@value\": \"économie\"}, {\"@language\": \"es-es\", \"@value\": \"economía\"}]', '[\"Q40.010\",\"Y06.010\"]', '[\"M0030377\",\"M0030379\",\"M0030378\",\"M0030380\",\"M0030382\",\"M0030376\",\"M0030381\"]', 'M0030375', 'T060752', '[{\"@language\": \"es\", \"@value\": \"aspectos económicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos econômicos\"}, {\"@language\": \"en\", \"@value\": \"fees\"}, {\"@language\": \"es\", \"@value\": \"tarifas\"}, {\"@language\": \"pt-br\", \"@value\": \"tarifas\"}, {\"@language\": \"en\", \"@value\": \"salaries\"}, {\"@language\": \"es\", \"@value\": \"sueldos\"}, {\"@language\": \"pt-br\", \"@value\": \"salários\"}, {\"@language\": \"en\", \"@value\": \"financial management\"}, {\"@language\": \"es\", \"@value\": \"administración financiera\"}, {\"@language\": \"pt-br\", \"@value\": \"administração financeira\"}, {\"@language\": \"en\", \"@value\": \"financing\"}, {\"@language\": \"es\", \"@value\": \"financiación\"}, {\"@language\": \"pt-br\", \"@value\": \"financiamento\"}, {\"@language\": \"en\", \"@value\": \"funding\"}, {\"@language\": \"es\", \"@value\": \"fondos\"}, {\"@language\": \"pt-br\", \"@value\": \"fundos\"}, {\"@language\": \"en\", \"@value\": \"cost\"}, {\"@language\": \"es\", \"@value\": \"costo\"}, {\"@language\": \"pt-br\", \"@value\": \"custo\"}, {\"@language\": \"en\", \"@value\": \"finances\"}, {\"@language\": \"es\", \"@value\": \"finanzas\"}, {\"@language\": \"pt-br\", \"@value\": \"finanças\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"finances\\\", \\\"financing\\\", \\\"funding\\\", \\\"costs\\\", \\\"fees\\\", \\\"salaries\\\", \\\"financial management\\\", etc.; see MeSH scope note in Introduction; indexing policy: Manual 19.8.27; DF: /econ or /EC      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye finanzas, financiamiento, fondos, costos, tazas, sueldos, administración financiera, etc.; vea definición; política de indización: Manual 19.8.27\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui finanças, financiamento, fundos, custos, taxas, salários, administração financeira, etc.; veja definição; política de indexação: Manual 19.8.27\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EC or EC (SH) or SUBS APPLY EC\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category C, E, F3 & N2-4 1978-79; C, E, F3-4, G1-3, I2, J, L & N2-4 1980-87; C, E, F3-4, G1-3, I2, J, L, N2-4 & SMOKING 1988; C, E, F3-4, G1-3, I2, J, L, N2-4 & SMOKING+ 1989; C, E, F3-4, G1-2, I2-3, J & N2-4 1990-91; C, D, E, F3-4, G1-2 I2-3, J & N2-4 1992 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the economic aspects of any subject, as well as for all aspects of financial management. It includes the raising or providing of funds.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les aspects économiques et les aspects de gestion financière. Il inclut la collecte et la distribution de fonds.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los aspectos económicos de cualquier tema así como para todos los aspectos de administración financiera. Incluye recolección y provisión de fondos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los aspectos económicos de cualquier tema así como para todos los aspectos de administración financiera. Incluye recolección y provisión de fondos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado tanto para os aspectos econômicos de qualquer assunto como para os aspectos de administração financeira. Inclui o levantamento e a provisão de fundos.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(25, NULL, '2021-06-04 19:30:50.165134', 1, '22019', 'Q000193', 'Qualifier', 1, 'ED', '[{\"@language\": \"en\", \"@value\": \"education\"}, {\"@language\": \"es\", \"@value\": \"educación\"}, {\"@language\": \"pt-br\", \"@value\": \"educação\"}, {\"@language\": \"fr\", \"@value\": \"enseignement et éducation\"}, {\"@language\": \"es-es\", \"@value\": \"educación\"}]', '[\"Q25\",\"Y23\"]', '[\"M0030386\",\"M0030387\",\"M0030385\"]', 'M0030384', 'T060761', '[{\"@language\": \"en\", \"@value\": \"teaching\"}, {\"@language\": \"es\", \"@value\": \"enseñanza\"}, {\"@language\": \"pt-br\", \"@value\": \"ensino\"}, {\"@language\": \"en\", \"@value\": \"training\"}, {\"@language\": \"es\", \"@value\": \"capacitación\"}, {\"@language\": \"pt-br\", \"@value\": \"capacitação\"}, {\"@language\": \"en\", \"@value\": \"curriculum\"}, {\"@language\": \"es\", \"@value\": \"currículo\"}, {\"@language\": \"pt-br\", \"@value\": \"currículo\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"training\\\", \\\"teaching\\\", \\\"curriculum\\\"; for the teacher teaching, the student learning & the courses taught; see MeSH scope note in Introduction; indexing policy: Manual 19.8.28; DF: /educ or /ED      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye entrenamiento, enseñanza, curriculum; para la enseñanza por parte de los maestros, el aprendizado de los alumnos & para los cursos ministrados; vea definición; política de indización: Manual 19.8.28\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui treinamento, ensino, curriculum; para o ensino por parte dos professores, o aprendizado de alunos & cursos ministrados; veja definição; política de indexação: Manual 19.8.28\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/ED or ED (SH) or SUBS APPLY ED\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category F-I 1967; F-I & N 1968-71; F-I, M & N 1972-74; E, F, G1-3, H-M & N1-2 1975-89; F4, G1-2, I3 & M 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for education, training programs, and courses in various fields and disciplines, and for training groups of persons.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour l\'enseignement, les programmes de formation et les cours dans divers champs et disciplines, ainsi que pour les groupes de personnes en formation.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para educación, programas de entrenamiento y cursos de varios campos y disciplinas y para la capacitación de grupos de personas.\"}, {\"@language\": \"es\", \"@value\": \"Usado para educación, programas de entrenamiento y cursos de varios campos y disciplinas y para la capacitación de grupos de personas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para educação, programas de treinamento e cursos nos vários campos e disciplinas. Usado também para treinamento de grupos de pessoas.\"}]', '1973-12-27', '2003-07-24', '1967-01-01', NULL, NULL),
(26, NULL, '2021-06-04 19:30:50.165134', 1, '22023', 'Q000196', 'Qualifier', 1, 'EM', '[{\"@language\": \"en\", \"@value\": \"embryology\"}, {\"@language\": \"es\", \"@value\": \"embriología\"}, {\"@language\": \"pt-br\", \"@value\": \"embriologia\"}, {\"@language\": \"fr\", \"@value\": \"embryologie\"}, {\"@language\": \"es-es\", \"@value\": \"embriología\"}]', '[\"Q10.030\",\"Q35.040\",\"Y02.030\",\"Y05.040\"]', '[\"M0030395\",\"M0030392\",\"M0030393\",\"M0030394\"]', 'M0030391', 'T060768', '[{\"@language\": \"en\", \"@value\": \"prenatal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo prenatal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento pré-natal\"}, {\"@language\": \"en\", \"@value\": \"fetal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo fetal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento fetal\"}, {\"@language\": \"en\", \"@value\": \"embryonic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos embrionarios\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos embrionários\"}, {\"@language\": \"en\", \"@value\": \"embryonic development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo embrionario\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento embrionário\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"embryonic\\\", \\\"embryonal\\\", \\\"embryological aspects\\\"; for embryonic & fetal development; see MeSH scope note in Introduction; indexing policy: Manual 19.8.29; DF: /embryol or /EM\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"embrionario\\\", \\\"embrional\\\", \\\"aspectos embriológicos\\\"; para desarrollo embrionario & fetal; vea definición; regla de indización: Manual de la NLM 19.8.29\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"embrionário\\\", \\\"embrional\\\", \\\"aspectos embriológicos\\\"; para desenvolvimento embrionário & fetal; veja definição; regra de indexação: Manual da NLM 19.8.29\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EM or EM (SH) or SUBS APPLY EM\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966; A & B 1967-69; A, B & C 1970-74; A1-10, A13-15, B1-2, B6 & C 1975-89; A1-10, A13-14, B1-2, B6 & C 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, regions, and animal headings for embryologic and fetal development. It is used also with diseases for embryologic factors contributing to postnatal disorders.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux régions anatomiques et aux animaux pour leurs développements embryonnaire et fœtal. Il s\'applique aussi aux maladies pour les facteurs embryologiques contribuant aux troubles postnatals.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, regiones anatómicas y animales para el desarrollo embriológico y fetal. Usado también con enfermedades para factores embriológicos que contribuyen a trastornos posnatales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas y animales para el desarrollo embriológico y fetal. Usado también con enfermedades para factores embriológicos que contribuyen a trastornos posnatales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anatômicas e animais para o desenvolvimento embriológico e fetal. Usado também com doenças para fatores embriológicos que contribuem para distúrbios pós-natais.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(27, NULL, '2021-06-04 19:30:50.186815', 1, '22026', 'Q000201', 'Qualifier', 1, 'EN', '[{\"@language\": \"en\", \"@value\": \"enzymology\"}, {\"@language\": \"es\", \"@value\": \"enzimología\"}, {\"@language\": \"pt-br\", \"@value\": \"enzimologia\"}, {\"@language\": \"fr\", \"@value\": \"enzymologie\"}, {\"@language\": \"es-es\", \"@value\": \"enzimología\"}]', '[\"Q50.040.050\",\"Y08.040.050\"]', '[\"M0030398\",\"M0030399\"]', 'M0030398', 'T060775', '[{\"@language\": \"en\", \"@value\": \"enzymes\"}, {\"@language\": \"es\", \"@value\": \"enzimas\"}, {\"@language\": \"pt-br\", \"@value\": \"enzimas\"}, {\"@language\": \"en\", \"@value\": \"enzyme activity\"}, {\"@language\": \"es\", \"@value\": \"actividad enzimática\"}, {\"@language\": \"pt-br\", \"@value\": \"atividade enzimática\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for enzymatic metabolism, kinetics, analysis & inhibition; not for CLINICAL ENZYME TESTS ( = /diagnosis); see MeSH scope note in Introduction; indexing policy: Manual 19.8.30; DF: /enzymol or /EN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para metabolismo enzimático, cinética, análisis & inhibición; no para PRUEBAS ENZIMÁTICAS CLÍNICAS ( = /diagnóstico); vea definición; regla de indización: Manual de la NLM 19.8.30\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para metabolismo enzimático, cinética, análise & inibição; não para ENSAIOS ENZIMÁTICOS CLÍNICOS ( = /diagnóstico); veja definição; regra de indexação: Manual da NLM 19.8.30\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EN or EN (SH) or SUBS APPLY EN\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A & B 1966-67; A-C & F 1968-74; A, B1, B3-6, C & F3 1975-89; A2-16, B1, B3-6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organisms, except vertebrates, and with organs and tissues. It is also used with diseases for enzymes during the course of the disease, but excludes diagnostic enzyme tests, for which \\\"diagnosis\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organismes, à l\'exclusion des vertébrés, ainsi qu’aux organes et aux tissus. Il s\'applique aussi aux maladies pour les enzymes au cours de ces maladies. Il exclut les tests enzymatiques à visée diagnostique, pour lesquels le qualificatif \'diagnostic” est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con organismos, excepto vertebrados, con órganos y tejidos, y también con enfermedades, para enzimas durante el curso de la enfermedad. Excluye pruebas enzimáticas de diagnóstico, para las cuales se usa /diagnóstico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con organismos, excepto vertebrados, con órganos y tejidos, y también con enfermedades, para enzimas durante el curso de la enfermedad. Excluye pruebas enzimáticas de diagnóstico, para las cuales se usa /diagnóstico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com organismos, exceto vertebrados, e com órgãos e tecidos. Também é usado com doenças para enzimas durante o curso da doença, mas exclui testes enzimáticos de diagnóstico, para os quais se usa /diagóstico.\"}]', '1973-12-27', '2007-07-10', '1966-01-01', NULL, NULL),
(28, NULL, '2021-06-04 19:30:50.186815', 1, '22028', 'Q000208', 'Qualifier', 1, 'EH', '[{\"@language\": \"en\", \"@value\": \"ethnology\"}, {\"@language\": \"es\", \"@value\": \"etnología\"}, {\"@language\": \"pt-br\", \"@value\": \"etnologia\"}, {\"@language\": \"fr\", \"@value\": \"ethnologie\"}, {\"@language\": \"es-es\", \"@value\": \"etnología\"}]', '[\"Q55.010.010\",\"Y09.010.010\"]', '[\"M0030408\",\"M0030407\"]', 'M0030405', 'T060783', '[{\"@language\": \"en\", \"@value\": \"ethnicity\"}, {\"@language\": \"es\", \"@value\": \"etnicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"etnicidade\"}, {\"@language\": \"en\", \"@value\": \"culture\"}, {\"@language\": \"es\", \"@value\": \"cultura\"}, {\"@language\": \"pt-br\", \"@value\": \"cultura\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with disease & selected terms for \\\"the place of origin of a group of people\\\"; with geog terms for the place of origin; indexing policy: Manual 19.8.32; DF: /ethnol or /EH      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; con enfermedades & términos seleccionados para \\\"el local de origen de un grupo de personas\\\"; con términos geográficos para el local de origen; regla de indización: Manual de la NLM 19.8.32\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; com doenças & termos selecionados para \\\"o local de origem de um grupo de pessoas\\\"; com termos geográficos para o local de origem; regra de indexação: Manual da NLM 19.8.32\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EH or EH (SH) or SUBS APPLY EH; restricted to Category Z 1975-86\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category Z 1975-86; C, F3 Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS & PUBERTY+ 1987; C, F3, Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, PUBERTY+ & SMOKING 1988; C, F3, Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FAMILY+, FOOD HABITS, HOMOSEXUALITY, PUBERTY+ & SMOKING+ 1989; C1-21, C23, F3 & Z 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for ethnic, cultural, or anthropological aspects, and with geographic headings to indicate the place of origin of a group of people.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les aspects ethniques, culturels ou anthropologiques, ainsi qu\'aux descripteurs géographiques pour indiquer le lieu d\'origine d\'un groupe de personnes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para aspectos étnicos, culturales o antropológicos, y con descriptores geográficos para indicar el lugar de origen de un grupo de personas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para aspectos étnicos, culturales o antropológicos y con descriptores geográficos para indicar el lugar de origen de un grupo de personas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para aspectos étnicos, culturais ou antropológicos e com descritores geográficos para indicar o lugar de origem de um grupo de pessoas.\"}]', '1974-10-23', '2015-07-01', '1975-01-01', NULL, NULL),
(29, NULL, '2021-06-04 19:30:50.202478', 1, '22027', 'Q000209', 'Qualifier', 1, 'ET', '[{\"@language\": \"en\", \"@value\": \"etiology\"}, {\"@language\": \"es\", \"@value\": \"etiología\"}, {\"@language\": \"pt-br\", \"@value\": \"etiologia\"}, {\"@language\": \"fr\", \"@value\": \"étiologie\"}, {\"@language\": \"es-es\", \"@value\": \"etiología\"}]', '[\"Q35\",\"Y05\"]', '[\"M0030410\",\"M0030411\"]', 'M0030410', 'T060788', '[{\"@language\": \"en\", \"@value\": \"causality\"}, {\"@language\": \"en\", \"@value\": \"causes\"}, {\"@language\": \"es\", \"@value\": \"causalidad\"}, {\"@language\": \"es\", \"@value\": \"causas\"}, {\"@language\": \"pt-br\", \"@value\": \"causalidade\"}, {\"@language\": \"pt-br\", \"@value\": \"causas\"}, {\"@language\": \"en\", \"@value\": \"pathogenesis\"}, {\"@language\": \"es\", \"@value\": \"patogenésis\"}, {\"@language\": \"pt-br\", \"@value\": \"patogenêse\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"pathogenesis\\\" & \\\"causes\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.33; DF: /etiol or /ET\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye patogénesis & causas; vea definición; política de indización: Manual 19.8.33\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui patogênese & causas; veja definição; política de indexação: Manual 19.8.33\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/ET or ET (SH) or SUBS APPLY ET\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for causative agents including microorganisms and includes environmental and social factors and personal habits as contributing factors. It includes pathogenesis.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour leurs facteurs causaux, y compris les micro-organismes, et inclut les facteurs environnementaux, les facteurs sociaux et les habitudes de vie comme facteurs contributifs. Il comprend la pathogenèse.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para agentes causales incluidos los microorganismos. Incluye factores ambientales y sociales y hábitos personales como factores contribuyentes. Incluye la patogénesis.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para agentes causales incluidos los microorganismos. Incluye factores ambientales y sociales y hábitos personales como factores contribuyentes. Incluye la patogénesis.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para agentes causais, incluindo os micro-organismos. Inclui fatores ambientais e sociais e hábitos pessoais como fatores contribuintes. Inclui a patogênese.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(30, NULL, '2021-06-04 19:30:50.202478', 1, '22033', 'Q000235', 'Qualifier', 1, 'GE', '[{\"@language\": \"en\", \"@value\": \"genetics\"}, {\"@language\": \"es\", \"@value\": \"genética\"}, {\"@language\": \"pt-br\", \"@value\": \"genética\"}, {\"@language\": \"fr\", \"@value\": \"génétique\"}, {\"@language\": \"es-es\", \"@value\": \"genética\"}]', '[\"Q35.050\",\"Q50.010\",\"Y05.050\",\"Y08.010\"]', '[\"M0030427\"]', 'M0030426', 'T060806', '[{\"@language\": \"en\", \"@value\": \"heredity\"}, {\"@language\": \"es\", \"@value\": \"herencia\"}, {\"@language\": \"es\", \"@value\": \"herencia genética\"}, {\"@language\": \"pt-br\", \"@value\": \"hereditariedade\"}, {\"@language\": \"pt-br\", \"@value\": \"herança genética\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"heredity\\\"; with organisms for genetic discussions; with diseases for the genetic basis & means of inheritance; with endogenous chemicals only for their genetic aspects; indexing policy: Manual 19.8.34; DF: /genet or /GE\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye herencia genética; con organismos para discusiones sobre genética; con enfermedades para la base genética & forma de herencia; con sustancias químicas endógenas solamente para sus aspectos genéticos; política de indización: Manual 19.8.34\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui hereditariedade; com organismos para discussões sobre genética; com doenças para a base genética & forma de herança; com substâncias químicas endógenas somente para seus aspectos genéticos; política de indexação: Manual 19.8.34\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/GE or GE (SH) or SUBS APPLY GE; use /genetics to search /familial & genetic back thru 1966\"}]', '[{\"@language\": \"en\", \"@value\": \"78; /familial & genetic was subheading 1966-88; used with Category B, D6, D8-13 & D24 1978-86; B, D6, D8-13, D24, AGING, CLIMACTERIC+, DRUG RESISTANCE+, PIGMENTATION+ & PUBERTY+ 1987-88; B, C, D6, D8-13, D24, F3, AGING, CLIMACTERIC+, DRUG RESISTANCE+, ETHNIC GROUPS+, PIGMENTATION+, PUBERTY+ & RACIAL STOCKS+ 1989; B, C, D8-9, D11-13, D24, F3 & G4-12 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for mechanisms of heredity and the genetics of organisms, for the genetic basis of normal and pathologic states, and for the genetic aspects of endogenous chemicals. It includes biochemical and molecular influence on genetic material.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les mécanismes de l\'hérédité et la génétique des organismes, pour les bases génétiques des états physiologiques ou pathologiques, ainsi que pour les aspects génétiques des substances chimiques endogènes. Il inclut l\'influence biochimique ou moléculaire sur le matériel génétique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para mecanismos de herencia y de genética de organismos, para la base genética de estados normales y patológicos y para los aspectos genéticos de sustancias químicas endógenas. Incluye la acción bioquímica y molecular sobre el material genético.\"}, {\"@language\": \"es\", \"@value\": \"Usado para mecanismos de herencia y de genética de organismos, para la base genética de estados normales y patológicos y para los aspectos genéticos de sustancias químicas endógenas. Incluye la acción bioquímica y molecular sobre el material genético.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para mecanismos de hereditariedade e para genética de organismos, para a base genética de estados normais e patológicos e para os aspectos genéticos de substâncias químicas endógenas. Inclui a influência bioquímica e molecular sobre o material genético.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(31, NULL, '2021-06-04 19:30:50.218099', 1, '22014', 'Q000254', 'Qualifier', 1, 'GD', '[{\"@language\": \"en\", \"@value\": \"growth & development\"}, {\"@language\": \"es\", \"@value\": \"crecimiento & desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento & desenvolvimento\"}, {\"@language\": \"fr\", \"@value\": \"croissance et développement\"}, {\"@language\": \"es-es\", \"@value\": \"crecimiento & desarrollo\"}]', '[\"Q50.020\",\"Y08.020\"]', '[\"M0030446\",\"M0030450\",\"M0030449\",\"M0030448\",\"M0030447\"]', 'M0030446', 'T060828', '[{\"@language\": \"en\", \"@value\": \"growth and development\"}, {\"@language\": \"es\", \"@value\": \"crecimiento y desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento e desenvolvimento\"}, {\"@language\": \"en\", \"@value\": \"postnatal growth\"}, {\"@language\": \"es\", \"@value\": \"crecimiento posnatal\"}, {\"@language\": \"es\", \"@value\": \"crecimiento postnatal\"}, {\"@language\": \"pt-br\", \"@value\": \"crecimento pós-natal\"}, {\"@language\": \"en\", \"@value\": \"postnatal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo posnatal\"}, {\"@language\": \"es\", \"@value\": \"desarrollo postnatal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento pós-natal\"}, {\"@language\": \"en\", \"@value\": \"development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento\"}, {\"@language\": \"en\", \"@value\": \"growth\"}, {\"@language\": \"es\", \"@value\": \"crecimiento\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for micro-organisms & plants; with animals, for postnatal development only: for prenatal development, see /embryology\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para microrganismos & plantas; com animais, somente para desenvolvimento pós-natal: para desenvolvimento pré-natal, veja /embriologia\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para microorganismos & plantas; con animales, solamente para desarrollo posnatal: para desarrollo prenatal, vea /embriología\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/GD or GD (SH) or SUBS APPLY GD\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A & B 1966-74; A1-9, A13-15 & B 1975-86; A1-9, A13-15, B & INFANT, NEWBORN+ 1987-89; A1-l0, A13-14 & B 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with microorganisms, plants, and the postnatal period of animals for growth and development. It includes also the postnatal growth or development of organs or anatomical parts.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux micro-organismes, aux végétaux et aux animaux en période postnatale pour leur croissance et leur développement. Il comprend aussi la croissance et le développement postnatals des organes et des régions anatomiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con microorganismos, plantas y el período posnatal de animales para el crecimiento y desarrollo. Incluye también el crecimiento o desarrollo posnatal de órganos o partes anatómicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con microorganismos, plantas y el período posnatal de animales para el crecimiento y desarrollo. Incluye también el crecimiento o desarrollo posnatal de órganos o partes anatómicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com micro-organismos, plantas e o período pós-natal de animais para crescimento e desenvolvimento. Inclui também o crescimento ou desenvolvimento pós-natal de órgãos ou partes anatômicas.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(32, NULL, '2021-06-04 19:30:50.233721', 1, '22034', 'Q000266', 'Qualifier', 1, 'HI', '[{\"@language\": \"en\", \"@value\": \"history\"}, {\"@language\": \"es\", \"@value\": \"historia\"}, {\"@language\": \"pt-br\", \"@value\": \"história\"}, {\"@language\": \"fr\", \"@value\": \"histoire\"}, {\"@language\": \"es-es\", \"@value\": \"historia\"}]', '[\"Q36\",\"Y27\"]', '[\"M0030460\",\"M0030461\"]', 'M0030460', 'T060845', '[{\"@language\": \"en\", \"@value\": \"historical aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos históricos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos históricos\"}, {\"@language\": \"en\", \"@value\": \"historical notes\"}, {\"@language\": \"es\", \"@value\": \"notas históricas\"}, {\"@language\": \"pt-br\", \"@value\": \"notas históricas\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for historical articles or historical notes in articles; not for \\\"case histories\\\" ( = check tag CASE REPORTS [Publication Type]); indexing policy: Manual 19.8.36; DF: /hist or /HI      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para artículos históricos o notas históricas en artículos; no para históricos de casos ( = precod INFORMES DE CASOS [tipo de publicación]); regla de indización: Manual de la NLM 19.8.36\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para artigos históricos ou notas históricas em artigos; não para históricos de casos ( = precod RELATOS DE CASOS [tipo de publicação]); regra de indexação: Manual da NLM 19.8.36\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/HI or HI (SH) or SUBS APPLY HI\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C-M 1966-67; C-N 1968-74; C-F, G1-3  & H-N 1975-1989; C-E, F3-4, G1-2, I2-3, J, M & N2-3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the historical aspects of any subject. It includes brief historical notes but excludes case histories.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les aspects historiques d\'un sujet. Il comprend les notes historiques brèves, mais exclut les présentations de cas.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los aspectos históricos de un tema. Incluye notas históricas breves. Excluye historias de casos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los aspectos históricos de un tema. Incluye notas históricas breves, pero excluye historias de casos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para os aspectos históricos de um assunto. Inclui notas históricas breves, mas exclui histórias de casos.\"}]', '1973-12-27', '2004-07-09', '1966-01-01', NULL, NULL),
(33, NULL, '2021-06-04 19:30:50.233721', 1, '22038', 'Q000276', 'Qualifier', 1, 'IM', '[{\"@language\": \"en\", \"@value\": \"immunology\"}, {\"@language\": \"es\", \"@value\": \"inmunología\"}, {\"@language\": \"pt-br\", \"@value\": \"imunologia\"}, {\"@language\": \"fr\", \"@value\": \"immunologie\"}, {\"@language\": \"es-es\", \"@value\": \"inmunología\"}]', '[\"Q35.060\",\"Q50.030\",\"Y05.060\",\"Y08.030\"]', NULL, 'M0030471', 'T060858', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for \\\"immunological aspects\\\"; for substances as antigens or haptens; for antibodies to substances, organs or organisms; not for immunotherapy ( = /therapy), nor for immunologic prevention, as with vaccines ( = /prevention & control), nor for serodiagnosis ( = /diagnosis); see MeSH scope note in Introduction; indexing policy: Manual 19.8.37; DF: /immunol or /IM\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para \\\"aspectos inmunológicos\\\"; para sustancias como antígenos o haptenos; para anticuerpos específicos para sustancias, órganos u organismos; no para inmunoterapía ( = /terapia), no para prevención inmunológica, como con vacunas ( = /prevención & control), no para serodiagnóstico ( = /diagnóstico); vea definición; política de indexación: Manual de la NLM 19.8.37\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para \\\"aspectos imunológicos\\\"; para substâncias como antígenos ou haptenos; para anticorpos dirigidos a substâncias, órgãos ou organismos; não para imunoterapia ( = /terapia), não para prevenção imunológica, como com vacinas ( = /prevenção & controle), não para sorodiagnóstico ( = /diagnóstico); veja definição; política de indexação: Manual da NLM 19.8.37\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IM or IM (SH) or SUBS APPLY IM\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B & C 1966-67; A, B & C 1968-69; A, B, C & F 1970-74; A, B, C & F3 1975-86; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; A2-16, B, C, D1-24, F3 & G4-12 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for immunologic studies of tissues, organs, microorganisms, fungi, viruses, and animals. It includes immunologic aspects of diseases but not immunologic procedures used for diagnostic, preventive, or therapeutic purposes, for which \\\"diagnosis\\\", \\\"prevention & control\\\", or \\\"therapy\\\" are used. The concept is also used for chemicals as antigens or haptens.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les études immunologiques des tissus, des organes, des micro-organismes, des champignons, des virus et des animaux. Il inclut les aspects immunologiques des maladies, mais pas les procédures immunologiques utilisées dans un but diagnostique, préventif ou thérapeutique, pour lesquelles les qualificatifs \'diagnostic”, \'prévention et contrôle” et \'thérapie” sont respectivement utilisés. Il s’emploie aussi pour des substances chimiques comme les antigènes ou les haptènes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para estudios inmunológicos de tejidos, órganos, microorganismos, hongos, virus y animales. Incluye aspectos inmunológicos de enfermedades, pero no incluye procedimientos inmunológicos usados para diagnóstico, o con propósitos preventivos o terapéuticos, para los cuales se usan /diagnostico, \\\"/prevención & control\\\" o /terapia. Usado también para compuestos químicos como antígenos o haptenos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para estudios inmunológicos de tejidos, órganos, microorganismos, hongos, virus y animales. Incluye aspectos inmunológicos de enfermedades, pero no incluye procedimientos inmunológicos usados para diagnóstico, o con propósitos preventivos o terapéuticos, para los cuales se usan /diagnostico, \\\"/prevención & control\\\" o /terapia. Usado también para compuestos químicos como antígenos o haptenos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para estudos imunológicos de tecidos, órgãos, micro-organismos, fungos, vírus e animais. Inclui aspectos imunológicos de doenças, mas não inclui procedimentos imunológicos usados para diagnóstico, ou com objetivos preventivos ou terapêuticos, para os quais se usam /diagnóstico, \\\"/prevenção & controle\\\" ou /terapia. Usado também para compostos químicos como antígenos ou haptenos.\"}]', '1973-12-27', '2015-07-01', '1966-01-01', NULL, NULL),
(34, NULL, '2021-06-04 19:30:50.249349', 1, '22042', 'Q000293', 'Qualifier', 1, 'IN', '[{\"@language\": \"en\", \"@value\": \"injuries\"}, {\"@language\": \"es\", \"@value\": \"lesiones\"}, {\"@language\": \"pt-br\", \"@value\": \"lesões\"}, {\"@language\": \"fr\", \"@value\": \"traumatismes\"}, {\"@language\": \"es-es\", \"@value\": \"lesiones\"}]', '[\"Q37\",\"Y29\"]', '[\"M0030486\",\"M0030487\"]', 'M0030486', 'T060876', '[{\"@language\": \"en\", \"@value\": \"trauma\"}, {\"@language\": \"es\", \"@value\": \"traumatismos\"}, {\"@language\": \"pt-br\", \"@value\": \"traumatismos\"}, {\"@language\": \"en\", \"@value\": \"wounds\"}, {\"@language\": \"es\", \"@value\": \"heridas\"}, {\"@language\": \"pt-br\", \"@value\": \"ferimentos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; by physical trauma only; includes \\\"wounds\\\", \\\"trauma\\\"; for \\\"lesion\\\" in Romance languages; not for cell damage ( = /pathology); indexing policy: Manual 19.8.38; DF: /inj or /IN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente por traumatismo físico; incluye \\\"heridas\\\", \\\"traumatismo\\\"; para \\\"lesion\\\" en lenguas romances; no para daño celular ( = /patología)\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente por traumatismo físico; inclui \\\"ferimentos\\\", \\\"traumatismo\\\"; para \\\"lesão\\\" em línguas românicas; não para dano celular ( = /patologia)\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IN or IN (SH) or SUBS APPLY IN\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C 1966; Category A 1967-74; A1-9 & A13-15 1975-88; A1-9, A13-15 & B2 1989; A1-10, A13-14, B2 & I3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with anatomic headings, animals, and sports for wounds and injuries. Excludes cell damage, for which \\\"pathology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux régions anatomiques, aux animaux et aux sports pour les blessures et les traumatismes. Il exclut les lésions cellulaires, pour lesquelles le qualificatif \'anatomopathologie” est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores anatómicos, animales y deportes para heridas y lesiones. Excluye el daño celular o de tejidos, para los que se usa /patología.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores anatómicos, animales y deportes para heridas y lesiones. Excluye el daño celular o de tejidos, para los que se usa /patología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores anatômicos, animais e esportes para ferimentos e lesões. Exclui dano celular ou de tecidos, para os quais se usa /patologia.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(35, NULL, '2021-06-04 19:30:50.264978', 1, '22037', 'Q000294', 'Qualifier', 1, 'IR', '[{\"@language\": \"en\", \"@value\": \"innervation\"}, {\"@language\": \"es\", \"@value\": \"inervación\"}, {\"@language\": \"pt-br\", \"@value\": \"inervação\"}, {\"@language\": \"fr\", \"@value\": \"innervation\"}, {\"@language\": \"es-es\", \"@value\": \"inervación\"}]', '[\"Q10.040\",\"Y02.040\"]', '[\"M0030488\"]', 'M0030488', 'T060879', '[{\"@language\": \"en\", \"@value\": \"nerve supply\"}, {\"@language\": \"es\", \"@value\": \"red nerviosa\"}, {\"@language\": \"pt-br\", \"@value\": \"nervação\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"nerve supply\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.39; DF: /innerv or /IR\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui suprimento de nervo; veja definição; política de indexação: Manual 19.8.39\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye suplimiento de nervio; vea definición; política de indización: Manual 19.8.39\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IR or IR (SH) or SUBS APPLY IR\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966-74; A1-9 & A13-16 1975; A1-7, A9 & A13-16 1976-89; A1-7, A9-10, A13-14 & A16 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, regions, or tissues for their nerve supply.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux régions anatomiques et aux tissus pour leur innervation.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, regiones anatómicas o tejidos para su dotación nerviosa.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas o tejidos para su suministro de nervios.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anatômicas ou tecidos para seu suprimento de nervos.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(36, NULL, '2021-06-04 19:30:50.264978', 1, '22039', 'Q000295', 'Qualifier', 1, 'IS', '[{\"@language\": \"en\", \"@value\": \"instrumentation\"}, {\"@language\": \"es\", \"@value\": \"instrumentación\"}, {\"@language\": \"pt-br\", \"@value\": \"instrumentação\"}, {\"@language\": \"fr\", \"@value\": \"instrumentation\"}, {\"@language\": \"es-es\", \"@value\": \"instrumentación\"}]', '[\"Q38\",\"Y31\"]', '[\"M0030494\",\"M0030490\",\"M0030491\",\"M0030492\",\"M0030493\"]', 'M0030489', 'T060881', '[{\"@language\": \"en\", \"@value\": \"instruments\"}, {\"@language\": \"es\", \"@value\": \"instrumentos\"}, {\"@language\": \"es\", \"@value\": \"apagado_utensilios\"}, {\"@language\": \"pt-br\", \"@value\": \"instrumentos\"}, {\"@language\": \"en\", \"@value\": \"devices\"}, {\"@language\": \"es\", \"@value\": \"dispositivos\"}, {\"@language\": \"pt-br\", \"@value\": \"dispositivos\"}, {\"@language\": \"en\", \"@value\": \"equipment\"}, {\"@language\": \"es\", \"@value\": \"equipos\"}, {\"@language\": \"pt-br\", \"@value\": \"equipamentos\"}, {\"@language\": \"en\", \"@value\": \"apparatus\"}, {\"@language\": \"es\", \"@value\": \"aparatos\"}, {\"@language\": \"pt-br\", \"@value\": \"aparelhos\"}, {\"@language\": \"en\", \"@value\": \"appliances\"}, {\"@language\": \"es\", \"@value\": \"utensilios\"}, {\"@language\": \"pt-br\", \"@value\": \"utensílios\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"apparatus\\\", \\\"appliances\\\", \\\"instruments\\\",\\\"equipment\\\", \\\"supplies\\\", \\\"devices\\\"; not for techniques ( = /methods); see MeSH scope note in Introduction; indexing policy: Manual 19.8.40; DF: /instrum or /IS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye aparatos, herramientas, instrumentos, equipos, provisiones, dispositivos; no para técnicas ( = /métodos); vea definición; política de indización: Manual 19.8.40\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui aparelhos, ferramentas, instrumentos, equipamentos, provisões, dispositivos; não para técnicas ( = /métodos); veja definição; política de indexação: Manual 19.8.40\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IS or IS (SH) or SUBS APPLY IS\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category E-H 1966-67; E-H & J 1968-74; E, F2, F4, G1-3, H, J & L 1975-81; E1-6, F2, F4, G1-3, H, J & L 1982-89; E1-6, F4 & G1-2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diagnostic or therapeutic procedures, analytic techniques, and specialties or disciplines, for the development or modification of apparatus, instruments, or equipment.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux procédures diagnostiques ou thérapeutiques, aux techniques analytiques, aux spécialités ou aux disciplines, pour le développement ou les modifications d\'appareils, d\'instruments ou d\'équipement.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con procedimientos diagnósticos y terapéuticos, técnicas analíticas y especialidades o disciplinas para el desarrollo o modificación de aparatos, instrumentos o equipos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con procedimientos diagnósticos y terapéuticos, técnicas analíticas y especialidades o disciplinas para el desarrollo o modificación de aparatos, instrumentos o equipos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com procedimentos diagnósticos ou terapêuticos, técnicas analíticas e especialidades ou disciplinas para o desenvolvimento ou modificação de aparelhos, instrumentos ou equipamentos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(37, NULL, '2021-06-04 19:30:50.287176', 1, '22001', 'Q000302', 'Qualifier', 1, 'IP', '[{\"@language\": \"en\", \"@value\": \"isolation & purification\"}, {\"@language\": \"es\", \"@value\": \"aislamiento & purificación\"}, {\"@language\": \"es\", \"@value\": \"aislamiento y purificación\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento & purificação\"}, {\"@language\": \"fr\", \"@value\": \"isolement et purification\"}, {\"@language\": \"es-es\", \"@value\": \"aislamiento & purificación\"}]', '[\"Q05.030\",\"Y01.030\"]', '[\"M0030500\",\"M0030502\",\"M0030501\"]', 'M0030500', 'T060892', '[{\"@language\": \"en\", \"@value\": \"isolation and purification\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento e purificação\"}, {\"@language\": \"en\", \"@value\": \"purification\"}, {\"@language\": \"es\", \"@value\": \"purificación\"}, {\"@language\": \"pt-br\", \"@value\": \"purificação\"}, {\"@language\": \"en\", \"@value\": \"isolation\"}, {\"@language\": \"es\", \"@value\": \"aislamiento\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with micro-organisms & helminths includes obtaining pure strains, demonstrating presence & culture techniques but consider also /growth & development; with chemicals & biological substances includes isolation of constituents; indexing policy: Manual 19.8.41; DF: /isol or /IP\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; con microorganismos & helmintos incluye cepas puras, demostrando presencia & técnicas de cultivo pero vea también /crecimiento & desarrollo; con sustancias químicas & biológicas incluye aislamiento de constituyentes: Manual de la NLM 19.8.41\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; com microrganismos & helmintos inclui cepas puras, demonstrando presença & técnicas de cultura mas veja também /crescimiento & desenvolvimento; com substâncias químicas & biológicas inclui isolamento de constituintes; Manual da NLM 19.8.41\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IP or IP (SH) or SUBS APPLY IP\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B 1966-68; B & D 1969-74; B1, B3-5 & D 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with bacteria, viruses, fungi, protozoa, and helminths for the obtaining of pure strains or for the demonstration of the presence of or identification of organisms by DNA analyses, immunologic, or other methods, including culture techniques. It is used also with biological substances and chemicals for the isolation and purification of the constituents.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux bactéries, aux virus, aux champignons, aux protozoaires et aux helminthes pour l\'obtention de souches pures, ainsi que pour la détection ou l\'identification des organismes par l’analyse de leur ADN, par des méthodes immunologiques ou autres, y compris des techniques de culture. Il s\'applique aussi aux substances biologiques ou chimiques pour l\'isolement et la purification de leurs composants.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con bacterias, virus, hongos, protozoos y helmintos para la obtención de cepas puras o para la demostración de la presencia o identificación de organismos por análisis del ADN, métodos inmunológicos u otros, incluidas las técnicas de cultivo. Se usa también con sustancias biológicas y productos químicos para el aislamiento y purificación de sus componentes.\"}, {\"@language\": \"es\", \"@value\": \"Usado con bacterias, virus, hongos, protozoos y helmintos para la obtención de cepas puras o para la demostración de la presencia o identificación de organismos por análisis del ADN, métodos inmunológicos u otros, incluidas las técnicas de cultivo. Se usa también con sustancias biológicas y productos químicos para el aislamiento y purificación de sus componentes.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com bactérias, vírus, fungos, protozoários e helmintos para a obtenção de linhagens puras ou para demonstração da presença ou identificação de organismos por análises de DNA, por métodos imunológicos ou outros, incluindo técnicas de cultura. Usado também com substâncias biológicas e produtos químicos para isolamento e purificação de seus componentes.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(38, NULL, '2021-06-04 19:30:50.302834', 1, '22041', 'Q000331', 'Qualifier', 1, 'LJ', '[{\"@language\": \"en\", \"@value\": \"legislation & jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"legislación & jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"legislação & jurisprudência\"}, {\"@language\": \"fr\", \"@value\": \"législation et jurisprudence\"}, {\"@language\": \"es-es\", \"@value\": \"legislación & jurisprudencia\"}]', '[\"Q40.020\",\"Y06.020\"]', '[\"M0030527\",\"M0030528\",\"M0030529\",\"M0030536\",\"M0030537\",\"M0030541\",\"M0030538\",\"M0030531\",\"M0030533\",\"M0030539\",\"M0030540\",\"M0030534\",\"M0030535\",\"M0030530\"]', 'M0030527', 'T060922', '[{\"@language\": \"en\", \"@value\": \"legislation and jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"legislación y jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"legislação e jurisprudência\"}, {\"@language\": \"en\", \"@value\": \"court decisions\"}, {\"@language\": \"es\", \"@value\": \"decisiones del tribunal\"}, {\"@language\": \"pt-br\", \"@value\": \"decisões do tribunal\"}, {\"@language\": \"en\", \"@value\": \"government regulations\"}, {\"@language\": \"es\", \"@value\": \"regulaciones gubernamentales\"}, {\"@language\": \"pt-br\", \"@value\": \"regulamentos gobernamentais\"}, {\"@language\": \"en\", \"@value\": \"judicial aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos judiciales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos judiciais\"}, {\"@language\": \"en\", \"@value\": \"juridical aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos jurídicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos jurídicos\"}, {\"@language\": \"en\", \"@value\": \"statutes\"}, {\"@language\": \"es\", \"@value\": \"estatutos\"}, {\"@language\": \"pt-br\", \"@value\": \"estatutos\"}, {\"@language\": \"en\", \"@value\": \"lawsuits\"}, {\"@language\": \"es\", \"@value\": \"pleito\"}, {\"@language\": \"pt-br\", \"@value\": \"processo jurídico\"}, {\"@language\": \"en\", \"@value\": \"legal aspects\"}, {\"@language\": \"en\", \"@value\": \"jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"aspectos legales\"}, {\"@language\": \"es\", \"@value\": \"jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos legais\"}, {\"@language\": \"pt-br\", \"@value\": \"jurisprudência\"}, {\"@language\": \"en\", \"@value\": \"litigation\"}, {\"@language\": \"es\", \"@value\": \"litigio\"}, {\"@language\": \"pt-br\", \"@value\": \"litígio\"}, {\"@language\": \"en\", \"@value\": \"medicolegal aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos medicolegales\"}, {\"@language\": \"es\", \"@value\": \"procedimientos medicolegales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos medicolegales\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos médico-legais\"}, {\"@language\": \"en\", \"@value\": \"ordinances\"}, {\"@language\": \"es\", \"@value\": \"ordenanzas\"}, {\"@language\": \"pt-br\", \"@value\": \"ordenanças\"}, {\"@language\": \"en\", \"@value\": \"regulations\"}, {\"@language\": \"es\", \"@value\": \"regulaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"regulamentos\"}, {\"@language\": \"en\", \"@value\": \"civil suits\"}, {\"@language\": \"es\", \"@value\": \"pleito civil\"}, {\"@language\": \"pt-br\", \"@value\": \"demanda civil\"}, {\"@language\": \"en\", \"@value\": \"laws\"}, {\"@language\": \"es\", \"@value\": \"leyes\"}, {\"@language\": \"pt-br\", \"@value\": \"leis\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; includes \\\"legal\\\", \\\"laws\\\", \\\"government regulations\\\", \\\"statutes\\\", \\\"ordinances\\\", \\\"medicolegal\\\", \\\"judicial\\\", \\\"juridical\\\", \\\"suits\\\", \\\"avoidance of suits\\\", \\\"litigation\\\", \\\"court decisions\\\"\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"legal\\\", \\\"leyes\\\", \\\"reglamentos gubernamentales\\\", \\\"estatutos\\\", \\\"ordenanzas\\\", \\\"medicolegal\\\", \\\"judicial\\\", \\\"jurídico\\\", \\\"acción judicial\\\" o \\\"juicio\\\", \\\"anulación de acción\\\", \\\"litígio\\\", \\\"decisiónes de la corte\\\"\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"legal\\\", \\\"leis\\\", \\\"regulamentos governamentais\\\", \\\"estatutos\\\", \\\"ordenanças\\\", \\\"médico-legal\\\", \\\"judicial\\\", \\\"jurídico\\\", \\\"ação judicial\\\" ou \\\"processo\\\", \\\"anulação de ação\\\", \\\"litígio\\\", \\\"decisões da corte\\\"\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/LJ or LJ (SH) or SUBS APPLY LJ\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category I1-2 & N2-4 1978-87; I1-2, L, N2-4 & SMOKING 1988; G2-3, I1-2, L, N2-4 & SMOKING+ 1989; G1-2, I2-3 & N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for laws, statutes, ordinances, or government regulations, as well as for legal controversy and court decisions.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les lois, les règlements, les décrets et les arrêtés gouvernementaux, ainsi que pour les controverses juridiques et les décisions judiciaires.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para leyes, estatutos, decretos o reglamentos gubernamentales y también para controversias legales y decisiones jurídicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado para leyes, estatutos, decretos o reglamentos gubernamentales y también para controversias legales y decisiones jurídicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para leis, estatutos, decretos ou regulamentos governamentais e também para controvérsias legais e decisões jurídicas.\"}]', '1977-05-16', '2017-04-11', '1978-01-01', NULL, NULL);
