(39, NULL, '2021-06-04 19:30:50.318480', 1, '22044', 'Q000378', 'Qualifier', 1, 'ME', '[{\"@language\": \"en\", \"@value\": \"metabolism\"}, {\"@language\": \"es\", \"@value\": \"metabolismo\"}, {\"@language\": \"pt-br\", \"@value\": \"metabolismo\"}, {\"@language\": \"fr\", \"@value\": \"métabolisme\"}, {\"@language\": \"es-es\", \"@value\": \"metabolismo\"}]', '[\"Q50.040\",\"Y08.040\"]', '[\"M0030576\",\"M0030577\",\"M0030759\",\"M0030579\",\"M0030580\",\"M0030582\",\"M0030581\",\"M0030578\",\"M0030583\"]', 'M0030575', 'T060983', '[{\"@language\": \"en\", \"@value\": \"biodegradation\"}, {\"@language\": \"es\", \"@value\": \"biodegradación\"}, {\"@language\": \"pt-br\", \"@value\": \"biodegradação\"}, {\"@language\": \"en\", \"@value\": \"biotransformation\"}, {\"@language\": \"es\", \"@value\": \"biotransformación\"}, {\"@language\": \"pt-br\", \"@value\": \"biotransformação\"}, {\"@language\": \"en\", \"@value\": \"secretion\"}, {\"@language\": \"es\", \"@value\": \"secreción\"}, {\"@language\": \"pt-br\", \"@value\": \"secreção\"}, {\"@language\": \"en\", \"@value\": \"degradation\"}, {\"@language\": \"es\", \"@value\": \"degradación\"}, {\"@language\": \"pt-br\", \"@value\": \"degradação\"}, {\"@language\": \"en\", \"@value\": \"incorporation\"}, {\"@language\": \"es\", \"@value\": \"incorporación\"}, {\"@language\": \"pt-br\", \"@value\": \"incorporação\"}, {\"@language\": \"en\", \"@value\": \"mobilization\"}, {\"@language\": \"es\", \"@value\": \"movilización\"}, {\"@language\": \"pt-br\", \"@value\": \"mobilização\"}, {\"@language\": \"en\", \"@value\": \"turnover\"}, {\"@language\": \"es\", \"@value\": \"recambio\"}, {\"@language\": \"pt-br\", \"@value\": \"turnover\"}, {\"@language\": \"en\", \"@value\": \"biochemical pathways\"}, {\"@language\": \"es\", \"@value\": \"vías bioquímicas\"}, {\"@language\": \"pt-br\", \"@value\": \"vias bioquímicas\"}, {\"@language\": \"en\", \"@value\": \"catabolism\"}, {\"@language\": \"es\", \"@value\": \"catabolismo\"}, {\"@language\": \"pt-br\", \"@value\": \"catabolismo\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only: includes \\\"binding\\\", \\\"catabolism\\\", \\\"conversion\\\", \\\"degradation\\\", \\\"incorporation\\\", \\\"mobilization\\\", \\\"pathway\\\", \\\"splitting\\\", \\\"storage\\\", \\\"turnover\\\", \\\"utilization\\\"; not for \\\"anabolism\\\": use instead  /biosynthesis;  for \\\"absorption\\\", \\\"release\\\", \\\"transport\\\", \\\"uptake\\\"  /pharmacokinetics is also available; for excretion into the blood use  /blood, into the cerebrospinal fluid use  /cerebrospinal fluid, into the urine use  /urine; for biosynthesis or synthesis use  /biosynthesis; for  metabolic aspects of enzymes use /enzymology with Category A, B, and C terms\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye enlace, catabolismo, conversión, degradación, incorporación, mobilización, vias, segmentación(splitting), almacenamiento, recambio, utilización; no para anabolismo: para eso use /biosíntesis; no para absorción, distribución, farmacocinética, liberación, trasporte, captación: para essos use /farmacocinética; para excreción hacia la sangre use /sangre, hacia el líquido cefalorraquideo use /líquido cefalorraquideo, hacia la orina use /orina; para biosíntesis o síntesis use /biosíntesis; para secreción use /secreción; para cualquier aspecto metabólico de enzimas use /enzimología con términos de las Categorías A, B y C; política de indización: Manual 19.8.44\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui ligação, catabolismo, conversão, degradação, incorporação, mobilização, vias, segmentação(splitting), armazenamento, recambio, utilização; não para anabolismo: para isso use /biossíntese; não para absorção, distribuição, farmacocinética, liberação, transporte, captação: para esses use /farmacocinética; excreção para dentro do sangue use /sangue, para dentro do líquido cefalorraquidiano use /líquido cefalorraquidiano, para dentro da urina use /urina; para biossíntese ou síntese use /biossíntese; para secreção use /secreção; para qualquer aspecto metabólico de enzimas use /enzimologia com termos das Categorias A, B e C; política de indexação: Manual 19.8.44\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use; main heading/ME or ME (SH) or SUBS APPLY ME; included /pharmacokinetics 1966-87\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A-D & F 1966-74; A-D & F3 1975-86; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; A2-16, B-D & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, cells and subcellular fractions, organisms, and diseases for biochemical changes. It is used also with drugs and chemicals for catabolic changes (breakdown of complex molecules into simpler ones). For anabolic processes (conversion of small molecules into large), BIOSYNTHESIS is used. For enzymology, pharmacokinetics, and secretion use the specific subheadings.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux cellules, aux fractions subcellulaires, aux organismes et aux maladies pour les modifications biochimiques et le métabolisme. Il s\'applique aussi aux médicaments et aux substances chimiques pour les processus cataboliques (dégradation). Pour les processus anaboliques (biosynthèse), le descripteur Biosynthèse est employé. Pour l\'enzymologie, la pharmacocinétique et la sécrétion, les qualificatifs \'enzymologie\', \'pharmacocinétique\' et \'sécrétion\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, células y fracciones subcelulares, organismos y enfermedades para los cambios bioquímicos y el metabolismo. Usado también con medicamentos y sustancias químicas para los cambios catabólicos (ruptura de moléculas complejas en moléculas simples). Para los procesos anabólicos (conversión de moléculas pequeñas a grandes) se usa BIOSÍNTESIS. Para enzimología, farmacocinética y secreción, usar los calificadores específicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, células y fracciones subcelulares, organismos y enfermedades para los cambios bioquímicos y el metabolismo. Usado también con medicamentos y sustancias químicas para los cambios catabólicos (ruptura de moléculas complejas en moléculas más simples). Para los procesos anabólicos (conversión de moléculas pequeñas a grandes) se usa BIOSÍNTESIS. Para enzimología, farmacocinética y secreción, usar los calificadores específicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, células e frações subcelulares, organismos e doenças para mudanças bioquímicas e metabolismo. Usado também com medicamentos e substâncias químicas para mudanças catabólicas (ruptura de moléculas complexas em moléculas mais simples). Para os processos anabólicos (processo oposto ao catabolismo - conversão de pequenas moléculas em moléculas complexas) usar /biossíntese. Para enzimologia, farmacocinética e secreção, usar os qualificadores específicos.\"}]', '1973-12-27', '2018-07-09', '1966-01-01', NULL, NULL),
(40, NULL, '2021-06-04 19:30:50.334090', 1, '22045', 'Q000379', 'Qualifier', 1, 'MT', '[{\"@language\": \"en\", \"@value\": \"methods\"}, {\"@language\": \"es\", \"@value\": \"métodos\"}, {\"@language\": \"pt-br\", \"@value\": \"métodos\"}, {\"@language\": \"fr\", \"@value\": \"méthodes\"}, {\"@language\": \"es-es\", \"@value\": \"métodos\"}]', '[\"Q39\",\"Y33\"]', '[\"M0030584\",\"M0030585\"]', 'M0030584', 'T060992', '[{\"@language\": \"en\", \"@value\": \"techniques\"}, {\"@language\": \"en\", \"@value\": \"procedures\"}, {\"@language\": \"es\", \"@value\": \"técnicas\"}, {\"@language\": \"es\", \"@value\": \"procedimientos\"}, {\"@language\": \"pt-br\", \"@value\": \"técnicas\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos\"}, {\"@language\": \"en\", \"@value\": \"methodology\"}, {\"@language\": \"es\", \"@value\": \"metodología\"}, {\"@language\": \"pt-br\", \"@value\": \"metodologia\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"technique\\\", \\\"methodology\\\", \\\"procedures\\\"; see also /instrumentation; indexing policy: Manual 19.8.45; DF: /methods or /MT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"técnica\\\", \\\"metodología\\\", \\\"procedimientos\\\"; vea también /instrumentación; regla de indización: Manual de la NLM 19.8.45\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"técnica\\\", \\\"metodologia\\\", \\\"procedimentos\\\"; veja também /instrumentação; regra de indexação: Manual da NLM 19.8.45\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MT or MT (SH) or SUBS APPLY MT\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category E, F4, G1-3, H-J, L & N 1975-81; E1-6, F4, G1-3, H-J, L & N 1982-89; E1-6, F4, G1-2 & I2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with techniques, procedures, and programs for methods.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux techniques, aux procédures et aux programmes pour les méthodes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con técnicas, procedimientos y programas para métodos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con técnicas, procedimientos y programas para métodos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com técnicas, procedimentos e programas para métodos.\"}]', '1974-10-23', '2003-07-24', '1975-01-01', NULL, NULL),
(41, NULL, '2021-06-04 19:30:50.334090', 1, '22046', 'Q000382', 'Qualifier', 1, 'MI', '[{\"@language\": \"en\", \"@value\": \"microbiology\"}, {\"@language\": \"es\", \"@value\": \"microbiología\"}, {\"@language\": \"pt-br\", \"@value\": \"microbiologia\"}, {\"@language\": \"fr\", \"@value\": \"microbiologie\"}, {\"@language\": \"es-es\", \"@value\": \"microbiología\"}]', '[\"Q35.070\",\"Y05.070\"]', '[\"M0030593\",\"M0030592\"]', 'M0030588', 'T060998', '[{\"@language\": \"en\", \"@value\": \"fungi\"}, {\"@language\": \"es\", \"@value\": \"hongos\"}, {\"@language\": \"pt-br\", \"@value\": \"fungos\"}, {\"@language\": \"en\", \"@value\": \"bacteria\"}, {\"@language\": \"es\", \"@value\": \"bacterias\"}, {\"@language\": \"pt-br\", \"@value\": \"bactérias\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; see also /parasitology & /virology; for ability of organisms to cause disease use /pathogenicity; see MeSH scope note in Introduction; indexing policy: Manual 19.8.46; DF: /microbiol or /MI\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; vea también /parasitología & /virología; para la habilidad de organismos en causaren enfermedad use /patogenicidad; vea definición; política de indexación: Manual de la NLM 19.8.46\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; veja também /parasitologia & /virologia; para a habilidade de organismos em causarem doença use /patogenicidade; veja definição; política de indexação: Manual da NLM 19.8.46\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MI or MI (SH) or SUBS APPLY MI\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category A & C 1967-74; A, B1-2, B6, C & F3 1975-86; A, B1-2, B6, C, F3 & INFANT, NEWBORN+; A, B1-2, B6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, animals, and higher plants and with diseases for microbiologic studies. For parasites, \\\"parasitology\\\" is used; for viruses, \\\"virology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux animaux, aux végétaux supérieurs et aux maladies pour les études microbiologiques. Pour les parasites et les virus, les qualificatifs \'parasitologie” et \'virologie\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, animales y plantas superiores y con enfermedades para estudios microbiológicos. Para parásitos se usa /parasitología y para virus, /virología.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, animales y plantas superiores y con enfermedades para estudios microbiológicos. Para parásitos se usa /parasitología y para virus, /virología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, animais, plantas superiores e doenças para estudos microbiológicos. Para parasitos usa-se /parasitologia e para vírus, /virologia.\"}]', '1973-12-27', '2015-07-01', '1967-01-01', NULL, NULL),
(42, NULL, '2021-06-04 19:30:50.349716', 1, '22047', 'Q000401', 'Qualifier', 1, 'MO', '[{\"@language\": \"en\", \"@value\": \"mortality\"}, {\"@language\": \"es\", \"@value\": \"mortalidad\"}, {\"@language\": \"pt-br\", \"@value\": \"mortalidade\"}, {\"@language\": \"fr\", \"@value\": \"mortalité\"}, {\"@language\": \"es-es\", \"@value\": \"mortalidad\"}]', '[\"Q55.010.020\",\"Y09.010.020\"]', '[\"M0030612\",\"M0030611\"]', 'M0030609', 'T061020', '[{\"@language\": \"en\", \"@value\": \"survival\"}, {\"@language\": \"es\", \"@value\": \"supervivencia\"}, {\"@language\": \"pt-br\", \"@value\": \"sobrevivência\"}, {\"@language\": \"en\", \"@value\": \"death rate\"}, {\"@language\": \"es\", \"@value\": \"tasa de mortalidad\"}, {\"@language\": \"es\", \"@value\": \"muerte\"}, {\"@language\": \"pt-br\", \"@value\": \"taxa de mortalidade\"}, {\"@language\": \"pt-br\", \"@value\": \"morte\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"survival\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.47; DF: /mortal or /MO      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye supervivencia; vea definición; política de indización: Manual 19.8.47\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui sobrevivência; veja definição; política de indexação: Manual 19.8.47\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MO or MO (SH) or SUBS APPLY MO\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C, E & F 1967-74; C, E & F3-4 1975-86; C, E, F3-4 & SMOKING 1988; C, E, F3-4, ACCIDENTS+ & SMOKING+ 1989; C, E4 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with human and veterinary diseases for mortality statistics. For deaths resulting from various procedures statistically but for a death resulting in a specific case, use FATAL OUTCOME, not /mortality.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies humaines ou animales pour les statistiques de mortalité. Pour un décès dans un cas particulier, c’est le descripteur \'Issue fatale\' qui est utilisé et non le qualificatif \'mortalité\'.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades humanas y animales para estadísticas de mortalidad. En estadística, para muertes debidas a diversos procedimientos, pero para un fallecimiento que resulte en un caso específico, se usa RESULTADO FATAL, no /mortalidad.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades humanas y animales para estadísticas de mortalidad. En estadística, para muertes debidas a diversos procedimientos, pero para un fallecimiento que resulte en un caso específico, se usa RESULTADO FATAL, no /mortalidad.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças humanas e veterinárias para estatísticas de mortalidade. Em estatística, para mortes devidas a diversos procedimentos, mas para um falecimento que resulte em um caso específico, usa-se EVOLUÇÃO FATAL, não /mortalidade.\"}]', '1973-12-27', '2004-07-13', '1967-01-01', NULL, NULL),
(43, NULL, '2021-06-04 19:30:50.365350', 1, '22024', 'Q000451', 'Qualifier', 1, 'NU', '[{\"@language\": \"en\", \"@value\": \"nursing\"}, {\"@language\": \"es\", \"@value\": \"enfermería\"}, {\"@language\": \"pt-br\", \"@value\": \"enfermagem\"}, {\"@language\": \"fr\", \"@value\": \"soins infirmiers\"}, {\"@language\": \"es-es\", \"@value\": \"enfermería\"}]', '[\"Q65.030\",\"Y11.030\"]', '[\"M0030646\",\"M0030647\"]', 'M0030646', 'T061061', '[{\"@language\": \"en\", \"@value\": \"nursing care\"}, {\"@language\": \"es\", \"@value\": \"atención de enfermería\"}, {\"@language\": \"es\", \"@value\": \"cuidado de enfermería\"}, {\"@language\": \"es\", \"@value\": \"cuidados de enfermería\"}, {\"@language\": \"pt-br\", \"@value\": \"assistência de enfermagem\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidado de enfermagem\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidados de enfermagem\"}, {\"@language\": \"en\", \"@value\": \"home care\"}, {\"@language\": \"es\", \"@value\": \"atención domiciliaria\"}, {\"@language\": \"es\", \"@value\": \"cuidados domiciliarios\"}, {\"@language\": \"es\", \"@value\": \"asistencia domiciliaria\"}, {\"@language\": \"pt-br\", \"@value\": \"assistência domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"atenção domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"atendimento domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidado domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidados domiciliares\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"nursing care\\\" by professional nurse or physician-prescribed home programs; see MeSH scope note in Introduction; indexing policy: Manual 19.8.48; DF: /nurs or /NU\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye atención de enfermería por enfermera(o) profesional o programas para el hogar prescritos por el médico; vea definición; política de indización: Manual 19.8.48\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui cuidados de enfermagem por enfermeira(o) profissional ou programas para o lar prescritos pelo médico; veja definição; política de indexação: Manual 19.8.48\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/NU or NU (SH) or SUBS APPLY NU\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-69; C, E & F 1970-74; C, E & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for nursing care and techniques in their management. It includes the nursing role in diagnostic, therapeutic, and preventive procedures.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les soins infirmiers et les techniques liées à leur prise en charge. Il comprend le rôle infirmier dans les procédures diagnostiques, thérapeutiques et préventives.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para cuidados de enfermería y técnicas propias de la profesión. Incluye el rol de la enfermería en los procedimientos diagnósticos, terapéuticos y preventivos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para cuidados de enfermería y técnicas propias de conducta. Incluye el rol de la enfermería en los procedimientos diagnósticos, terapéuticos y preventivos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para cuidados de enfermagem e técnicas próprias de conduta. Inclui o papel da enfermagem nos procedimentos diagnósticos, terapêuticos e preventivos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(44, NULL, '2021-06-04 19:30:50.387027', 1, '22080', 'Q000453', 'Qualifier', 1, 'EP', '[{\"@language\": \"en\", \"@value\": \"epidemiology\"}, {\"@language\": \"es\", \"@value\": \"epidemiología\"}, {\"@language\": \"pt-br\", \"@value\": \"epidemiologia\"}, {\"@language\": \"fr\", \"@value\": \"épidémiologie\"}, {\"@language\": \"es-es\", \"@value\": \"epidemiología\"}]', '[\"Q55.010\",\"Y09.010\"]', '[\"M0030649\",\"M0030657\",\"M0030654\",\"M0030651\",\"M0030656\",\"M0030652\",\"M0030653\",\"M0030655\",\"M0030650\"]', 'M0030648', 'T061064', '[{\"@language\": \"en\", \"@value\": \"epidemics\"}, {\"@language\": \"es\", \"@value\": \"epidemia\"}, {\"@language\": \"pt-br\", \"@value\": \"epidemia\"}, {\"@language\": \"en\", \"@value\": \"frequency\"}, {\"@language\": \"es\", \"@value\": \"frecuencia\"}, {\"@language\": \"pt-br\", \"@value\": \"frequência\"}, {\"@language\": \"en\", \"@value\": \"surveillance\"}, {\"@language\": \"es\", \"@value\": \"vigilancia\"}, {\"@language\": \"pt-br\", \"@value\": \"vigilância\"}, {\"@language\": \"en\", \"@value\": \"morbidity\"}, {\"@language\": \"es\", \"@value\": \"morbidad\"}, {\"@language\": \"pt-br\", \"@value\": \"morbidade\"}, {\"@language\": \"en\", \"@value\": \"occurrence\"}, {\"@language\": \"es\", \"@value\": \"ocurrencia\"}, {\"@language\": \"pt-br\", \"@value\": \"ocorrência\"}, {\"@language\": \"en\", \"@value\": \"outbreaks\"}, {\"@language\": \"es\", \"@value\": \"brotes\"}, {\"@language\": \"pt-br\", \"@value\": \"surtos\"}, {\"@language\": \"en\", \"@value\": \"prevalence\"}, {\"@language\": \"es\", \"@value\": \"prevalencia\"}, {\"@language\": \"pt-br\", \"@value\": \"prevalência\"}, {\"@language\": \"en\", \"@value\": \"endemics\"}, {\"@language\": \"es\", \"@value\": \"endemia\"}, {\"@language\": \"pt-br\", \"@value\": \"endemia\"}, {\"@language\": \"en\", \"@value\": \"incidence\"}, {\"@language\": \"es\", \"@value\": \"incidencia\"}, {\"@language\": \"pt-br\", \"@value\": \"incidência\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with diseases & geographicals only; includes \\\"incidence\\\", \\\"frequency\\\", \\\"prevalence\\\", \\\"occurrence\\\", \\\"outbreaks\\\"; not for \\\"mortality\\\" ( = /mortality); not for \\\"statistics\\\" on non-disease terms ( = /statist); see MeSH scope note in Introduction; indexing policy: Manual 19.8.31; DF: /epidemiol or /EP      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con enfermedades & geográficos; incluye \\\"incidencia\\\", \\\"frecuencia\\\", \\\"prevalencia\\\", \\\"ocurrencia\\\", \\\"brotes\\\"; no para \\\"mortalidad\\\" ( = /mortalidad); no para \\\"estadísticas\\\" en términos que no son enfermedades ( = /estadist); vea definición; regla de indización: Manual de la NLM 19.8.31\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com doenças & geográficos; inclui \\\"incidência\\\", \\\"frequência\\\", \\\"prevalência\\\", \\\"ocorrência\\\", \\\"surtos\\\"; não para \\\"mortalidade\\\" ( = /mortalidade); não para \\\"estatísticas\\\" em termos que não são doenças ( = /estatist); veja definição; regra de indexação: Manual da NLM 19.8.31\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EP or EP (SH) or SUBS APPLY EP; use /epidemiology to search /occurrence 1966-88\"}]', '[{\"@language\": \"en\", \"@value\": \"89; was /occurrence 1966-88; was used with Category C, F3 & SMOKING+ 1989; C, F3 & Z 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with human and veterinary diseases for the distribution of disease, factors which cause disease, and the attributes of disease in defined populations; includes incidence, frequency, prevalence, endemic and epidemic outbreaks; also surveys and estimates of morbidity in geographic areas and in specified populations. Used also with geographical headings for the location of epidemiologic aspects of a disease. Excludes mortality for which \\\"mortality\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies humaines ou animales pour leur distribution, leurs facteurs étiologiques et leurs caractéristiques dans des populations définies. Il inclut l\'incidence, la fréquence, la prévalence, ainsi que les foyers d’endémie et d’épidémie. Il comprend également les enquêtes et les estimations de la morbidité en fonction des zones géographiques et des populations. Il s\'applique aussi aux descripteurs géographiques pour la localisation des aspects épidémiologiques d\'une maladie. Il exclut la mortalité, pour laquelle le qualificatif \'mortalité\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades humanas y animales para su distribución, factores causantes y características en poblaciones definidas. Incluye la incidencia, frecuencia, prevalencia y los brotes endémicos y epidémicos; también incluye encuestas y estimaciones de morbilidad en áreas geográficas y en poblaciones específicas. Por último, usado con descriptores geográficos para la localización de aspectos epidemiológicos de una enfermedad. Excluye la mortalidad, para la que se usa el calificador /mortalidad.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades humanas y animales para su distribución, factores causantes y características de las enfermedades en poblaciones definidas. Incluye la incidencia, frecuencia, prevalencia y los brotes endémicos y epidémicos; también incluye encuestas y estimaciones de morbilidad en áreas geográficas y en poblaciones específicas. Por último, usado con descriptores geográficos para la localización de aspectos epidemiológicos de una enfermedad. Excluye la mortalidad, para la que se usa el calificador /mortalidad.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças humanas e animais para a sua distribuição, fatores causais e características das doenças em populações definidas. Inclui a incidência, frequência, prevalência, e os surtos endêmicos e epidêmicos; também inclui os levantamentos ou estimativas de morbidade em áreas geográficas e em populações específicas. Por último, usado com descritores geográficos para a localização de aspectos epidemiológicos de uma doença. Exclui mortalidade para o qual existe o qualificador /mortalidade.\"}]', '1973-12-27', '2004-07-13', '1966-01-01', NULL, NULL),
(45, NULL, '2021-06-04 19:30:50.387027', 1, '22049', 'Q000458', 'Qualifier', 1, 'OG', '[{\"@language\": \"en\", \"@value\": \"organization & administration\"}, {\"@language\": \"es\", \"@value\": \"organización & administración\"}, {\"@language\": \"pt-br\", \"@value\": \"organização & administração\"}, {\"@language\": \"fr\", \"@value\": \"organisation et administration\"}, {\"@language\": \"es-es\", \"@value\": \"organización & administración\"}]', '[\"Q40\",\"Y06\"]', '[\"M0030662\",\"M0030666\",\"M0030665\",\"M0030663\",\"M0030667\",\"M0030664\"]', 'M0030662', 'T061078', '[{\"@language\": \"en\", \"@value\": \"organization and administration\"}, {\"@language\": \"es\", \"@value\": \"organización y administración\"}, {\"@language\": \"pt-br\", \"@value\": \"organização e administração\"}, {\"@language\": \"en\", \"@value\": \"organizational management\"}, {\"@language\": \"es\", \"@value\": \"administración organizacional\"}, {\"@language\": \"pt-br\", \"@value\": \"administração organizacional\"}, {\"@language\": \"en\", \"@value\": \"administrative structure\"}, {\"@language\": \"es\", \"@value\": \"estructura administrativa\"}, {\"@language\": \"pt-br\", \"@value\": \"estructura administrativa\"}, {\"@language\": \"en\", \"@value\": \"organization\"}, {\"@language\": \"es\", \"@value\": \"organización\"}, {\"@language\": \"pt-br\", \"@value\": \"organização\"}, {\"@language\": \"en\", \"@value\": \"organizational structure\"}, {\"@language\": \"es\", \"@value\": \"estructura organizacional\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura organicational\"}, {\"@language\": \"en\", \"@value\": \"administrative management\"}, {\"@language\": \"es\", \"@value\": \"gestión administrativa\"}, {\"@language\": \"pt-br\", \"@value\": \"gestão administrativa\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/OG or OG (SH) or SUBS APPLY OG\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category N2-4 1978-79; I2, L & N2-4 1980-88; G2, I2, L & N2-4 1989; G1-2, I2, N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for administrative structure and management.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les structures et la gestion administratives.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para las estructuras administrativas y la administración.\"}, {\"@language\": \"es\", \"@value\": \"Usado para las estructuras administrativas y la administración.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para as estruturas administrativas e a administração.\"}]', '1977-05-16', '2017-04-11', '1978-01-01', NULL, NULL),
(46, NULL, '2021-06-04 19:30:50.402939', 1, '22051', 'Q000469', 'Qualifier', 1, 'PS', '[{\"@language\": \"en\", \"@value\": \"parasitology\"}, {\"@language\": \"es\", \"@value\": \"parasitología\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitologia\"}, {\"@language\": \"fr\", \"@value\": \"parasitologie\"}, {\"@language\": \"es-es\", \"@value\": \"parasitología\"}]', '[\"Q35.080\",\"Y05.080\"]', '[\"M0030680\",\"M0030682\",\"M0030679\",\"M0030681\"]', 'M0030677', 'T061093', '[{\"@language\": \"en\", \"@value\": \"protozoology\"}, {\"@language\": \"es\", \"@value\": \"protozoología\"}, {\"@language\": \"pt-br\", \"@value\": \"protozoologia\"}, {\"@language\": \"en\", \"@value\": \"protozoa\"}, {\"@language\": \"es\", \"@value\": \"protozoarios\"}, {\"@language\": \"es\", \"@value\": \"protozoos\"}, {\"@language\": \"pt-br\", \"@value\": \"protozoários\"}, {\"@language\": \"en\", \"@value\": \"helminthology\"}, {\"@language\": \"es\", \"@value\": \"helmintología\"}, {\"@language\": \"pt-br\", \"@value\": \"helmintologia\"}, {\"@language\": \"en\", \"@value\": \"parasites\"}, {\"@language\": \"es\", \"@value\": \"parásitos\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitos\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitas\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for protozoa & higher parasites; see also /microbiology & /virology; see MeSH scope note in Introduction; indexing policy: Manual 19.8.50; DF: /parasitol or /PS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para protozoos & parásitos superiores; vea también /microbiología & /virología; vea definición; política de indización: Manual 19.8.50\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para protozoários & parasitas superiores; veja também /microbiologia & /virologia; veja definição; política de indexação: Manual 19.8.50\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PS or PS (SH) or SUBS APPLY PS\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category A, B1-2, B6, C & F3 1975-86; A, B1-2, B6, C, F3 & INFANT, NEWBORN+ 1987-89; A, B1-2, B6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with animals, higher plants, organs, and diseases for parasitic factors. In diseases, it is not used if the parasitic involvement is implicit in the diagnosis.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux animaux, aux végétaux supérieurs, aux organes et aux maladies pour les facteurs parasitaires. Pour les maladies, il n’est pas utilisé quand l\'aspect parasitaire est implicitement exprimé dans le diagnostic.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con animales, plantas superiores, órganos y enfermedades para factores parasitarios. En enfermedades, no usar si la implicación del parásito está implícita en el diagnóstico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con animales, plantas superiores, órganos y enfermedades para factores parasitarios. En enfermedades, no usar si la implicación del parásito está implícita en el diagnóstico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com animais, plantas superiores, órgãos e doenças para fatores parasitários. Em doenças, não usar se o envolvimento parasitário estiver implícito no diagnóstico.\"}]', '1974-10-23', '2015-07-01', '1975-01-01', NULL, NULL),
(47, NULL, '2021-06-04 19:30:50.418584', 1, '22052', 'Q000472', 'Qualifier', 1, 'PY', '[{\"@language\": \"en\", \"@value\": \"pathogenicity\"}, {\"@language\": \"es\", \"@value\": \"patogenicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"patogenicidade\"}, {\"@language\": \"fr\", \"@value\": \"pathogénicité\"}, {\"@language\": \"es-es\", \"@value\": \"patogenicidad\"}]', '[\"Q42\",\"Y35\"]', '[\"M0030684\",\"M0030685\"]', 'M0030684', 'T061100', '[{\"@language\": \"en\", \"@value\": \"infectivity\"}, {\"@language\": \"es\", \"@value\": \"infectividad\"}, {\"@language\": \"pt-br\", \"@value\": \"infectividade\"}, {\"@language\": \"en\", \"@value\": \"virulence\"}, {\"@language\": \"es\", \"@value\": \"virulencia\"}, {\"@language\": \"pt-br\", \"@value\": \"virulência\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for the potential ability of micro-organisms or parasites to cause disease in man, animal, or plant under specified conditions: not for specific infections; includes virulence; see MeSH scope note in Introduction; indexing policy: Manual 19.8.51; DF: /pathogen or /PY\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para la habilidad en potencial de microorganismos o parasitas en causaren enfermedad en el hombre, animal o vegetal bajo condiciones especificadas; no para infecciones específicas; incluye virulencia; vea definición; política de indización: Manual 19.8.51\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para a habilidade em potencial de microrganismos ou parasitas em causarem doença no homem, animal ou vegetal sob condições especificadas; não para infecções específicas; inclui virulência; veja definição; política de indexação: Manual 19.8.51\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PY or PY (SH) or SUBS APPLY PY\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B 1966-74; B1 & B3-5 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with microorganisms, viruses, and parasites for studies of their ability to cause disease in man, animals, or plants.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux micro-organismes, aux virus et aux parasites pour les études de leur capacité à provoquer une maladie chez l\'homme, les animaux ou les végétaux.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con microorganismos, virus y parásitos para estudios sobre su capacidad para causar enfermedades en el hombre, animales o plantas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con microorganismos, virus y parásitos para estudios sobre su capacidad para causar enfermedades en el hombre, animales o plantas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com micro-organismos, vírus e parasitos para estudos sobre sua capacidade de causar doenças no homem, animais ou plantas.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(48, NULL, '2021-06-04 19:30:50.418584', 1, '22053', 'Q000473', 'Qualifier', 1, 'PA', '[{\"@language\": \"en\", \"@value\": \"pathology\"}, {\"@language\": \"es\", \"@value\": \"patología\"}, {\"@language\": \"pt-br\", \"@value\": \"patologia\"}, {\"@language\": \"fr\", \"@value\": \"anatomopathologie\"}, {\"@language\": \"es-es\", \"@value\": \"patología\"}]', '[\"Q10.050\",\"Y02.050\"]', '[\"M0030688\",\"M0030689\",\"M0030687\"]', 'M0030686', 'T061103', '[{\"@language\": \"fr\", \"@value\": \"anatomie pathologique\"}, {\"@language\": \"en\", \"@value\": \"cytopathology\"}, {\"@language\": \"es\", \"@value\": \"citopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"citopatologia\"}, {\"@language\": \"en\", \"@value\": \"histopathology\"}, {\"@language\": \"es\", \"@value\": \"histopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"histopatologia\"}, {\"@language\": \"en\", \"@value\": \"biopsy\"}, {\"@language\": \"es\", \"@value\": \"biopsia\"}, {\"@language\": \"pt-br\", \"@value\": \"biópsia\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for description of tissue or cell structure in disease: not for normal tissue ( = / anatomy & histology) nor for normal cells ( = / cytology); not a synonym for \\\"disease\\\"; includes biopsy; for subcellular pathology use / ultrastruct\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para descrição de estrutura de tecido ou célula em doença: não para tecido normal ( = /anatomia & histologia) nem para células normais ( = /citologia); não é um sinônimo para \\\"doença\\\"; inclui biópsia; para patologia subcelular use /ultraestrutura\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para descripción de estructura de tejido o célula en enfermedad: no para tejido normal ( = /anatomía & histología) ni para células normales ( = /citología); no es un sinónimo para \\\"enfermedad\\\"; incluye biopsia; para patología subcelular use /ultraestructura\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PA or PA (SH) or SUBS APPLY PA\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, C & F 1966-74; A, C & F3 1975-86; A, C, F3 & AGING 1987; A, C, F3, AGING, BRONCHOALVEOLAR LAVAGE FLUID & SMOKING 1988; A, C, F3, AGING & SMOKING+ 1989; A1-11, A13-16, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for organ, tissue, or cell structure in disease states.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la structure des organes, des tissus ou des cellules dans les états pathologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, tejidos o estructuras celulares en condiciones patológicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, tejidos o estructuras celulares en condiciones patológicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, tecidos ou estruturas celulares em estados patológicos.\"}]', '1973-12-27', '2016-06-15', '1966-01-01', NULL, NULL),
(49, NULL, '2021-06-04 19:30:50.434186', 1, '22079', 'Q000493', 'Qualifier', 1, 'PK', '[{\"@language\": \"en\", \"@value\": \"pharmacokinetics\"}, {\"@language\": \"es\", \"@value\": \"farmacocinética\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacocinética\"}, {\"@language\": \"fr\", \"@value\": \"pharmacocinétique\"}, {\"@language\": \"es-es\", \"@value\": \"farmacocinética\"}]', '[\"Q45.070\",\"Q50.040.060\",\"Y07.070\",\"Y08.040.060\"]', '[\"M0030701\",\"M0030698\"]', 'M0030695', 'T061112', '[{\"@language\": \"en\", \"@value\": \"toxicokinetics\"}, {\"@language\": \"es\", \"@value\": \"toxicocinética\"}, {\"@language\": \"pt-br\", \"@value\": \"toxicocinética\"}, {\"@language\": \"en\", \"@value\": \"tissue distribution\"}, {\"@language\": \"es\", \"@value\": \"distribución tisular\"}, {\"@language\": \"pt-br\", \"@value\": \"distribuição tecidual\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with exogenous chemicals only; includes \\\"dynamics\\\",\\\"absorption\\\", \\\"distribution\\\", \\\"uptake\\\"; on the extent & rate of metabolism; not for pharmacologic effects or pharmacologic action ( = /pharmacology); see MeSH scope note in Introduction; indexing policy: Manual 19.8.53; DF: /pharmacokin or /PK\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con sustancias exógenas; incluye \\\"dinámica\\\", \\\"absorción\\\", \\\"distribución\\\", \\\"captación\\\"; en la extensión & tasa de metabolismo; no para efectos farmacológicos o acción farmacológica ( = /farmacología); vea definición; política de indexación: Manual de la NLM 19.8.53\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com substâncias exógenas; inclui \\\"dinâmica\\\", \\\"absorção\\\", \\\"distribuição\\\", \\\"captação\\\"; na extensão & taxa de metabolismo; não para efeitos farmacológicos ou ação farmacológica ( = /farmacologia); veja definição; política de indexação: Manual da NLM 19.8.53\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PK or PK (SH) or SUBS APPLY PK; use /metabolism or /ME to search /pharmacokinetics 1966-87\"}]', '[{\"@language\": \"en\", \"@value\": \"88; used with Category D 1988 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the mechanism, dynamics and kinetics of exogenous chemical and drug absorption, biotransformation, distribution, release, transport, uptake and elimination as a function of dosage, extent and rate of metabolic processes.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour le mécanisme, la dynamique et la cinétique de l\'absorption, de la biotransformation, de la distribution, de la libération, du transport, de la capture et de l\'élimination des substances chimiques exogènes et des médicaments, en fonction du dosage, de l\'ampleur et de la vitesse des processus métaboliques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para el mecanismo, dinámica y cinética de la absorción, adsorción, biotransformación, distribución, liberación, transporte, ingestión y eliminación de sustancias exógenas y medicamentos en función de la dosificación, extensión y velocidad de los procesos metabólicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para el mecanismo, dinámica y cinética de la absorción, adsorción, biotransformación, distribución, liberación, transporte, ingestión y eliminación de sustancias exógenas y medicamentos en función de la dosificación, extensión y velocidad de los procesos metabólicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para o mecanismo, dinâmica e cinética da absorção, adsorção, biotransformação, distribuição, dinâmica, liberação, transporte, ingestão e eliminação de substâncias exógenas e medicamentos em função da dosagem, extensão e velocidade de processos metabólicos.\"}]', '1987-04-18', '2015-07-01', '1988-01-01', NULL, NULL),
(50, NULL, '2021-06-04 19:30:50.449817', 1, '22078', 'Q000494', 'Qualifier', 1, 'PD', '[{\"@language\": \"en\", \"@value\": \"pharmacology\"}, {\"@language\": \"es\", \"@value\": \"farmacología\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacologia\"}, {\"@language\": \"fr\", \"@value\": \"pharmacologie\"}, {\"@language\": \"es-es\", \"@value\": \"farmacología\"}]', '[\"Q45\",\"Y07\"]', '[\"M0030702\",\"M0030704\",\"M0030703\"]', 'M0030702', 'T061119', '[{\"@language\": \"en\", \"@value\": \"mode of action\"}, {\"@language\": \"en\", \"@value\": \"mechanism of action\"}, {\"@language\": \"es\", \"@value\": \"modo de acción\"}, {\"@language\": \"es\", \"@value\": \"mecanismo de acción\"}, {\"@language\": \"pt-br\", \"@value\": \"forma de ação\"}, {\"@language\": \"pt-br\", \"@value\": \"mecanismo de ação\"}, {\"@language\": \"en\", \"@value\": \"pharmacologic action\"}, {\"@language\": \"es\", \"@value\": \"acción farmacológica\"}, {\"@language\": \"pt-br\", \"@value\": \"ação farmacológica\"}, {\"@language\": \"en\", \"@value\": \"pharmacodynamics\"}, {\"@language\": \"es\", \"@value\": \"farmacodinámica\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacodinâmica\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with exogenous chemicals only; includes \\\"effect\\\", \\\"mechanism of action\\\", \\\"mode of action\\\"; not for pharmacokinetics ( = /pharmacokinetics); see also /adverse effects, /poisoning & /toxicity; see MeSH scope note in Introduction; indexing policy: Manual 19.8.54; DF: /pharmacol or /PD\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con sustancias químicas exógenas; incluye efecto, mecanismo de acción, modo de acción; no para farmacocinética ( = /farmacocinética); vea también /efectos adversos, /envenenamiento, /toxicidad; vea definición; política de indización: Manual 19.8.54\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com substâncias químicas exógenas; inclui efeito, mecanismo de ação, modo de ação; não para farmacocinética ( = /farmacocinética); veja também /efeitos adversos, /envenenamento, /toxicidade; veja definição; política de indexação: Manual 19.8.54\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PD or PD (SH) or SUBS APPLY PD; use /pharmacology or /PD to search /pharmacodynamics back thru 1966\"}]', '[{\"@language\": \"en\", \"@value\": \"88; was /pharmacodynamics 1966-87; used with Category D 1966 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs and exogenously administered chemical substances for their effects on living tissues and organisms. It includes acceleration and inhibition of physiological and biochemical processes and other pharmacologic mechanisms of action.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments et aux substances chimiques exogènes pour leurs effets sur les tissus vivants et les organismes. Il comprend l\'accélération et l\'inhibition des processus physiologiques et biochimiques et des mécanismes d\'action pharmacologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con fármacos y sustancias químicas administradas por vía exógena para sus efectos en tejidos vivos y organismos. Incluye la aceleración e inhibición de los procesos fisiológicos y bioquímicos y otros mecanismos de acción farmacológicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con fármacos y sustancias químicas administradas por vía exógena para sus efectos en tejidos vivos y organismos. Incluye la aceleración e inhibición de los procesos fisiológicos y bioquímicos y otros mecanismos de acción farmacológicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fármacos e substâncias químicas administradas por via exógena para seus efeitos em tecidos vivos e organismos. Inclui aceleração e inibição dos processos fisiológicos e bioquímicos e outros mecanismos de ação farmacológicos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(51, NULL, '2021-06-04 19:30:50.449817', 1, '22031', 'Q000502', 'Qualifier', 1, 'PH', '[{\"@language\": \"en\", \"@value\": \"physiology\"}, {\"@language\": \"es\", \"@value\": \"fisiología\"}, {\"@language\": \"pt-br\", \"@value\": \"fisiologia\"}, {\"@language\": \"fr\", \"@value\": \"physiologie\"}, {\"@language\": \"es-es\", \"@value\": \"fisiología\"}]', '[\"Q50\",\"Y08\"]', '[\"M0030706\"]', 'M0030706', 'T061125', '[{\"@language\": \"en\", \"@value\": \"function\"}, {\"@language\": \"es\", \"@value\": \"función\"}, {\"@language\": \"pt-br\", \"@value\": \"função\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; normal \\\"function\\\" only: for function in disease use /physiopathology; with endogenous chemicals only, for their physiologic role; see MeSH scope note in Introduction; indexing policy: Manual 19.8.55; DF: /physiol or /PH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente función normal: para función en enfermedad use /fisiopatología; solamente con sustancias químicas endógenas, para sus funciones fisiológicas; vea definición; política de indización: Manual 19.8.55\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente função normal: para função em doença use /fisiopatologia; somente com substâncias químicas endógenas, para suas funções fisiológicas; veja definição; política de indexação: Manual 19.8.55\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PH or PH (SH) or SUBS APPLY PH\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, B & G 1966; A, B, D & G 1967-69; A, B & D 1970-74; A, B, D & F1-2 1975-86; A, B, D, F1-2, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987-89; A, B, D8, D11-13, D24, F2 & G4-1 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, tissues, and cells of unicellular and multicellular organisms for normal function. It is used also with biochemical substances, endogenously produced, for their physiologic role.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux tissus et aux cellules des organismes unicellulaires ou pluricellulaires pour leur fonction normale. Il s\'applique également aux substances biochimiques endogènes pour leur rôle physiologique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, tejidos y células de organismos unicelulares y multicelulares para el funcionamiento normal. Usado también con sustancias bioquímicas, producidas endógenamente, para su papel fisiológico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, tejidos y células de organismos unicelulares y multicelulares para el funcionamiento normal. Usado también con sustancias bioquímicas, producidas endógenamente, para su papel fisiológico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, tecidos e células de organismos unicelulares e multicelulares para função normal. Usado também com substâncias bioquímicas, produzidas endogenamente, para seu papel fisiológico.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(52, NULL, '2021-06-04 19:30:50.465442', 1, '22032', 'Q000503', 'Qualifier', 1, 'PP', '[{\"@language\": \"en\", \"@value\": \"physiopathology\"}, {\"@language\": \"es\", \"@value\": \"fisiopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"fisiopatologia\"}, {\"@language\": \"fr\", \"@value\": \"physiopathologie\"}, {\"@language\": \"es-es\", \"@value\": \"fisiopatología\"}]', '[\"Q50.050\",\"Y08.050\"]', '[\"M0030707\"]', 'M0030707', 'T061127', '[{\"@language\": \"en\", \"@value\": \"pathophysiology\"}, {\"@language\": \"en\", \"@value\": \"dysfunction\"}, {\"@language\": \"es\", \"@value\": \"disfunción\"}, {\"@language\": \"es\", \"@value\": \"patofisiología\"}, {\"@language\": \"pt-br\", \"@value\": \"disfunção\"}, {\"@language\": \"pt-br\", \"@value\": \"patofisiologia\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for function of organs in disease states only; not a synonym for \\\"disease\\\"; indexing policy: Manual 19.8.56; DF: /physiopathology or /PP\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para función de órganos en estados de enfermedad; no un sinónimo para enfermedad; política de indización: Manual 19.8.56\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para função de órgãos em estados de doença; não um sinônimo para doença; política de indexação: Manual 19.8.56\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PP or PP (SH) or SUBS APPLY PP\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, C & F 1966-74; A, C & F3 1975-87; A, C, F3 & SMOKING 1988; A, C, F3 & SMOKING+ 1989; A1-10, A13-16, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs and diseases for disordered function in disease states.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes et aux maladies pour les fonctions altérées dans les états pathologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos y enfermedades para las alteraciones del funcionamiento que ocurren en las enfermedades.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos y enfermedades para las alteraciones del funcionamiento que ocurren en las enfermedades.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos e doenças para as alterações do funcionamento que ocorrem em doenças.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(53, NULL, '2021-06-04 19:30:50.481571', 1, '22025', 'Q000506', 'Qualifier', 1, 'PO', '[{\"@language\": \"en\", \"@value\": \"poisoning\"}, {\"@language\": \"es\", \"@value\": \"envenenamiento\"}, {\"@language\": \"pt-br\", \"@value\": \"envenenamento\"}, {\"@language\": \"fr\", \"@value\": \"intoxication\"}, {\"@language\": \"es-es\", \"@value\": \"envenenamiento\"}]', '[\"Q45.020.010\",\"Q60.040\",\"Y07.020.010\",\"Y10.040\"]', '[\"M0030709\"]', 'M0030708', 'T061130', '[{\"@language\": \"en\", \"@value\": \"poisonous effects\"}, {\"@language\": \"es\", \"@value\": \"efectos venenosos\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos venenosos\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for clinical & veterinary only; for human & animal experiments use /toxicity; see also /adverse effects &  /toxicity\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para clínica & veterinaria; para experimentos en humanos & animales use /toxicidad; vea también /efectos adversos & /toxicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para clínica & veterinária; para experimentos em humanos & animais use /toxicidade; veja também /efeitos adversos & /toxicidade\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PO or PO (SH) or SUBS APPLY PO\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966-67; D & J 1968 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs, chemicals, and industrial materials for human or animal poisoning, acute or chronic, whether the poisoning is accidental, occupational, suicidal, by medication error, or by environmental exposure.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments, aux substances chimiques et aux matériaux industriels pour une intoxication humaine ou animale, aiguë ou chronique, qu\'elle soit accidentelle, professionnelle, suicidaire, due à une erreur de médication ou à une exposition environnementale.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con medicamentos, compuestos químicos y materiales industriales para envenenamiento humano o animal, agudo o crónico, sea este accidental, ocupacional, suicida, por error de medicación o por exposición ambiental.\"}, {\"@language\": \"es\", \"@value\": \"Usado con medicamentos, compuestos químicos y materiales industriales para envenenamiento humano o animal, agudo o crónico, sea éste accidental, ocupacional, suicida, por error de medicación o por exposición ambiental.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com medicamentos, compostos químicos e materiais industriais para envenenamento humano ou animal, agudo ou crônico, seja este envenenamento acidental, ocupacional, suicida, por erro de medicação ou por exposição ambiental.\"}]', '1973-12-27', '2017-07-05', '1966-01-01', NULL, NULL),
(54, NULL, '2021-06-04 19:30:50.487612', 1, '22054', 'Q000517', 'Qualifier', 1, 'PC', '[{\"@language\": \"en\", \"@value\": \"prevention & control\"}, {\"@language\": \"es\", \"@value\": \"prevención & control\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção & controle\"}, {\"@language\": \"fr\", \"@value\": \"prévention et contrôle\"}, {\"@language\": \"es-es\", \"@value\": \"prevención & control\"}]', '[\"Q65.040\",\"Y11.040\"]', '[\"M0030715\",\"M0030717\",\"M0030716\"]', 'M0030715', 'T061137', '[{\"@language\": \"en\", \"@value\": \"prophylaxis\"}, {\"@language\": \"en\", \"@value\": \"preventive therapy\"}, {\"@language\": \"en\", \"@value\": \"prevention and control\"}, {\"@language\": \"en\", \"@value\": \"preventive measures\"}, {\"@language\": \"es\", \"@value\": \"prevención y control\"}, {\"@language\": \"es\", \"@value\": \"terapia preventiva\"}, {\"@language\": \"es\", \"@value\": \"profilaxis\"}, {\"@language\": \"es\", \"@value\": \"medidas preventivas\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção e controle\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção & controlo\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção e controlo\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia preventiva\"}, {\"@language\": \"pt-br\", \"@value\": \"profilaxia\"}, {\"@language\": \"pt-br\", \"@value\": \"medidas preventivas\"}, {\"@language\": \"en\", \"@value\": \"prevention\"}, {\"@language\": \"es\", \"@value\": \"prevención\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção\"}, {\"@language\": \"en\", \"@value\": \"control\"}, {\"@language\": \"es\", \"@value\": \"control\"}, {\"@language\": \"pt-br\", \"@value\": \"controle\"}, {\"@language\": \"pt-br\", \"@value\": \"controlo\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; includes \\\"preventive therapy\\\"; includes vaccination; for prevention on epidemiologic or personal level; CATALOGER: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"terapia preventiva\\\"; incluye vacunación; para prevención a nivel epidemiológico o personal; vea definición; regla de indización: Manual de la NLM 19.8.58\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"terapia preventiva\\\"; inclui vacinação; para prevenção a nível epidemiológico ou pessoal; veja definição; regra de indexação: Manual da NLM 19.8.58\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PC or PC (SH) or SUBS APPLY PC\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-67; C, F & G 1968-74; C, F1, F3, G3 & I1 1975-89; C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for increasing human or animal resistance against disease (e.g., immunization), for control of transmission agents, for prevention and control of environmental hazards, or for prevention and control of social factors leading to disease. It includes preventive measures in individual cases.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour l\'augmentation de la résistance humaine ou animale à ces maladies (par exemple, par immunisation), pour le contrôle des agents de transmission, ainsi que pour la prévention et le contrôle des risques environnementaux et des facteurs sociaux pathogènes. Il comprend les mesures préventives prises dans les cas individuels.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores de enfermedades para el aumento de la resistencia humana o animal contra las enfermedades (como, por ejemplo, la inmunización), para el control de agentes transmisores, para la prevención y control de daños ambientales o de factores sociales que conduzcan a la enfermedad. Incluye medidas preventivas en casos individuales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores de enfermedades para el aumento de la resistencia humana o animal contra las enfermedades (como, por ejemplo, la inmunización), para el control de agentes transmisores, para la prevención y control de daños ambientales o de factores sociales que conduzcan a la enfermedad. Incluye medidas preventivas en casos individuales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores de doenças para o aumento da resistência humana ou animal contra as doenças (como, por exemplo, a imunização), para o controle de agentes transmissores, para a prevenção e controle de danos ambientais ou de fatores sociais que conduzam à doença. Inclui medidas preventivas em casos individuais.\"}]', '1973-12-27', '2017-04-11', '1996-01-01', NULL, NULL),
(55, NULL, '2021-06-04 19:30:50.503268', 1, '22056', 'Q000523', 'Qualifier', 1, 'PX', '[{\"@language\": \"en\", \"@value\": \"psychology\"}, {\"@language\": \"es\", \"@value\": \"psicología\"}, {\"@language\": \"pt-br\", \"@value\": \"psicologia\"}, {\"@language\": \"fr\", \"@value\": \"psychologie\"}, {\"@language\": \"es-es\", \"@value\": \"psicología\"}]', '[\"Q52\",\"Y37\"]', '[\"M0030721\",\"M0030722\",\"M0030727\",\"M0030724\",\"M0030725\",\"M0030726\",\"M0030720\",\"M0030723\"]', 'M0030719', 'T061144', '[{\"@language\": \"es\", \"@value\": \"aspectos psicológicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicológicos\"}, {\"@language\": \"en\", \"@value\": \"cognitive aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos cognitivos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos cognitivos\"}, {\"@language\": \"en\", \"@value\": \"emotional aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos emocionales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos emocionais\"}, {\"@language\": \"en\", \"@value\": \"psychosomatic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicosomáticos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicossomáticos\"}, {\"@language\": \"en\", \"@value\": \"psychiatric aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psiquiátricos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psiquiátricos\"}, {\"@language\": \"en\", \"@value\": \"psychogenic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicogénicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicogênicos\"}, {\"@language\": \"en\", \"@value\": \"psychosocial aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicosociales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicossociais\"}, {\"@language\": \"en\", \"@value\": \"affective aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos afectivos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos afetivos\"}, {\"@language\": \"en\", \"@value\": \"mental aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos mentales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos mentais\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"psychiatric\\\", \\\"psychosomatic\\\", \\\"psychogenic\\\", \\\"emotional\\\", \\\"affective\\\", \\\"behavioral\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.59; DF: /psychol or /PX\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye psiquiátrico, psicosomático, psicogénico, emocional, afectivo, conducta; vea definición; política de indización: Manual 19.8.59\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui psiquiátrico, psicossomático, psicogênico, emocional, afetivo, comportamental; veja definição; política de indexação: Manual 19.8.59\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PX or PX (SH) or SUBS APPLY PX\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category C, E1-6 & F3 1978-79; C, E1-6, F3 & M 1980-86; C, E1-6, F3, M, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, PREGNANCY+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; C, E1-6, F3, M, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, HOMOSEXUALITY, PREGNANCY+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; B2, C, E1-6, F3, I3 & M 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with non-psychiatric diseases, techniques, and named groups for psychologic, psychiatric, psychosomatic, psychosocial, behavioral, and emotional aspects, and with psychiatric disease for psychologic aspects; used also with animal terms for animal behavior and psychology.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies non psychiatriques, aux techniques et aux groupes de personnes pour les aspects psychologiques, psychiatriques, psychosomatiques, psychosociaux, comportementaux et émotionnels, ainsi qu\'aux maladies psychiatriques pour les aspects psychologiques. Il s\'applique également aux animaux pour leur comportement et leur psychologie.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades no psiquiátricas, técnicas y denominación de grupos para aspectos psicológicos, psiquiátricos, psicosomáticos, psicosociales, conductuales y emocionales, y con enfermedades psiquiátricas para aspectos psicológicos. Usado también con descriptores animales para el comportamiento y la psicología de los animales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades no psiquiátricas, técnicas y personas para aspectos psicológicos, psiquiátricos, psicosomáticos, psicosociales, conductuales y emocionales, y con enfermedades psiquiátricas para aspectos psicológicos. Usado también con descriptores animales para el comportamiento y la psicología de los animales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças não psiquiátricas, técnicas e [grupos de] pessoas para aspectos psicológicos, psiquiátricos, psicossomáticos, psicossociais, comportamentais e emocionais, e com doenças psiquiátricas para aspectos psicológicos. Usado também com descritores animais para o comportamento e a psicologia dos animais.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(56, NULL, '2021-06-04 19:30:50.503268', 1, '22022', 'Q000528', 'Qualifier', 1, 'RE', '[{\"@language\": \"en\", \"@value\": \"radiation effects\"}, {\"@language\": \"es\", \"@value\": \"efectos de la radiación\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos da radiação\"}, {\"@language\": \"fr\", \"@value\": \"effets des radiations\"}, {\"@language\": \"es-es\", \"@value\": \"efectos de la radiación\"}]', '[\"Q53\",\"Y39\"]', NULL, 'M0030732', 'T061157', '[{\"@language\": \"es\", \"@value\": \"efectos de radiación\"}, {\"@language\": \"es\", \"@value\": \"efectos de las radiaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos de radiação\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos das radiações\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes ionizing & non-ionizing radiation; not for therapeutic effect of radiations ( = /radiotherapy); see MeSH scope note in Introduction; indexing policy: Manual 19.8.60; DF: /rad eff or /RE\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye radiación ionizante & no ionizante; no para efecto terapéutico de la radiación ( = /radioterapía); vea definición; política de indización: Manual 19.8.60\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui radiação ionizante & não ionizante; não para efeito terapêutico da radiação ( = /radioterapia); veja definição; política de indexação: Manual 19.8.60\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RE or RE (SH) or SUBS APPLY RE\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, B & G 1966-67; A, B, D & G 1968-74; A, B, D, F1-2, G4-12 & J 1975-84; A, B1, B3-6, D, F1-2, G4-12 & J 1985 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for effects of ionizing and nonionizing radiation upon living organisms, organs and tissues, and their constituents, and upon physiologic processes. It includes the effect of irradiation on drugs and chemicals.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les effets des radiations ionisantes ou non ionisantes sur les organismes vivants, les organes, les tissus et leurs constituants, ainsi que sur les processus physiologiques. Il inclut les effets de l\'irradiation sur les médicaments et les substances chimiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los efectos de la radiación ionizante y no ionizante en organismos vivos, órganos, tejidos y sus componentes y en sus procesos fisiológicos. Incluye el efecto de la irradiación en fármacos y compuestos químicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los efectos de la radiación ionizante y no ionizante en organismos vivos, órganos, tejidos y sus componentes y en sus procesos fisiológicos. Incluye el efecto de la irradiación en fármacos y compuestos químicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para os efeitos das radiações ionizantes e não ionizantes sobre organismos vivos, órgãos, tecidos e seus componentes e sobre processos fisiológicos. Inclui os efeitos de irradiação sobre fármacos e compostos químicos.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(57, NULL, '2021-06-04 19:30:50.518890', 1, '22059', 'Q000532', 'Qualifier', 1, 'RT', '[{\"@language\": \"en\", \"@value\": \"radiotherapy\"}, {\"@language\": \"es\", \"@value\": \"radioterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"radioterapia\"}, {\"@language\": \"fr\", \"@value\": \"radiothérapie\"}, {\"@language\": \"es-es\", \"@value\": \"radioterapia\"}]', '[\"Q65.050\",\"Y11.050\"]', '[\"M0030735\",\"M0030736\",\"M0030737\"]', 'M0030735', 'T061165', '[{\"@language\": \"en\", \"@value\": \"radiation therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por radiación\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por radiação\"}, {\"@language\": \"en\", \"@value\": \"X-ray therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por rayos X\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por raios X\"}, {\"@language\": \"en\", \"@value\": \"radioisotope therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por radioisótopos\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por radioisótopos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes x-ray, radioisotope, other ionizing radiation & non-ionizing radiation; indexing policy: Manual 19.8.63; DF: /radiother or /RT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye rayo x, radioisótopo, otra radiacion ionizante & radiacion no ionizante; política de indización: Manual de la NLM 19.8.63\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui raio x, radioisótopo, outra radiação ionizante & radiação não ionizante; política de indexação: Manual da NLM 19.8.63\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RT or RT (SH) or SUBS APPLY RT\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for the therapeutic use of ionizing and nonionizing radiation. It includes the use of radioisotope therapy.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour l\'utilisation de radiations ionisantes ou non ionisantes dans un but thérapeutique. Il inclut les traitements par radio-isotopes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para el uso terapéutico de la radiación ionizante y no ionizante. Incluye el uso de tratamiento con radioisótopos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para el uso terapéutico de la radiación ionizante y no ionizante. Incluye el uso de tratamiento con radioisótopos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para o uso terapêutico da radiação ionizante e não ionizante. Inclui o uso de terapia com radioisótopos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(58, NULL, '2021-06-04 19:30:50.518890', 1, '22061', 'Q000534', 'Qualifier', 1, 'RH', '[{\"@language\": \"en\", \"@value\": \"rehabilitation\"}, {\"@language\": \"es\", \"@value\": \"rehabilitación\"}, {\"@language\": \"pt-br\", \"@value\": \"reabilitação\"}, {\"@language\": \"fr\", \"@value\": \"rééducation et réadaptation\"}, {\"@language\": \"es-es\", \"@value\": \"rehabilitación\"}]', '[\"Q65.060\",\"Y11.060\"]', NULL, 'M0030738', 'T061169', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for restoration of patient to pre-disease or pre-therapy state; for \\\"re-education\\\" in French; indexing policy: Manual 19.8.64; DF: /rehabil or /RH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para restablecimiento de paciente al estado de preenfermedad o preterapia; para reeducación en francés; política de indización: Manual 19.8.64\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para restabelecimento de paciente ao estado de pré-doença ou pré-terapia; para reeducação em francês; política de indexação: Manual 19.8.64\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RH or RH (SH) or SUBS APPLY RH\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C & F 1967-74; C & F3 1975-79; C, E4 & F3 1980-89; C1-21, C23, E4 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases and surgical procedures for restoration of function of the individual.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies et aux procédures chirurgicales pour la récupération d\'une fonction chez un individu.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades y procedimientos quirúrgicos para la restauración de las funciones del individuo.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades y procedimientos quirúrgicos para la restauración de las funciones del individuo.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com do