s\", \"@value\": \"Usado con órganos, regiones anatómicas, tejidos, organismos y procesos fisiológicos y psicológicos para los efectos de los fármacos y las sustancias químicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas, tejidos, organismos y procesos fisiológicos y psicológicos para los efectos de los fármacos y las sustancias químicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anâtômicas, tecidos, organismos, processos fisiológicos e psicológicos para os efeitos de fármacos e substâncias químicas.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(100, NULL, '2021-06-04 19:30:50.966416', 2, '442', 'QFNS000442', 'Qualifier', 1, 'DT', '[{\"@language\": \"en\", \"@value\": \"drug therapy\"}, {\"@language\": \"es\", \"@value\": \"tratamiento farmacológico\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento farmacológico\"}, {\"@language\": \"pt-br\", \"@value\": \"quimioterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"quimiotratamento\"}, {\"@language\": \"fr\", \"@value\": \"traitement médicamenteux\"}, {\"@language\": \"es-es\", \"@value\": \"farmacoterapia\"}]', '[\"Q65.020\",\"Y11.020\"]', '[\"M0030372\"]', 'M0030372', 'T060746', '[{\"@language\": \"en\", \"@value\": \"pharmacologic therapy\"}, {\"@language\": \"en\", \"@value\": \"pharmacotherapy\"}, {\"@language\": \"en\", \"@value\": \"chemotherapy\"}, {\"@language\": \"es\", \"@value\": \"quimioter\"}, {\"@language\": \"es\", \"@value\": \"quimioterapia\"}, {\"@language\": \"es\", \"@value\": \"quimiotratamiento\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia medicamentosa\"}, {\"@language\": \"es\", \"@value\": \"tratamiento medicamentoso\"}, {\"@language\": \"es\", \"@value\": \"terapia con medicamentos\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con medicamentos\"}, {\"@language\": \"es\", \"@value\": \"tratamiento con fármacos\"}, {\"@language\": \"es\", \"@value\": \"terapia farmacológica\"}, {\"@language\": \"es\", \"@value\": \"farmacoter\"}, {\"@language\": \"es\", \"@value\": \"farmacoterapia\"}, {\"@language\": \"es\", \"@value\": \"terapia por drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia con drogas\"}, {\"@language\": \"es\", \"@value\": \"terapia con fármacos\"}, {\"@language\": \"pt-br\", \"@value\": \"chemother\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia medicamentosa\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento medicamentoso\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com medicamentos\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com medicamentos\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento com fármacos\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia farmacológica\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacoter\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacoterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com drogas\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia com fármacos\"}, {\"@language\": \"fr\", \"@value\": \"chimiothérapie\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes treatment or prevention by drugs &  chemicals; includes therapy with antibiotics; not for immunotherapy nor for tissue therapy  ( = /therapy); see MeSH scope note in Introduction; indexing policy: Manual 19.8.26;  DF: /drug ther or /DT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye tratamiento o prevención por medicamentos & sustancias químicas; incluye terapia con antibióticos; no para inmumoterapia ni para terapia tisular ( = /terap); vea definición; no use para homeopatia, en esos casos la coord correcta es medicamento /uso terap con enfermedad /terap; política de indización: Manual 19.8.26\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui tratamento ou prevenção por medicamentos & substâncias químicas; inclui terapia com antibióticos; não para imumoterapia nem para terapia tissular ( = /terap); veja definição; não use para homeopatia, nesses casos a coord correta é medicamento /uso terap com doença /terap; política de indexação: Manual 19.8.26\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/DT or DT (SH) or SUBS APPLY DT\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975-87; C, F3 & SMOKING 1988; C, F3 & SMOKING+ 1989; C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for the treatment of disease by the administration of drugs, chemicals, and antibiotics. For diet therapy and radiotherapy, use  specific subheadings. Excludes immunotherapy for which \\\"therapy\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour leur traitement par l\'administration de médicaments, de substances chimiques ou d\'antibiotiques. Pour le régime alimentaire et la radiothérapie, les qualificatifs \'diétothérapie\' et \'radiothérapie\' sont respectivement utilisés. Il exclut l\'immunothérapie, pour laquelle le qualificatif \'thérapie\' est employé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para su tratamiento con fármacos, productos químicos y antibióticos. Para dietoterapia y radioterapia debe usarse sus calificadores específicos. Para inmunoterapia, usar el calificador /terapia.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para su tratamiento con fármacos, productos químicos y antibióticos. Para dietoterapia y radioterapia debe usarse estos calificadores específicos. Para inmunoterapia, usar el calificador /terapia.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para o seu tratamento com fármacos, produtos químicos e antibióticos. Para dietoterapia e radioterapia usar estes qualificadores específicos. Para imunoterapia usar o qualificador /terapia.\"}]', '1999-11-03', '2003-07-22', '1966-01-01', NULL, NULL),
(101, NULL, '2021-06-04 19:30:50.988593', 2, '443', 'QFNS000443', 'Qualifier', 1, 'EC', '[{\"@language\": \"en\", \"@value\": \"economics\"}, {\"@language\": \"es\", \"@value\": \"economía\"}, {\"@language\": \"pt-br\", \"@value\": \"economia\"}, {\"@language\": \"fr\", \"@value\": \"économie\"}, {\"@language\": \"es-es\", \"@value\": \"economía\"}]', '[\"Q40.010\",\"Y06.010\"]', '[\"M0030377\",\"M0030379\",\"M0030378\",\"M0030380\",\"M0030382\",\"M0030376\",\"M0030381\"]', 'M0030375', 'T060752', '[{\"@language\": \"es\", \"@value\": \"aspectos económicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos econômicos\"}, {\"@language\": \"en\", \"@value\": \"fees\"}, {\"@language\": \"es\", \"@value\": \"tarifas\"}, {\"@language\": \"pt-br\", \"@value\": \"tarifas\"}, {\"@language\": \"en\", \"@value\": \"salaries\"}, {\"@language\": \"es\", \"@value\": \"sueldos\"}, {\"@language\": \"pt-br\", \"@value\": \"salários\"}, {\"@language\": \"en\", \"@value\": \"financial management\"}, {\"@language\": \"es\", \"@value\": \"administración financiera\"}, {\"@language\": \"pt-br\", \"@value\": \"administração financeira\"}, {\"@language\": \"en\", \"@value\": \"financing\"}, {\"@language\": \"es\", \"@value\": \"financiación\"}, {\"@language\": \"pt-br\", \"@value\": \"financiamento\"}, {\"@language\": \"en\", \"@value\": \"funding\"}, {\"@language\": \"es\", \"@value\": \"fondos\"}, {\"@language\": \"pt-br\", \"@value\": \"fundos\"}, {\"@language\": \"en\", \"@value\": \"cost\"}, {\"@language\": \"es\", \"@value\": \"costo\"}, {\"@language\": \"pt-br\", \"@value\": \"custo\"}, {\"@language\": \"en\", \"@value\": \"finances\"}, {\"@language\": \"es\", \"@value\": \"finanzas\"}, {\"@language\": \"pt-br\", \"@value\": \"finanças\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"finances\\\", \\\"financing\\\", \\\"funding\\\", \\\"costs\\\", \\\"fees\\\", \\\"salaries\\\", \\\"financial management\\\", etc.; see MeSH scope note in Introduction; indexing policy: Manual 19.8.27; DF: /econ or /EC      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye finanzas, financiamiento, fondos, costos, tazas, sueldos, administración financiera, etc.; vea definición; política de indización: Manual 19.8.27\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui finanças, financiamento, fundos, custos, taxas, salários, administração financeira, etc.; veja definição; política de indexação: Manual 19.8.27\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EC or EC (SH) or SUBS APPLY EC\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category C, E, F3 & N2-4 1978-79; C, E, F3-4, G1-3, I2, J, L & N2-4 1980-87; C, E, F3-4, G1-3, I2, J, L, N2-4 & SMOKING 1988; C, E, F3-4, G1-3, I2, J, L, N2-4 & SMOKING+ 1989; C, E, F3-4, G1-2, I2-3, J & N2-4 1990-91; C, D, E, F3-4, G1-2 I2-3, J & N2-4 1992 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the economic aspects of any subject, as well as for all aspects of financial management. It includes the raising or providing of funds.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les aspects économiques et les aspects de gestion financière. Il inclut la collecte et la distribution de fonds.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los aspectos económicos de cualquier tema así como para todos los aspectos de administración financiera. Incluye recolección y provisión de fondos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los aspectos económicos de cualquier tema así como para todos los aspectos de administración financiera. Incluye recolección y provisión de fondos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado tanto para os aspectos econômicos de qualquer assunto como para os aspectos de administração financeira. Inclui o levantamento e a provisão de fundos.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(102, NULL, '2021-06-04 19:30:50.988593', 2, '444', 'QFNS000444', 'Qualifier', 1, 'ED', '[{\"@language\": \"en\", \"@value\": \"education\"}, {\"@language\": \"es\", \"@value\": \"educación\"}, {\"@language\": \"pt-br\", \"@value\": \"educação\"}, {\"@language\": \"fr\", \"@value\": \"enseignement et éducation\"}, {\"@language\": \"es-es\", \"@value\": \"educación\"}]', '[\"Q25\",\"Y23\"]', '[\"M0030386\",\"M0030387\",\"M0030385\"]', 'M0030384', 'T060761', '[{\"@language\": \"en\", \"@value\": \"teaching\"}, {\"@language\": \"es\", \"@value\": \"enseñanza\"}, {\"@language\": \"pt-br\", \"@value\": \"ensino\"}, {\"@language\": \"en\", \"@value\": \"training\"}, {\"@language\": \"es\", \"@value\": \"capacitación\"}, {\"@language\": \"pt-br\", \"@value\": \"capacitação\"}, {\"@language\": \"en\", \"@value\": \"curriculum\"}, {\"@language\": \"es\", \"@value\": \"currículo\"}, {\"@language\": \"pt-br\", \"@value\": \"currículo\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"training\\\", \\\"teaching\\\", \\\"curriculum\\\"; for the teacher teaching, the student learning & the courses taught; see MeSH scope note in Introduction; indexing policy: Manual 19.8.28; DF: /educ or /ED      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye entrenamiento, enseñanza, curriculum; para la enseñanza por parte de los maestros, el aprendizado de los alumnos & para los cursos ministrados; vea definición; política de indización: Manual 19.8.28\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui treinamento, ensino, curriculum; para o ensino por parte dos professores, o aprendizado de alunos & cursos ministrados; veja definição; política de indexação: Manual 19.8.28\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/ED or ED (SH) or SUBS APPLY ED\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category F-I 1967; F-I & N 1968-71; F-I, M & N 1972-74; E, F, G1-3, H-M & N1-2 1975-89; F4, G1-2, I3 & M 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for education, training programs, and courses in various fields and disciplines, and for training groups of persons.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour l\'enseignement, les programmes de formation et les cours dans divers champs et disciplines, ainsi que pour les groupes de personnes en formation.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para educación, programas de entrenamiento y cursos de varios campos y disciplinas y para la capacitación de grupos de personas.\"}, {\"@language\": \"es\", \"@value\": \"Usado para educación, programas de entrenamiento y cursos de varios campos y disciplinas y para la capacitación de grupos de personas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para educação, programas de treinamento e cursos nos vários campos e disciplinas. Usado também para treinamento de grupos de pessoas.\"}]', '1973-12-27', '2003-07-24', '1967-01-01', NULL, NULL),
(103, NULL, '2021-06-04 19:30:51.004255', 2, '445', 'QFNS000445', 'Qualifier', 1, 'EM', '[{\"@language\": \"en\", \"@value\": \"embryology\"}, {\"@language\": \"es\", \"@value\": \"embriología\"}, {\"@language\": \"pt-br\", \"@value\": \"embriologia\"}, {\"@language\": \"fr\", \"@value\": \"embryologie\"}, {\"@language\": \"es-es\", \"@value\": \"embriología\"}]', '[\"Q10.030\",\"Q35.040\",\"Y02.030\",\"Y05.040\"]', '[\"M0030395\",\"M0030392\",\"M0030393\",\"M0030394\"]', 'M0030391', 'T060768', '[{\"@language\": \"en\", \"@value\": \"prenatal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo prenatal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento pré-natal\"}, {\"@language\": \"en\", \"@value\": \"fetal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo fetal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento fetal\"}, {\"@language\": \"en\", \"@value\": \"embryonic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos embrionarios\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos embrionários\"}, {\"@language\": \"en\", \"@value\": \"embryonic development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo embrionario\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento embrionário\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"embryonic\\\", \\\"embryonal\\\", \\\"embryological aspects\\\"; for embryonic & fetal development; see MeSH scope note in Introduction; indexing policy: Manual 19.8.29; DF: /embryol or /EM\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"embrionario\\\", \\\"embrional\\\", \\\"aspectos embriológicos\\\"; para desarrollo embrionario & fetal; vea definición; regla de indización: Manual de la NLM 19.8.29\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"embrionário\\\", \\\"embrional\\\", \\\"aspectos embriológicos\\\"; para desenvolvimento embrionário & fetal; veja definição; regra de indexação: Manual da NLM 19.8.29\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EM or EM (SH) or SUBS APPLY EM\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966; A & B 1967-69; A, B & C 1970-74; A1-10, A13-15, B1-2, B6 & C 1975-89; A1-10, A13-14, B1-2, B6 & C 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, regions, and animal headings for embryologic and fetal development. It is used also with diseases for embryologic factors contributing to postnatal disorders.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux régions anatomiques et aux animaux pour leurs développements embryonnaire et fœtal. Il s\'applique aussi aux maladies pour les facteurs embryologiques contribuant aux troubles postnatals.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, regiones anatómicas y animales para el desarrollo embriológico y fetal. Usado también con enfermedades para factores embriológicos que contribuyen a trastornos posnatales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas y animales para el desarrollo embriológico y fetal. Usado también con enfermedades para factores embriológicos que contribuyen a trastornos posnatales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anatômicas e animais para o desenvolvimento embriológico e fetal. Usado também com doenças para fatores embriológicos que contribuem para distúrbios pós-natais.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(104, NULL, '2021-06-04 19:30:51.019887', 2, '446', 'QFNS000446', 'Qualifier', 1, 'EN', '[{\"@language\": \"en\", \"@value\": \"enzymology\"}, {\"@language\": \"es\", \"@value\": \"enzimología\"}, {\"@language\": \"pt-br\", \"@value\": \"enzimologia\"}, {\"@language\": \"fr\", \"@value\": \"enzymologie\"}, {\"@language\": \"es-es\", \"@value\": \"enzimología\"}]', '[\"Q50.040.050\",\"Y08.040.050\"]', '[\"M0030398\",\"M0030399\"]', 'M0030398', 'T060775', '[{\"@language\": \"en\", \"@value\": \"enzymes\"}, {\"@language\": \"es\", \"@value\": \"enzimas\"}, {\"@language\": \"pt-br\", \"@value\": \"enzimas\"}, {\"@language\": \"en\", \"@value\": \"enzyme activity\"}, {\"@language\": \"es\", \"@value\": \"actividad enzimática\"}, {\"@language\": \"pt-br\", \"@value\": \"atividade enzimática\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for enzymatic metabolism, kinetics, analysis & inhibition; not for CLINICAL ENZYME TESTS ( = /diagnosis); see MeSH scope note in Introduction; indexing policy: Manual 19.8.30; DF: /enzymol or /EN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para metabolismo enzimático, cinética, análisis & inhibición; no para PRUEBAS ENZIMÁTICAS CLÍNICAS ( = /diagnóstico); vea definición; regla de indización: Manual de la NLM 19.8.30\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para metabolismo enzimático, cinética, análise & inibição; não para ENSAIOS ENZIMÁTICOS CLÍNICOS ( = /diagnóstico); veja definição; regra de indexação: Manual da NLM 19.8.30\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EN or EN (SH) or SUBS APPLY EN\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A & B 1966-67; A-C & F 1968-74; A, B1, B3-6, C & F3 1975-89; A2-16, B1, B3-6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organisms, except vertebrates, and with organs and tissues. It is also used with diseases for enzymes during the course of the disease, but excludes diagnostic enzyme tests, for which \\\"diagnosis\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organismes, à l\'exclusion des vertébrés, ainsi qu’aux organes et aux tissus. Il s\'applique aussi aux maladies pour les enzymes au cours de ces maladies. Il exclut les tests enzymatiques à visée diagnostique, pour lesquels le qualificatif \'diagnostic” est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con organismos, excepto vertebrados, con órganos y tejidos, y también con enfermedades, para enzimas durante el curso de la enfermedad. Excluye pruebas enzimáticas de diagnóstico, para las cuales se usa /diagnóstico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con organismos, excepto vertebrados, con órganos y tejidos, y también con enfermedades, para enzimas durante el curso de la enfermedad. Excluye pruebas enzimáticas de diagnóstico, para las cuales se usa /diagnóstico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com organismos, exceto vertebrados, e com órgãos e tecidos. Também é usado com doenças para enzimas durante o curso da doença, mas exclui testes enzimáticos de diagnóstico, para os quais se usa /diagóstico.\"}]', '1973-12-27', '2007-07-10', '1966-01-01', NULL, NULL),
(105, NULL, '2021-06-04 19:30:51.019887', 2, '447', 'QFNS000447', 'Qualifier', 1, 'EH', '[{\"@language\": \"en\", \"@value\": \"ethnology\"}, {\"@language\": \"es\", \"@value\": \"etnología\"}, {\"@language\": \"pt-br\", \"@value\": \"etnologia\"}, {\"@language\": \"fr\", \"@value\": \"ethnologie\"}, {\"@language\": \"es-es\", \"@value\": \"etnología\"}]', '[\"Q55.010.010\",\"Y09.010.010\"]', '[\"M0030408\",\"M0030407\"]', 'M0030405', 'T060783', '[{\"@language\": \"en\", \"@value\": \"ethnicity\"}, {\"@language\": \"es\", \"@value\": \"etnicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"etnicidade\"}, {\"@language\": \"en\", \"@value\": \"culture\"}, {\"@language\": \"es\", \"@value\": \"cultura\"}, {\"@language\": \"pt-br\", \"@value\": \"cultura\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with disease & selected terms for \\\"the place of origin of a group of people\\\"; with geog terms for the place of origin; indexing policy: Manual 19.8.32; DF: /ethnol or /EH      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; con enfermedades & términos seleccionados para \\\"el local de origen de un grupo de personas\\\"; con términos geográficos para el local de origen; regla de indización: Manual de la NLM 19.8.32\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; com doenças & termos selecionados para \\\"o local de origem de um grupo de pessoas\\\"; com termos geográficos para o local de origem; regra de indexação: Manual da NLM 19.8.32\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EH or EH (SH) or SUBS APPLY EH; restricted to Category Z 1975-86\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category Z 1975-86; C, F3 Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS & PUBERTY+ 1987; C, F3, Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, PUBERTY+ & SMOKING 1988; C, F3, Z, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FAMILY+, FOOD HABITS, HOMOSEXUALITY, PUBERTY+ & SMOKING+ 1989; C1-21, C23, F3 & Z 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for ethnic, cultural, or anthropological aspects, and with geographic headings to indicate the place of origin of a group of people.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les aspects ethniques, culturels ou anthropologiques, ainsi qu\'aux descripteurs géographiques pour indiquer le lieu d\'origine d\'un groupe de personnes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para aspectos étnicos, culturales o antropológicos, y con descriptores geográficos para indicar el lugar de origen de un grupo de personas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para aspectos étnicos, culturales o antropológicos y con descriptores geográficos para indicar el lugar de origen de un grupo de personas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para aspectos étnicos, culturais ou antropológicos e com descritores geográficos para indicar o lugar de origem de um grupo de pessoas.\"}]', '1974-10-23', '2015-07-01', '1975-01-01', NULL, NULL),
(106, NULL, '2021-06-04 19:30:51.035485', 2, '448', 'QFNS000448', 'Qualifier', 1, 'ET', '[{\"@language\": \"en\", \"@value\": \"etiology\"}, {\"@language\": \"es\", \"@value\": \"etiología\"}, {\"@language\": \"pt-br\", \"@value\": \"etiologia\"}, {\"@language\": \"fr\", \"@value\": \"étiologie\"}, {\"@language\": \"es-es\", \"@value\": \"etiología\"}]', '[\"Q35\",\"Y05\"]', '[\"M0030410\",\"M0030411\"]', 'M0030410', 'T060788', '[{\"@language\": \"en\", \"@value\": \"causality\"}, {\"@language\": \"en\", \"@value\": \"causes\"}, {\"@language\": \"es\", \"@value\": \"causalidad\"}, {\"@language\": \"es\", \"@value\": \"causas\"}, {\"@language\": \"pt-br\", \"@value\": \"causalidade\"}, {\"@language\": \"pt-br\", \"@value\": \"causas\"}, {\"@language\": \"en\", \"@value\": \"pathogenesis\"}, {\"@language\": \"es\", \"@value\": \"patogenésis\"}, {\"@language\": \"pt-br\", \"@value\": \"patogenêse\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"pathogenesis\\\" & \\\"causes\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.33; DF: /etiol or /ET\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye patogénesis & causas; vea definición; política de indización: Manual 19.8.33\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui patogênese & causas; veja definição; política de indexação: Manual 19.8.33\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/ET or ET (SH) or SUBS APPLY ET\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for causative agents including microorganisms and includes environmental and social factors and personal habits as contributing factors. It includes pathogenesis.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour leurs facteurs causaux, y compris les micro-organismes, et inclut les facteurs environnementaux, les facteurs sociaux et les habitudes de vie comme facteurs contributifs. Il comprend la pathogenèse.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para agentes causales incluidos los microorganismos. Incluye factores ambientales y sociales y hábitos personales como factores contribuyentes. Incluye la patogénesis.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para agentes causales incluidos los microorganismos. Incluye factores ambientales y sociales y hábitos personales como factores contribuyentes. Incluye la patogénesis.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para agentes causais, incluindo os micro-organismos. Inclui fatores ambientais e sociais e hábitos pessoais como fatores contribuintes. Inclui a patogênese.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(107, NULL, '2021-06-04 19:30:51.051101', 2, '449', 'QFNS000449', 'Qualifier', 1, 'GE', '[{\"@language\": \"en\", \"@value\": \"genetics\"}, {\"@language\": \"es\", \"@value\": \"genética\"}, {\"@language\": \"pt-br\", \"@value\": \"genética\"}, {\"@language\": \"fr\", \"@value\": \"génétique\"}, {\"@language\": \"es-es\", \"@value\": \"genética\"}]', '[\"Q35.050\",\"Q50.010\",\"Y05.050\",\"Y08.010\"]', '[\"M0030427\"]', 'M0030426', 'T060806', '[{\"@language\": \"en\", \"@value\": \"heredity\"}, {\"@language\": \"es\", \"@value\": \"herencia\"}, {\"@language\": \"es\", \"@value\": \"herencia genética\"}, {\"@language\": \"pt-br\", \"@value\": \"hereditariedade\"}, {\"@language\": \"pt-br\", \"@value\": \"herança genética\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"heredity\\\"; with organisms for genetic discussions; with diseases for the genetic basis & means of inheritance; with endogenous chemicals only for their genetic aspects; indexing policy: Manual 19.8.34; DF: /genet or /GE\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye herencia genética; con organismos para discusiones sobre genética; con enfermedades para la base genética & forma de herencia; con sustancias químicas endógenas solamente para sus aspectos genéticos; política de indización: Manual 19.8.34\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui hereditariedade; com organismos para discussões sobre genética; com doenças para a base genética & forma de herança; com substâncias químicas endógenas somente para seus aspectos genéticos; política de indexação: Manual 19.8.34\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/GE or GE (SH) or SUBS APPLY GE; use /genetics to search /familial & genetic back thru 1966\"}]', '[{\"@language\": \"en\", \"@value\": \"78; /familial & genetic was subheading 1966-88; used with Category B, D6, D8-13 & D24 1978-86; B, D6, D8-13, D24, AGING, CLIMACTERIC+, DRUG RESISTANCE+, PIGMENTATION+ & PUBERTY+ 1987-88; B, C, D6, D8-13, D24, F3, AGING, CLIMACTERIC+, DRUG RESISTANCE+, ETHNIC GROUPS+, PIGMENTATION+, PUBERTY+ & RACIAL STOCKS+ 1989; B, C, D8-9, D11-13, D24, F3 & G4-12 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for mechanisms of heredity and the genetics of organisms, for the genetic basis of normal and pathologic states, and for the genetic aspects of endogenous chemicals. It includes biochemical and molecular influence on genetic material.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les mécanismes de l\'hérédité et la génétique des organismes, pour les bases génétiques des états physiologiques ou pathologiques, ainsi que pour les aspects génétiques des substances chimiques endogènes. Il inclut l\'influence biochimique ou moléculaire sur le matériel génétique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para mecanismos de herencia y de genética de organismos, para la base genética de estados normales y patológicos y para los aspectos genéticos de sustancias químicas endógenas. Incluye la acción bioquímica y molecular sobre el material genético.\"}, {\"@language\": \"es\", \"@value\": \"Usado para mecanismos de herencia y de genética de organismos, para la base genética de estados normales y patológicos y para los aspectos genéticos de sustancias químicas endógenas. Incluye la acción bioquímica y molecular sobre el material genético.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para mecanismos de hereditariedade e para genética de organismos, para a base genética de estados normais e patológicos e para os aspectos genéticos de substâncias químicas endógenas. Inclui a influência bioquímica e molecular sobre o material genético.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(108, NULL, '2021-06-04 19:30:51.051101', 2, '450', 'QFNS000450', 'Qualifier', 1, 'GD', '[{\"@language\": \"en\", \"@value\": \"growth & development\"}, {\"@language\": \"es\", \"@value\": \"crecimiento & desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento & desenvolvimento\"}, {\"@language\": \"fr\", \"@value\": \"croissance et développement\"}, {\"@language\": \"es-es\", \"@value\": \"crecimiento & desarrollo\"}]', '[\"Q50.020\",\"Y08.020\"]', '[\"M0030446\",\"M0030450\",\"M0030449\",\"M0030448\",\"M0030447\"]', 'M0030446', 'T060828', '[{\"@language\": \"en\", \"@value\": \"growth and development\"}, {\"@language\": \"es\", \"@value\": \"crecimiento y desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento e desenvolvimento\"}, {\"@language\": \"en\", \"@value\": \"postnatal growth\"}, {\"@language\": \"es\", \"@value\": \"crecimiento posnatal\"}, {\"@language\": \"es\", \"@value\": \"crecimiento postnatal\"}, {\"@language\": \"pt-br\", \"@value\": \"crecimento pós-natal\"}, {\"@language\": \"en\", \"@value\": \"postnatal development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo posnatal\"}, {\"@language\": \"es\", \"@value\": \"desarrollo postnatal\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento pós-natal\"}, {\"@language\": \"en\", \"@value\": \"development\"}, {\"@language\": \"es\", \"@value\": \"desarrollo\"}, {\"@language\": \"pt-br\", \"@value\": \"desenvolvimento\"}, {\"@language\": \"en\", \"@value\": \"growth\"}, {\"@language\": \"es\", \"@value\": \"crecimiento\"}, {\"@language\": \"pt-br\", \"@value\": \"crescimento\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for micro-organisms & plants; with animals, for postnatal development only: for prenatal development, see /embryology\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para microorganismos & plantas; con animales, solamente para desarrollo posnatal: para desarrollo prenatal, vea /embriología\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para microrganismos & plantas; com animais, somente para desenvolvimento pós-natal: para desenvolvimento pré-natal, veja /embriologia\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/GD or GD (SH) or SUBS APPLY GD\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A & B 1966-74; A1-9, A13-15 & B 1975-86; A1-9, A13-15, B & INFANT, NEWBORN+ 1987-89; A1-l0, A13-14 & B 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with microorganisms, plants, and the postnatal period of animals for growth and development. It includes also the postnatal growth or development of organs or anatomical parts.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux micro-organismes, aux végétaux et aux animaux en période postnatale pour leur croissance et leur développement. Il comprend aussi la croissance et le développement postnatals des organes et des régions anatomiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con microorganismos, plantas y el período posnatal de animales para el crecimiento y desarrollo. Incluye también el crecimiento o desarrollo posnatal de órganos o partes anatómicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con microorganismos, plantas y el período posnatal de animales para el crecimiento y desarrollo. Incluye también el crecimiento o desarrollo posnatal de órganos o partes anatómicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com micro-organismos, plantas e o período pós-natal de animais para crescimento e desenvolvimento. Inclui também o crescimento ou desenvolvimento pós-natal de órgãos ou partes anatômicas.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(109, NULL, '2021-06-04 19:30:51.066761', 2, '451', 'QFNS000451', 'Qualifier', 1, 'HI', '[{\"@language\": \"en\", \"@value\": \"history\"}, {\"@language\": \"es\", \"@value\": \"historia\"}, {\"@language\": \"pt-br\", \"@value\": \"história\"}, {\"@language\": \"fr\", \"@value\": \"histoire\"}, {\"@language\": \"es-es\", \"@value\": \"historia\"}]', '[\"Q36\",\"Y27\"]', '[\"M0030460\",\"M0030461\"]', 'M0030460', 'T060845', '[{\"@language\": \"en\", \"@value\": \"historical aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos históricos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos históricos\"}, {\"@language\": \"en\", \"@value\": \"historical notes\"}, {\"@language\": \"es\", \"@value\": \"notas históricas\"}, {\"@language\": \"pt-br\", \"@value\": \"notas históricas\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for historical articles or historical notes in articles; not for \\\"case histories\\\" ( = check tag CASE REPORTS [Publication Type]); indexing policy: Manual 19.8.36; DF: /hist or /HI      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para artículos históricos o notas históricas en artículos; no para históricos de casos ( = precod INFORMES DE CASOS [tipo de publicación]); regla de indización: Manual de la NLM 19.8.36\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para artigos históricos ou notas históricas em artigos; não para históricos de casos ( = precod RELATOS DE CASOS [tipo de publicação]); regra de indexação: Manual da NLM 19.8.36\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/HI or HI (SH) or SUBS APPLY HI\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C-M 1966-67; C-N 1968-74; C-F, G1-3  & H-N 1975-1989; C-E, F3-4, G1-2, I2-3, J, M & N2-3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the historical aspects of any subject. It includes brief historical notes but excludes case histories.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les aspects historiques d\'un sujet. Il comprend les notes historiques brèves, mais exclut les présentations de cas.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los aspectos históricos de un tema. Incluye notas históricas breves. Excluye historias de casos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los aspectos históricos de un tema. Incluye notas históricas breves, pero excluye historias de casos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para os aspectos históricos de um assunto. Inclui notas históricas breves, mas exclui histórias de casos.\"}]', '1973-12-27', '2004-07-09', '1966-01-01', NULL, NULL),
(110, NULL, '2021-06-04 19:30:51.085872', 2, '452', 'QFNS000452', 'Qualifier', 1, 'IM', '[{\"@language\": \"en\", \"@value\": \"immunology\"}, {\"@language\": \"es\", \"@value\": \"inmunología\"}, {\"@language\": \"pt-br\", \"@value\": \"imunologia\"}, {\"@language\": \"fr\", \"@value\": \"immunologie\"}, {\"@language\": \"es-es\", \"@value\": \"inmunología\"}]', '[\"Q35.060\",\"Q50.030\",\"Y05.060\",\"Y08.030\"]', NULL, 'M0030471', 'T060858', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for \\\"immunological aspects\\\"; for substances as antigens or haptens; for antibodies to substances, organs or organisms; not for immunotherapy ( = /therapy), nor for immunologic prevention, as with vaccines ( = /prevention & control), nor for serodiagnosis ( = /diagnosis); see MeSH scope note in Introduction; indexing policy: Manual 19.8.37; DF: /immunol or /IM\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para \\\"aspectos inmunológicos\\\"; para sustancias como antígenos o haptenos; para anticuerpos específicos para sustancias, órganos u organismos; no para inmunoterapía ( = /terapia), no para prevención inmunológica, como con vacunas ( = /prevención & control), no para serodiagnóstico ( = /diagnóstico); vea definición; política de indexación: Manual de la NLM 19.8.37\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para \\\"aspectos imunológicos\\\"; para substâncias como antígenos ou haptenos; para anticorpos dirigidos a substâncias, órgãos ou organismos; não para imunoterapia ( = /terapia), não para prevenção imunológica, como com vacinas ( = /prevenção & controle), não para sorodiagnóstico ( = /diagnóstico); veja definição; política de indexação: Manual da NLM 19.8.37\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IM or IM (SH) or SUBS APPLY IM\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B & C 1966-67; A, B & C 1968-69; A, B, C & F 1970-74; A, B, C & F3 1975-86; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; A, B, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; A2-16, B, C, D1-24, F3 & G4-12 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for immunologic studies of tissues, organs, microorganisms, fungi, viruses, and animals. It includes immunologic aspects of diseases but not immunologic procedures used for diagnostic, preventive, or therapeutic purposes, for which \\\"diagnosis\\\", \\\"prevention & control\\\", or \\\"therapy\\\" are used. The concept is also used for chemicals as antigens or haptens.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les études immunologiques des tissus, des organes, des micro-organismes, des champignons, des virus et des animaux. Il inclut les aspects immunologiques des maladies, mais pas les procédures immunologiques utilisées dans un but diagnostique, préventif ou thérapeutique, pour lesquelles les qualificatifs \'diagnostic”, \'prévention et contrôle” et \'thérapie” sont respectivement utilisés. Il s’emploie aussi pour des substances chimiques comme les antigènes ou les haptènes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para estudios inmunológicos de tejidos, órganos, microorganismos, hongos, virus y animales. Incluye aspectos inmunológicos de enfermedades, pero no incluye procedimientos inmunológicos usados para diagnóstico, o con propósitos preventivos o terapéuticos, para los cuales se usan /diagnostico, \\\"/prevención & control\\\" o /terapia. Usado también para compuestos químicos como antígenos o haptenos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para estudios inmunológicos de tejidos, órganos, microorganismos, hongos, virus y animales. Incluye aspectos inmunológicos de enfermedades, pero no incluye procedimientos inmunológicos usados para diagnóstico, o con propósitos preventivos o terapéuticos, para los cuales se usan /diagnostico, \\\"/prevención & control\\\" o /terapia. Usado también para compuestos químicos como antígenos o haptenos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para estudos imunológicos de tecidos, órgãos, micro-organismos, fungos, vírus e animais. Inclui aspectos imunológicos de doenças, mas não inclui procedimentos imunológicos usados para diagnóstico, ou com objetivos preventivos ou terapêuticos, para os quais se usam /diagnóstico, \\\"/prevenção & controle\\\" ou /terapia. Usado também para compostos químicos como antígenos ou haptenos.\"}]', '1973-12-27', '2015-07-01', '1966-01-01', NULL, NULL),
(111, NULL, '2021-06-04 19:30:51.088910', 2, '453', 'QFNS000453', 'Qualifier', 1, 'IN', '[{\"@language\": \"en\", \"@value\": \"injuries\"}, {\"@language\": \"es\", \"@value\": \"lesiones\"}, {\"@language\": \"pt-br\", \"@value\": \"lesões\"}, {\"@language\": \"fr\", \"@value\": \"traumatismes\"}, {\"@language\": \"es-es\", \"@value\": \"lesiones\"}]', '[\"Q37\",\"Y29\"]', '[\"M0030486\",\"M0030487\"]', 'M0030486', 'T060876', '[{\"@language\": \"en\", \"@value\": \"trauma\"}, {\"@language\": \"es\", \"@value\": \"traumatismos\"}, {\"@language\": \"pt-br\", \"@value\": \"traumatismos\"}, {\"@language\": \"en\", \"@value\": \"wounds\"}, {\"@language\": \"es\", \"@value\": \"heridas\"}, {\"@language\": \"pt-br\", \"@value\": \"ferimentos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; by physical trauma only; includes \\\"wounds\\\", \\\"trauma\\\"; for \\\"lesion\\\" in Romance languages; not for cell damage ( = /pathology); indexing policy: Manual 19.8.38; DF: /inj or /IN\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente por traumatismo físico; incluye \\\"heridas\\\", \\\"traumatismo\\\"; para \\\"lesion\\\" en lenguas romances; no para daño celular ( = /patología)\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente por traumatismo físico; inclui \\\"ferimentos\\\", \\\"traumatismo\\\"; para \\\"lesão\\\" em línguas românicas; não para dano celular ( = /patologia)\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IN or IN (SH) or SUBS APPLY IN\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C 1966; Category A 1967-74; A1-9 & A13-15 1975-88; A1-9, A13-15 & B2 1989; A1-10, A13-14, B2 & I3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with anatomic headings, animals, and sports for wounds and injuries. Excludes cell damage, for which \\\"pathology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux régions anatomiques, aux animaux et aux sports pour les blessures et les traumatismes. Il exclut les lésions cellulaires, pour lesquelles le qualificatif \'anatomopathologie” est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores anatómicos, animales y deportes para heridas y lesiones. Excluye el daño celular o de tejidos, para los que se usa /patología.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores anatómicos, animales y deportes para heridas y lesiones. Excluye el daño celular o de tejidos, para los que se usa /patología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores anatômicos, animais e esportes para ferimentos e lesões. Exclui dano celular ou de tecidos, para os quais se usa /patologia.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(112, NULL, '2021-06-04 19:30:51.088910', 2, '454', 'QFNS000454', 'Qualifier', 1, 'IR', '[{\"@language\": \"en\", \"@value\": \"innervation\"}, {\"@language\": \"es\", \"@value\": \"inervación\"}, {\"@language\": \"pt-br\", \"@value\": \"inervação\"}, {\"@language\": \"fr\", \"@value\": \"innervation\"}, {\"@language\": \"es-es\", \"@value\": \"inervación\"}]', '[\"Q10.040\",\"Y02.040\"]', '[\"M0030488\"]', 'M0030488', 'T060879', '[{\"@language\": \"en\", \"@value\": \"nerve supply\"}, {\"@language\": \"es\", \"@value\": \"red nerviosa\"}, {\"@language\": \"pt-br\", \"@value\": \"nervação\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"nerve supply\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.39; DF: /innerv or /IR\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye suplimiento de nervio; vea definición; política de indización: Manual 19.8.39\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui suprimento de nervo; veja definição; política de indexação: Manual 19.8.39\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IR or IR (SH) or SUBS APPLY IR\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966-74; A1-9 & A13-16 1975; A1-7, A9 & A13-16 1976-89; A1-7, A9-10, A13-14 & A16 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, regions, or tissues for their nerve supply.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux régions anatomiques et aux tissus pour leur innervation.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, regiones anatómicas o tejidos para su dotación nerviosa.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, regiones anatómicas o tejidos para su suministro de nervios.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, regiões anatômicas ou tecidos para seu suprimento de nervos.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(113, NULL, '2021-06-04 19:30:51.104567', 2, '455', 'QFNS000455', 'Qualifier', 1, 'IS', '[{\"@language\": \"en\", \"@value\": \"instrumentation\"}, {\"@language\": \"es\", \"@value\": \"instrumentación\"}, {\"@language\": \"pt-br\", \"@value\": \"instrumentação\"}, {\"@language\": \"fr\", \"@value\": \"instrumentation\"}, {\"@language\": \"es-es\", \"@value\": \"instrumentación\"}]', '[\"Q38\",\"Y31\"]', '[\"M0030494\",\"M0030490\",\"M0030491\",\"M0030492\",\"M0030493\"]', 'M0030489', 'T060881', '[{\"@language\": \"en\", \"@value\": \"instruments\"}, {\"@language\": \"es\", \"@value\": \"instrumentos\"}, {\"@language\": \"es\", \"@value\": \"utensilios\"}, {\"@language\": \"pt-br\", \"@value\": \"instrumentos\"}, {\"@language\": \"en\", \"@value\": \"devices\"}, {\"@language\": \"es\", \"@value\": \"dispositivos\"}, {\"@language\": \"pt-br\", \"@value\": \"dispositivos\"}, {\"@language\": \"en\", \"@value\": \"equipment\"}, {\"@language\": \"es\", \"@value\": \"equipos\"}, {\"@language\": \"pt-br\", \"@value\": \"equipamentos\"}, {\"@language\": \"en\", \"@value\": \"apparatus\"}, {\"@language\": \"es\", \"@value\": \"aparatos\"}, {\"@language\": \"pt-br\", \"@value\": \"aparelhos\"}, {\"@language\": \"en\", \"@value\": \"appliances\"}, {\"@language\": \"pt-br\", \"@value\": \"utensílios\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"apparatus\\\", \\\"appliances\\\", \\\"instruments\\\",\\\"equipment\\\", \\\"supplies\\\", \\\"devices\\\"; not for techniques ( = /methods); see MeSH scope note in Introduction; indexing policy: Manual 19.8.40; DF: /instrum or /IS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye aparatos, herramientas, instrumentos, equipos, provisiones, dispositivos; no para técnicas ( = /métodos); vea definición; política de indización: Manual 19.8.40\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui aparelhos, ferramentas, instrumentos, equipamentos, provisões, dispositivos; não para técnicas ( = /métodos); veja definição; política de indexação: Manual 19.8.40\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IS or IS (SH) or SUBS APPLY IS\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category E-H 1966-67; E-H & J 1968-74; E, F2, F4, G1-3, H, J & L 1975-81; E1-6, F2, F4, G1-3, H, J & L 1982-89; E1-6, F4 & G1-2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diagnostic or therapeutic procedures, analytic techniques, and specialties or disciplines, for the development or modification of apparatus, instruments, or equipment.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux procédures diagnostiques ou thérapeutiques, aux techniques analytiques, aux spécialités ou aux disciplines, pour le développement ou les modifications d\'appareils, d\'instruments ou d\'équipement.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con procedimientos diagnósticos y terapéuticos, técnicas analíticas y especialidades o disciplinas para el desarrollo o modificación de aparatos, instrumentos o equipos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con procedimientos diagnósticos y terapéuticos, técnicas analíticas y especialidades o disciplinas para el desarrollo o modificación de aparatos, instrumentos o equipos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com procedimentos diagnósticos ou terapêuticos, técnicas analíticas e especialidades ou disciplinas para o desenvolvimento ou modificação de aparelhos, instrumentos ou equipamentos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(114, NULL, '2021-06-04 19:30:51.120195', 2, '456', 'QFNS000456', 'Qualifier', 1, 'IP', '[{\"@language\": \"en\", \"@value\": \"isolation & purification\"}, {\"@language\": \"es\", \"@value\": \"aislamiento & purificación\"}, {\"@language\": \"es\", \"@value\": \"aislamiento y purificación\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento & purificação\"}, {\"@language\": \"fr\", \"@value\": \"isolement et purification\"}, {\"@language\": \"es-es\", \"@value\": \"aislamiento & purificación\"}]', '[\"Q05.030\",\"Y01.030\"]', '[\"M0030500\",\"M0030502\",\"M0030501\"]', 'M0030500', 'T060892', '[{\"@language\": \"en\", \"@value\": \"isolation and purification\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento e purificação\"}, {\"@language\": \"en\", \"@value\": \"purification\"}, {\"@language\": \"es\", \"@value\": \"purificación\"}, {\"@language\": \"pt-br\", \"@value\": \"purificação\"}, {\"@language\": \"en\", \"@value\": \"isolation\"}, {\"@language\": \"es\", \"@value\": \"aislamiento\"}, {\"@language\": \"pt-br\", \"@value\": \"isolamento\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with micro-organisms & helminths includes obtaining pure strains, demonstrating presence & culture techniques but consider also /growth & development; with chemicals & biological substances includes isolation of constituents; indexing policy: Manual 19.8.41; DF: /isol or /IP\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; con microorganismos & helmintos incluye cepas puras, demostrando presencia & técnicas de cultivo pero vea también /crecimiento & desarrollo; con sustancias químicas & biológicas incluye aislamiento de constituyentes: Manual de la NLM 19.8.41\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; com microrganismos & helmintos inclui cepas puras, demonstrando presença & técnicas de cultura mas veja também /crescimiento & desenvolvimento; com substâncias químicas & biológicas inclui isolamento de constituintes; Manual da NLM 19.8.41\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/IP or IP (SH) or SUBS APPLY IP\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B 1966-68; B & D 1969-74; B1, B3-5 & D 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with bacteria, viruses, fungi, protozoa, and helminths for the obtaining of pure strains or for the demonstration of the presence of or identification of organisms by DNA analyses, immunologic, or other methods, including culture techniques. It is used also with biological substances and chemicals for the isolation and purification of the constituents.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux bactéries, aux virus, aux champignons, aux protozoaires et aux helminthes pour l\'obtention de souches pures, ainsi que pour la détection ou l\'identification des organismes par l’analyse de leur ADN, par des méthodes immunologiques ou autres, y compris des techniques de culture. Il s\'applique aussi aux substances biologiques ou chimiques pour l\'isolement et la purification de leurs composants.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con bacterias, virus, hongos, protozoos y helmintos para la obtención de cepas puras o para la demostración de la presencia o identificación de organismos por análisis del ADN, métodos inmunológicos u otros, incluidas las técnicas de cultivo. Se usa también con sustancias biológicas y productos químicos para el aislamiento y purificación de sus componentes.\"}, {\"@language\": \"es\", \"@value\": \"Usado con bacterias, virus, hongos, protozoos y helmintos para la obtención de cepas puras o para la demostración de la presencia o identificación de organismos por análisis del ADN, métodos inmunológicos u otros, incluidas las técnicas de cultivo. Se usa también con sustancias biológicas y productos químicos para el aislamiento y purificación de sus componentes.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com bactérias, vírus, fungos, protozoários e helmintos para a obtenção de linhagens puras ou para demonstração da presença ou identificação de organismos por análises de DNA, por métodos imunológicos ou outros, incluindo técnicas de cultura. Usado também com substâncias biológicas e produtos químicos para isolamento e purificação de seus componentes.\"}]', '1973-12-27', '2017-04-11', '1966-01-01', NULL, NULL),
(115, NULL, '2021-06-04 19:30:51.135835', 2, '457', 'QFNS000457', 'Qualifier', 1, 'LJ', '[{\"@language\": \"en\", \"@value\": \"legislation & jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"legislación & jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"legislação & jurisprudência\"}, {\"@language\": \"fr\", \"@value\": \"législation et jurisprudence\"}, {\"@language\": \"es-es\", \"@value\": \"legislación & jurisprudencia\"}]', '[\"Q40.020\",\"Y06.020\"]', '[\"M0030527\",\"M0030528\",\"M0030529\",\"M0030536\",\"M0030537\",\"M0030541\",\"M0030538\",\"M0030531\",\"M0030533\",\"M0030539\",\"M0030540\",\"M0030534\",\"M0030535\",\"M0030530\"]', 'M0030527', 'T060922', '[{\"@language\": \"en\", \"@value\": \"legislation and jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"legislación y jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"legislação e jurisprudência\"}, {\"@language\": \"en\", \"@value\": \"court decisions\"}, {\"@language\": \"es\", \"@value\": \"decisiones del tribunal\"}, {\"@language\": \"pt-br\", \"@value\": \"decisões do tribunal\"}, {\"@language\": \"en\", \"@value\": \"government regulations\"}, {\"@language\": \"es\", \"@value\": \"regulaciones gubernamentales\"}, {\"@language\": \"pt-br\", \"@value\": \"regulamentos gobernamentais\"}, {\"@language\": \"en\", \"@value\": \"judicial aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos judiciales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos judiciais\"}, {\"@language\": \"en\", \"@value\": \"juridical aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos jurídicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos jurídicos\"}, {\"@language\": \"en\", \"@value\": \"statutes\"}, {\"@language\": \"es\", \"@value\": \"estatutos\"}, {\"@language\": \"pt-br\", \"@value\": \"estatutos\"}, {\"@language\": \"en\", \"@value\": \"lawsuits\"}, {\"@language\": \"es\", \"@value\": \"pleito\"}, {\"@language\": \"pt-br\", \"@value\": \"processo jurídico\"}, {\"@language\": \"en\", \"@value\": \"legal aspects\"}, {\"@language\": \"en\", \"@value\": \"jurisprudence\"}, {\"@language\": \"es\", \"@value\": \"aspectos legales\"}, {\"@language\": \"es\", \"@value\": \"jurisprudencia\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos legais\"}, {\"@language\": \"pt-br\", \"@value\": \"jurisprudência\"}, {\"@language\": \"en\", \"@value\": \"litigation\"}, {\"@language\": \"es\", \"@value\": \"litigio\"}, {\"@language\": \"pt-br\", \"@value\": \"litígio\"}, {\"@language\": \"en\", \"@value\": \"medicolegal aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos medicolegales\"}, {\"@language\": \"es\", \"@value\": \"procedimientos medicolegales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos medicolegales\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos médico-legais\"}, {\"@language\": \"en\", \"@value\": \"ordinances\"}, {\"@language\": \"es\", \"@value\": \"ordenanzas\"}, {\"@language\": \"pt-br\", \"@value\": \"ordenanças\"}, {\"@language\": \"en\", \"@value\": \"regulations\"}, {\"@language\": \"es\", \"@value\": \"regulaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"regulamentos\"}, {\"@language\": \"en\", \"@value\": \"civil suits\"}, {\"@language\": \"es\", \"@value\": \"pleito civil\"}, {\"@language\": \"pt-br\", \"@value\": \"demanda civil\"}, {\"@language\": \"en\", \"@value\": \"laws\"}, {\"@language\": \"es\", \"@value\": \"leyes\"}, {\"@language\": \"pt-br\", \"@value\": \"leis\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; includes \\\"legal\\\", \\\"laws\\\", \\\"government regulations\\\", \\\"statutes\\\", \\\"ordinances\\\", \\\"medicolegal\\\", \\\"judicial\\\", \\\"juridical\\\", \\\"suits\\\", \\\"avoidance of suits\\\", \\\"litigation\\\", \\\"court decisions\\\"\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"legal\\\", \\\"leyes\\\", \\\"reglamentos gubernamentales\\\", \\\"estatutos\\\", \\\"ordenanzas\\\", \\\"medicolegal\\\", \\\"judicial\\\", \\\"jurídico\\\", \\\"acción judicial\\\" o \\\"juicio\\\", \\\"anulación de acción\\\", \\\"litígio\\\", \\\"decisiónes de la corte\\\"\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"legal\\\", \\\"leis\\\", \\\"regulamentos governamentais\\\", \\\"estatutos\\\", \\\"ordenanças\\\", \\\"médico-legal\\\", \\\"judicial\\\", \\\"jurídico\\\", \\\"ação judicial\\\" ou \\\"processo\\\", \\\"anulação de ação\\\", \\\"litígio\\\", \\\"decisões da corte\\\"\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/LJ or LJ (SH) or SUBS APPLY LJ\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category I1-2 & N2-4 1978-87; I1-2, L, N2-4 & SMOKING 1988; G2-3, I1-2, L, N2-4 & SMOKING+ 1989; G1-2, I2-3 & N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for laws, statutes, ordinances, or government regulations, as well as for legal controversy and court decisions.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les lois, les règlements, les décrets et les arrêtés gouvernementaux, ainsi que pour les controverses juridiques et les décisions judiciaires.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para leyes, estatutos, decretos o reglamentos gubernamentales y también para controversias legales y decisiones jurídicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado para leyes, estatutos, decretos o reglamentos gubernamentales y también para controversias legales y decisiones jurídicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para leis, estatutos, decretos ou regulamentos governamentais e também para controvérsias legais e decisões jurídicas.\"}]', '1977-05-16', '2017-04-11', '1978-01-01', NULL, NULL),
(116, NULL, '2021-06-04 19:30:51.151451', 2, '458', 'QFNS000458', 'Qualifier', 1, 'ME', '[{\"@language\": \"en\", \"@value\": \"metabolism\"}, {\"@language\": \"es\", \"@value\": \"metabolismo\"}, {\"@language\": \"pt-br\", \"@value\": \"metabolismo\"}, {\"@language\": \"fr\", \"@value\": \"métabolisme\"}, {\"@language\": \"es-es\", \"@value\": \"metabolismo\"}]', '[\"Q50.040\",\"Y08.040\"]', '[\"M0030576\",\"M0030577\",\"M0030759\",\"M0030579\",\"M0030580\",\"M0030582\",\"M0030581\",\"M0030578\",\"M0030583\"]', 'M0030575', 'T060983', '[{\"@language\": \"en\", \"@value\": \"biodegradation\"}, {\"@language\": \"es\", \"@value\": \"biodegradación\"}, {\"@language\": \"pt-br\", \"@value\": \"biodegradação\"}, {\"@language\": \"en\", \"@value\": \"biotransformation\"}, {\"@language\": \"es\", \"@value\": \"biotransformación\"}, {\"@language\": \"pt-br\", \"@value\": \"biotransformação\"}, {\"@language\": \"en\", \"@value\": \"secretion\"}, {\"@language\": \"es\", \"@value\": \"secreción\"}, {\"@language\": \"pt-br\", \"@value\": \"secreção\"}, {\"@language\": \"en\", \"@value\": \"degradation\"}, {\"@language\": \"es\", \"@value\": \"degradación\"}, {\"@language\": \"pt-br\", \"@value\": \"degradação\"}, {\"@language\": \"en\", \"@value\": \"incorporation\"}, {\"@language\": \"es\", \"@value\": \"incorporación\"}, {\"@language\": \"pt-br\", \"@value\": \"incorporação\"}, {\"@language\": \"en\", \"@value\": \"mobilization\"}, {\"@language\": \"es\", \"@value\": \"movilización\"}, {\"@language\": \"pt-br\", \"@value\": \"mobilização\"}, {\"@language\": \"en\", \"@value\": \"turnover\"}, {\"@language\": \"es\", \"@value\": \"recambio\"}, {\"@language\": \"pt-br\", \"@value\": \"turnover\"}, {\"@language\": \"en\", \"@value\": \"biochemical pathways\"}, {\"@language\": \"es\", \"@value\": \"vías bioquímicas\"}, {\"@language\": \"pt-br\", \"@value\": \"vias bioquímicas\"}, {\"@language\": \"en\", \"@value\": \"catabolism\"}, {\"@language\": \"es\", \"@value\": \"catabolismo\"}, {\"@language\": \"pt-br\", \"@value\": \"catabolismo\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only: includes \\\"binding\\\", \\\"catabolism\\\", \\\"conversion\\\", \\\"degradation\\\", \\\"incorporation\\\", \\\"mobilization\\\", \\\"pathway\\\", \\\"splitting\\\", \\\"storage\\\", \\\"turnover\\\", \\\"utilization\\\"; not for \\\"anabolism\\\": use instead  /biosynthesis;  for \\\"absorption\\\", \\\"release\\\", \\\"transport\\\", \\\"uptake\\\"  /pharmacokinetics is also available; for excretion into the blood use  /blood, into the cerebrospinal fluid use  /cerebrospinal fluid, into the urine use  /urine; for biosynthesis or synthesis use  /biosynthesis; for  metabolic aspects of enzymes use /enzymology with Category A, B, and C terms\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye enlace, catabolismo, conversión, degradación, incorporación, mobilización, vias, segmentación(splitting), almacenamiento, recambio, utilización; no para anabolismo: para eso use /biosíntesis; no para absorción, distribución, farmacocinética, liberación, trasporte, captación: para essos use /farmacocinética; para excreción hacia la sangre use /sangre, hacia el líquido cefalorraquideo use /líquido cefalorraquideo, hacia la orina use /orina; para biosíntesis o síntesis use /biosíntesis; para secreción use /secreción; para cualquier aspecto metabólico de enzimas use /enzimología con términos de las Categorías A, B y C; política de indización: Manual 19.8.44\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui ligação, catabolismo, conversão, degradação, incorporação, mobilização, vias, segmentação(splitting), armazenamento, recambio, utilização; não para anabolismo: para isso use /biossíntese; não para absorção, distribuição, farmacocinética, liberação, transporte, captação: para esses use /farmacocinética; excreção para dentro do sangue use /sangue, para dentro do líquido cefalorraquidiano use /líquido cefalorraquidiano, para dentro da urina use /urina; para biossíntese ou síntese use /biossíntese; para secreção use /secreção; para qualquer aspecto metabólico de enzimas use /enzimologia com termos das Categorias A, B e C; política de indexação: Manual 19.8.44\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use; main heading/ME or ME (SH) or SUBS APPLY ME; included /pharmacokinetics 1966-87\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A-D & F 1966-74; A-D & F3 1975-86; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; A-D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; A2-16, B-D & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, cells and subcellular fractions, organisms, and diseases for biochemical changes. It is used also with drugs and chemicals for catabolic changes (breakdown of complex molecules into simpler ones). For anabolic processes (conversion of small molecules into large), BIOSYNTHESIS is used. For enzymology, pharmacokinetics, and secretion use the specific subheadings.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux cellules, aux fractions subcellulaires, aux organismes et aux maladies pour les modifications biochimiques et le métabolisme. Il s\'applique aussi aux médicaments et aux substances chimiques pour les processus cataboliques (dégradation). Pour les processus anaboliques (biosynthèse), le descripteur Biosynthèse est employé. Pour l\'enzymologie, la pharmacocinétique et la sécrétion, les qualificatifs \'enzymologie\', \'pharmacocinétique\' et \'sécrétion\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, células y fracciones subcelulares, organismos y enfermedades para los cambios bioquímicos y el metabolismo. Usado también con medicamentos y sustancias químicas para los cambios catabólicos (ruptura de moléculas complejas en moléculas simples). Para los procesos anabólicos (conversión de moléculas pequeñas a grandes) se usa BIOSÍNTESIS. Para enzimología, farmacocinética y secreción, usar los calificadores específicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, células y fracciones subcelulares, organismos y enfermedades para los cambios bioquímicos y el metabolismo. Usado también con medicamentos y sustancias químicas para los cambios catabólicos (ruptura de moléculas complejas en moléculas más simples). Para los procesos anabólicos (conversión de moléculas pequeñas a grandes) se usa BIOSÍNTESIS. Para enzimología, farmacocinética y secreción, usar los calificadores específicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, células e frações subcelulares, organismos e doenças para mudanças bioquímicas e metabolismo. Usado também com medicamentos e substâncias químicas para mudanças catabólicas (ruptura de moléculas complexas em moléculas mais simples). Para os processos anabólicos (processo oposto ao catabolismo - conversão de pequenas moléculas em moléculas complexas) usar /biossíntese. Para enzimologia, farmacocinética e secreção, usar os qualificadores específicos.\"}]', '1973-12-27', '2018-07-09', '1966-01-01', NULL, NULL),
(117, NULL, '2021-06-04 19:30:51.167076', 2, '459', 'QFNS000459', 'Qualifier', 1, 'MT', '[{\"@language\": \"en\", \"@value\": \"methods\"}, {\"@language\": \"es\", \"@value\": \"métodos\"}, {\"@language\": \"pt-br\", \"@value\": \"métodos\"}, {\"@language\": \"fr\", \"@value\": \"méthodes\"}, {\"@language\": \"es-es\", \"@value\": \"métodos\"}]', '[\"Q39\",\"Y33\"]', '[\"M0030584\",\"M0030585\"]', 'M0030584', 'T060992', '[{\"@language\": \"en\", \"@value\": \"techniques\"}, {\"@language\": \"en\", \"@value\": \"procedures\"}, {\"@language\": \"es\", \"@value\": \"técnicas\"}, {\"@language\": \"es\", \"@value\": \"procedimientos\"}, {\"@language\": \"pt-br\", \"@value\": \"técnicas\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos\"}, {\"@language\": \"en\", \"@value\": \"methodology\"}, {\"@language\": \"es\", \"@value\": \"metodología\"}, {\"@language\": \"pt-br\", \"@value\": \"metodologia\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"technique\\\", \\\"methodology\\\", \\\"procedures\\\"; see also /instrumentation; indexing policy: Manual 19.8.45; DF: /methods or /MT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"técnica\\\", \\\"metodología\\\", \\\"procedimientos\\\"; vea también /instrumentación; regla de indización: Manual de la NLM 19.8.45\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"técnica\\\", \\\"metodologia\\\", \\\"procedimentos\\\"; veja também /instrumentação; regra de indexação: Manual da NLM 19.8.45\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MT or MT (SH) or SUBS APPLY MT\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category E, F4, G1-3, H-J, L & N 1975-81; E1-6, F4, G1-3, H-J, L & N 1982-89; E1-6, F4, G1-2 & I2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with techniques, procedures, and programs for methods.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux techniques, aux procédures et aux programmes pour les méthodes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con técnicas, procedimientos y programas para métodos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con técnicas, procedimientos y programas para métodos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com técnicas, procedimentos e programas para métodos.\"}]', '1974-10-23', '2003-07-24', '1975-01-01', NULL, NULL),
(118, NULL, '2021-06-04 19:30:51.187745', 2, '460', 'QFNS000460', 'Qualifier', 1, 'MI', '[{\"@language\": \"en\", \"@value\": \"microbiology\"}, {\"@language\": \"es\", \"@value\": \"microbiología\"}, {\"@language\": \"pt-br\", \"@value\": \"microbiologia\"}, {\"@language\": \"fr\", \"@value\": \"microbiologie\"}, {\"@language\": \"es-es\", \"@value\": \"microbiología\"}]', '[\"Q35.070\",\"Y05.070\"]', '[\"M0030593\",\"M0030592\"]', 'M0030588', 'T060998', '[{\"@language\": \"en\", \"@value\": \"fungi\"}, {\"@language\": \"es\", \"@value\": \"hongos\"}, {\"@language\": \"pt-br\", \"@value\": \"fungos\"}, {\"@language\": \"en\", \"@value\": \"bacteria\"}, {\"@language\": \"es\", \"@value\": \"bacterias\"}, {\"@language\": \"pt-br\", \"@value\": \"bactérias\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; see also /parasitology & /virology; for ability of organisms to cause disease use /pathogenicity; see MeSH scope note in Introduction; indexing policy: Manual 19.8.46; DF: /microbiol or /MI\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; veja também /parasitologia & /virologia; para a habilidade de organismos em causarem doença use /patogenicidade; veja definição; política de indexação: Manual da NLM 19.8.46\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; vea también /parasitología & /virología; para la habilidad de organismos en causaren enfermedad use /patogenicidad; vea definición; política de indexación: Manual de la NLM 19.8.46\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MI or MI (SH) or SUBS APPLY MI\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category A & C 1967-74; A, B1-2, B6, C & F3 1975-86; A, B1-2, B6, C, F3 & INFANT, NEWBORN+; A, B1-2, B6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, animals, and higher plants and with diseases for microbiologic studies. For parasites, \\\"parasitology\\\" is used; for viruses, \\\"virology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux animaux, aux végétaux supérieurs et aux maladies pour les études microbiologiques. Pour les parasites et les virus, les qualificatifs \'parasitologie” et \'virologie\' sont respectivement utilisés.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, animales y plantas superiores y con enfermedades para estudios microbiológicos. Para parásitos se usa /parasitología y para virus, /virología.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, animales y plantas superiores y con enfermedades para estudios microbiológicos. Para parásitos se usa /parasitología y para virus, /virología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, animais, plantas superiores e doenças para estudos microbiológicos. Para parasitos usa-se /parasitologia e para vírus, /virologia.\"}]', '1973-12-27', '2015-07-01', '1967-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(119, NULL, '2021-06-04 19:30:51.188717', 2, '461', 'QFNS000461', 'Qualifier', 1, 'MO', '[{\"@language\": \"en\", \"@value\": \"mortality\"}, {\"@language\": \"es\", \"@value\": \"mortalidad\"}, {\"@language\": \"pt-br\", \"@value\": \"mortalidade\"}, {\"@language\": \"fr\", \"@value\": \"mortalité\"}, {\"@language\": \"es-es\", \"@value\": \"mortalidad\"}]', '[\"Q55.010.020\",\"Y09.010.020\"]', '[\"M0030612\",\"M0030611\"]', 'M0030609', 'T061020', '[{\"@language\": \"en\", \"@value\": \"survival\"}, {\"@language\": \"es\", \"@value\": \"supervivencia\"}, {\"@language\": \"pt-br\", \"@value\": \"sobrevivência\"}, {\"@language\": \"en\", \"@value\": \"death rate\"}, {\"@language\": \"es\", \"@value\": \"tasa de mortalidad\"}, {\"@language\": \"es\", \"@value\": \"muerte\"}, {\"@language\": \"pt-br\", \"@value\": \"taxa de mortalidade\"}, {\"@language\": \"pt-br\", \"@value\": \"morte\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"survival\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.47; DF: /mortal or /MO      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye supervivencia; vea definición; política de indización: Manual 19.8.47\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui sobrevivência; veja definição; política de indexação: Manual 19.8.47\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/MO or MO (SH) or SUBS APPLY MO\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C, E & F 1967-74; C, E & F3-4 1975-86; C, E, F3-4 & SMOKING 1988; C, E, F3-4, ACCIDENTS+ & SMOKING+ 1989; C, E4 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with human and veterinary diseases for mortality statistics. For deaths resulting from various procedures statistically but for a death resulting in a specific case, use FATAL OUTCOME, not /mortality.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies humaines ou animales pour les statistiques de mortalité. Pour un décès dans un cas particulier, c’est le descripteur \'Issue fatale\' qui est utilisé et non le qualificatif \'mortalité\'.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades humanas y animales para estadísticas de mortalidad. En estadística, para muertes debidas a diversos procedimientos, pero para un fallecimiento que resulte en un caso específico, se usa RESULTADO FATAL, no /mortalidad.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades humanas y animales para estadísticas de mortalidad. En estadística, para muertes debidas a diversos procedimientos, pero para un fallecimiento que resulte en un caso específico, se usa RESULTADO FATAL, no /mortalidad.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças humanas e veterinárias para estatísticas de mortalidade. Em estatística, para mortes devidas a diversos procedimentos, mas para um falecimento que resulte em um caso específico, usa-se EVOLUÇÃO FATAL, não /mortalidade.\"}]', '1973-12-27', '2004-07-13', '1967-01-01', NULL, NULL),
(120, NULL, '2021-06-04 19:30:51.204644', 2, '462', 'QFNS000462', 'Qualifier', 1, 'NU', '[{\"@language\": \"en\", \"@value\": \"nursing\"}, {\"@language\": \"es\", \"@value\": \"enfermería\"}, {\"@language\": \"pt-br\", \"@value\": \"enfermagem\"}, {\"@language\": \"fr\", \"@value\": \"soins infirmiers\"}, {\"@language\": \"es-es\", \"@value\": \"enfermería\"}]', '[\"Q65.030\",\"Y11.030\"]', '[\"M0030646\",\"M0030647\"]', 'M0030646', 'T061061', '[{\"@language\": \"en\", \"@value\": \"nursing care\"}, {\"@language\": \"es\", \"@value\": \"atención de enfermería\"}, {\"@language\": \"es\", \"@value\": \"cuidado de enfermería\"}, {\"@language\": \"es\", \"@value\": \"cuidados de enfermería\"}, {\"@language\": \"pt-br\", \"@value\": \"assistência de enfermagem\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidado de enfermagem\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidados de enfermagem\"}, {\"@language\": \"en\", \"@value\": \"home care\"}, {\"@language\": \"es\", \"@value\": \"atención domiciliaria\"}, {\"@language\": \"es\", \"@value\": \"cuidados domiciliarios\"}, {\"@language\": \"es\", \"@value\": \"asistencia domiciliaria\"}, {\"@language\": \"pt-br\", \"@value\": \"assistência domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"atenção domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"atendimento domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidado domiciliar\"}, {\"@language\": \"pt-br\", \"@value\": \"cuidados domiciliares\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"nursing care\\\" by professional nurse or physician-prescribed home programs; see MeSH scope note in Introduction; indexing policy: Manual 19.8.48; DF: /nurs or /NU\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye atención de enfermería por enfermera(o) profesional o programas para el hogar prescritos por el médico; vea definición; política de indización: Manual 19.8.48\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui cuidados de enfermagem por enfermeira(o) profissional ou programas para o lar prescritos pelo médico; veja definição; política de indexação: Manual 19.8.48\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/NU or NU (SH) or SUBS APPLY NU\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-69; C, E & F 1970-74; C, E & F3 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for nursing care and techniques in their management. It includes the nursing role in diagnostic, therapeutic, and preventive procedures.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les soins infirmiers et les techniques liées à leur prise en charge. Il comprend le rôle infirmier dans les procédures diagnostiques, thérapeutiques et préventives.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para cuidados de enfermería y técnicas propias de la profesión. Incluye el rol de la enfermería en los procedimientos diagnósticos, terapéuticos y preventivos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para cuidados de enfermería y técnicas propias de conducta. Incluye el rol de la enfermería en los procedimientos diagnósticos, terapéuticos y preventivos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para cuidados de enfermagem e técnicas próprias de conduta. Inclui o papel da enfermagem nos procedimentos diagnósticos, terapêuticos e preventivos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(121, NULL, '2021-06-04 19:30:51.220248', 2, '463', 'QFNS000463', 'Qualifier', 1, 'EP', '[{\"@language\": \"en\", \"@value\": \"epidemiology\"}, {\"@language\": \"es\", \"@value\": \"epidemiología\"}, {\"@language\": \"pt-br\", \"@value\": \"epidemiologia\"}, {\"@language\": \"fr\", \"@value\": \"épidémiologie\"}, {\"@language\": \"es-es\", \"@value\": \"epidemiología\"}]', '[\"Q55.010\",\"Y09.010\"]', '[\"M0030649\",\"M0030657\",\"M0030654\",\"M0030651\",\"M0030656\",\"M0030652\",\"M0030653\",\"M0030655\",\"M0030650\"]', 'M0030648', 'T061064', '[{\"@language\": \"en\", \"@value\": \"epidemics\"}, {\"@language\": \"es\", \"@value\": \"epidemia\"}, {\"@language\": \"pt-br\", \"@value\": \"epidemia\"}, {\"@language\": \"en\", \"@value\": \"frequency\"}, {\"@language\": \"es\", \"@value\": \"frecuencia\"}, {\"@language\": \"pt-br\", \"@value\": \"frequência\"}, {\"@language\": \"en\", \"@value\": \"surveillance\"}, {\"@language\": \"es\", \"@value\": \"vigilancia\"}, {\"@language\": \"pt-br\", \"@value\": \"vigilância\"}, {\"@language\": \"en\", \"@value\": \"morbidity\"}, {\"@language\": \"es\", \"@value\": \"morbidad\"}, {\"@language\": \"pt-br\", \"@value\": \"morbidade\"}, {\"@language\": \"en\", \"@value\": \"occurrence\"}, {\"@language\": \"es\", \"@value\": \"ocurrencia\"}, {\"@language\": \"pt-br\", \"@value\": \"ocorrência\"}, {\"@language\": \"en\", \"@value\": \"outbreaks\"}, {\"@language\": \"es\", \"@value\": \"brotes\"}, {\"@language\": \"pt-br\", \"@value\": \"surtos\"}, {\"@language\": \"en\", \"@value\": \"prevalence\"}, {\"@language\": \"es\", \"@value\": \"prevalencia\"}, {\"@language\": \"pt-br\", \"@value\": \"prevalência\"}, {\"@language\": \"en\", \"@value\": \"endemics\"}, {\"@language\": \"es\", \"@value\": \"endemia\"}, {\"@language\": \"pt-br\", \"@value\": \"endemia\"}, {\"@language\": \"en\", \"@value\": \"incidence\"}, {\"@language\": \"es\", \"@value\": \"incidencia\"}, {\"@language\": \"pt-br\", \"@value\": \"incidência\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with diseases & geographicals only; includes \\\"incidence\\\", \\\"frequency\\\", \\\"prevalence\\\", \\\"occurrence\\\", \\\"outbreaks\\\"; not for \\\"mortality\\\" ( = /mortality); not for \\\"statistics\\\" on non-disease terms ( = /statist); see MeSH scope note in Introduction; indexing policy: Manual 19.8.31; DF: /epidemiol or /EP      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con enfermedades & geográficos; incluye \\\"incidencia\\\", \\\"frecuencia\\\", \\\"prevalencia\\\", \\\"ocurrencia\\\", \\\"brotes\\\"; no para \\\"mortalidad\\\" ( = /mortalidad); no para \\\"estadísticas\\\" en términos que no son enfermedades ( = /estadist); vea definición; regla de indización: Manual de la NLM 19.8.31\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com doenças & geográficos; inclui \\\"incidência\\\", \\\"frequência\\\", \\\"prevalência\\\", \\\"ocorrência\\\", \\\"surtos\\\"; não para \\\"mortalidade\\\" ( = /mortalidade); não para \\\"estatísticas\\\" em termos que não são doenças ( = /estatist); veja definição; regra de indexação: Manual da NLM 19.8.31\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/EP or EP (SH) or SUBS APPLY EP; use /epidemiology to search /occurrence 1966-88\"}]', '[{\"@language\": \"en\", \"@value\": \"89; was /occurrence 1966-88; was used with Category C, F3 & SMOKING+ 1989; C, F3 & Z 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with human and veterinary diseases for the distribution of disease, factors which cause disease, and the attributes of disease in defined populations; includes incidence, frequency, prevalence, endemic and epidemic outbreaks; also surveys and estimates of morbidity in geographic areas and in specified populations. Used also with geographical headings for the location of epidemiologic aspects of a disease. Excludes mortality for which \\\"mortality\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies humaines ou animales pour leur distribution, leurs facteurs étiologiques et leurs caractéristiques dans des populations définies. Il inclut l\'incidence, la fréquence, la prévalence, ainsi que les foyers d’endémie et d’épidémie. Il comprend également les enquêtes et les estimations de la morbidité en fonction des zones géographiques et des populations. Il s\'applique aussi aux descripteurs géographiques pour la localisation des aspects épidémiologiques d\'une maladie. Il exclut la mortalité, pour laquelle le qualificatif \'mortalité\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades humanas y animales para su distribución, factores causantes y características en poblaciones definidas. Incluye la incidencia, frecuencia, prevalencia y los brotes endémicos y epidémicos; también incluye encuestas y estimaciones de morbilidad en áreas geográficas y en poblaciones específicas. Por último, usado con descriptores geográficos para la localización de aspectos epidemiológicos de una enfermedad. Excluye la mortalidad, para la que se usa el calificador /mortalidad.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades humanas y animales para su distribución, factores causantes y características de las enfermedades en poblaciones definidas. Incluye la incidencia, frecuencia, prevalencia y los brotes endémicos y epidémicos; también incluye encuestas y estimaciones de morbilidad en áreas geográficas y en poblaciones específicas. Por último, usado con descriptores geográficos para la localización de aspectos epidemiológicos de una enfermedad. Excluye la mortalidad, para la que se usa el calificador /mortalidad.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças humanas e animais para a sua distribuição, fatores causais e características das doenças em populações definidas. Inclui a incidência, frequência, prevalência, e os surtos endêmicos e epidêmicos; também inclui os levantamentos ou estimativas de morbidade em áreas geográficas e em populações específicas. Por último, usado com descritores geográficos para a localização de aspectos epidemiológicos de uma doença. Exclui mortalidade para o qual existe o qualificador /mortalidade.\"}]', '1973-12-27', '2004-07-13', '1966-01-01', NULL, NULL),
(122, NULL, '2021-06-04 19:30:51.235876', 2, '464', 'QFNS000464', 'Qualifier', 1, 'OG', '[{\"@language\": \"en\", \"@value\": \"organization & administration\"}, {\"@language\": \"es\", \"@value\": \"organización & administración\"}, {\"@language\": \"pt-br\", \"@value\": \"organização & administração\"}, {\"@language\": \"fr\", \"@value\": \"organisation et administration\"}, {\"@language\": \"es-es\", \"@value\": \"organización & administración\"}]', '[\"Q40\",\"Y06\"]', '[\"M0030662\",\"M0030666\",\"M0030665\",\"M0030663\",\"M0030667\",\"M0030664\"]', 'M0030662', 'T061078', '[{\"@language\": \"en\", \"@value\": \"organization and administration\"}, {\"@language\": \"es\", \"@value\": \"organización y administración\"}, {\"@language\": \"pt-br\", \"@value\": \"organização e administração\"}, {\"@language\": \"en\", \"@value\": \"organizational management\"}, {\"@language\": \"es\", \"@value\": \"administración organizacional\"}, {\"@language\": \"pt-br\", \"@value\": \"administração organizacional\"}, {\"@language\": \"en\", \"@value\": \"administrative structure\"}, {\"@language\": \"es\", \"@value\": \"estructura administrativa\"}, {\"@language\": \"pt-br\", \"@value\": \"estructura administrativa\"}, {\"@language\": \"en\", \"@value\": \"organization\"}, {\"@language\": \"es\", \"@value\": \"organización\"}, {\"@language\": \"pt-br\", \"@value\": \"organização\"}, {\"@language\": \"en\", \"@value\": \"organizational structure\"}, {\"@language\": \"es\", \"@value\": \"estructura organizacional\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura organicational\"}, {\"@language\": \"en\", \"@value\": \"administrative management\"}, {\"@language\": \"es\", \"@value\": \"gestión administrativa\"}, {\"@language\": \"pt-br\", \"@value\": \"gestão administrativa\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/OG or OG (SH) or SUBS APPLY OG\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category N2-4 1978-79; I2, L & N2-4 1980-88; G2, I2, L & N2-4 1989; G1-2, I2, N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for administrative structure and management.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les structures et la gestion administratives.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para las estructuras administrativas y la administración.\"}, {\"@language\": \"es\", \"@value\": \"Usado para las estructuras administrativas y la administración.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para as estruturas administrativas e a administração.\"}]', '1977-05-16', '2017-04-11', '1978-01-01', NULL, NULL),
(123, NULL, '2021-06-04 19:30:51.235876', 2, '465', 'QFNS000465', 'Qualifier', 1, 'PS', '[{\"@language\": \"en\", \"@value\": \"parasitology\"}, {\"@language\": \"es\", \"@value\": \"parasitología\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitologia\"}, {\"@language\": \"fr\", \"@value\": \"parasitologie\"}, {\"@language\": \"es-es\", \"@value\": \"parasitología\"}]', '[\"Q35.080\",\"Y05.080\"]', '[\"M0030680\",\"M0030682\",\"M0030679\",\"M0030681\"]', 'M0030677', 'T061093', '[{\"@language\": \"en\", \"@value\": \"protozoology\"}, {\"@language\": \"es\", \"@value\": \"protozoología\"}, {\"@language\": \"pt-br\", \"@value\": \"protozoologia\"}, {\"@language\": \"en\", \"@value\": \"protozoa\"}, {\"@language\": \"es\", \"@value\": \"protozoarios\"}, {\"@language\": \"es\", \"@value\": \"protozoos\"}, {\"@language\": \"pt-br\", \"@value\": \"protozoários\"}, {\"@language\": \"en\", \"@value\": \"helminthology\"}, {\"@language\": \"es\", \"@value\": \"helmintología\"}, {\"@language\": \"pt-br\", \"@value\": \"helmintologia\"}, {\"@language\": \"en\", \"@value\": \"parasites\"}, {\"@language\": \"es\", \"@value\": \"parásitos\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitos\"}, {\"@language\": \"pt-br\", \"@value\": \"parasitas\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for protozoa & higher parasites; see also /microbiology & /virology; see MeSH scope note in Introduction; indexing policy: Manual 19.8.50; DF: /parasitol or /PS\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para protozoos & parásitos superiores; vea también /microbiología & /virología; vea definición; política de indización: Manual 19.8.50\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para protozoários & parasitas superiores; veja também /microbiologia & /virologia; veja definição; política de indexação: Manual 19.8.50\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PS or PS (SH) or SUBS APPLY PS\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category A, B1-2, B6, C & F3 1975-86; A, B1-2, B6, C, F3 & INFANT, NEWBORN+ 1987-89; A, B1-2, B6, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with animals, higher plants, organs, and diseases for parasitic factors. In diseases, it is not used if the parasitic involvement is implicit in the diagnosis.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux animaux, aux végétaux supérieurs, aux organes et aux maladies pour les facteurs parasitaires. Pour les maladies, il n’est pas utilisé quand l\'aspect parasitaire est implicitement exprimé dans le diagnostic.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con animales, plantas superiores, órganos y enfermedades para factores parasitarios. En enfermedades, no usar si la implicación del parásito está implícita en el diagnóstico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con animales, plantas superiores, órganos y enfermedades para factores parasitarios. En enfermedades, no usar si la implicación del parásito está implícita en el diagnóstico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com animais, plantas superiores, órgãos e doenças para fatores parasitários. Em doenças, não usar se o envolvimento parasitário estiver implícito no diagnóstico.\"}]', '1974-10-23', '2015-07-01', '1975-01-01', NULL, NULL),
(124, NULL, '2021-06-04 19:30:51.251500', 2, '466', 'QFNS000466', 'Qualifier', 1, 'PY', '[{\"@language\": \"en\", \"@value\": \"pathogenicity\"}, {\"@language\": \"es\", \"@value\": \"patogenicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"patogenicidade\"}, {\"@language\": \"fr\", \"@value\": \"pathogénicité\"}, {\"@language\": \"es-es\", \"@value\": \"patogenicidad\"}]', '[\"Q42\",\"Y35\"]', '[\"M0030684\",\"M0030685\"]', 'M0030684', 'T061100', '[{\"@language\": \"en\", \"@value\": \"infectivity\"}, {\"@language\": \"es\", \"@value\": \"infectividad\"}, {\"@language\": \"pt-br\", \"@value\": \"infectividade\"}, {\"@language\": \"en\", \"@value\": \"virulence\"}, {\"@language\": \"es\", \"@value\": \"virulencia\"}, {\"@language\": \"pt-br\", \"@value\": \"virulência\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for the potential ability of micro-organisms or parasites to cause disease in man, animal, or plant under specified conditions: not for specific infections; includes virulence; see MeSH scope note in Introduction; indexing policy: Manual 19.8.51; DF: /pathogen or /PY\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para la habilidad en potencial de microorganismos o parasitas en causaren enfermedad en el hombre, animal o vegetal bajo condiciones especificadas; no para infecciones específicas; incluye virulencia; vea definición; política de indización: Manual 19.8.51\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para a habilidade em potencial de microrganismos ou parasitas em causarem doença no homem, animal ou vegetal sob condições especificadas; não para infecções específicas; inclui virulência; veja definição; política de indexação: Manual 19.8.51\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PY or PY (SH) or SUBS APPLY PY\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category B 1966-74; B1 & B3-5 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with microorganisms, viruses, and parasites for studies of their ability to cause disease in man, animals, or plants.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux micro-organismes, aux virus et aux parasites pour les études de leur capacité à provoquer une maladie chez l\'homme, les animaux ou les végétaux.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con microorganismos, virus y parásitos para estudios sobre su capacidad para causar enfermedades en el hombre, animales o plantas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con microorganismos, virus y parásitos para estudios sobre su capacidad para causar enfermedades en el hombre, animales o plantas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com micro-organismos, vírus e parasitos para estudos sobre sua capacidade de causar doenças no homem, animais ou plantas.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(125, NULL, '2021-06-04 19:30:51.267126', 2, '467', 'QFNS000467', 'Qualifier', 1, 'PA', '[{\"@language\": \"en\", \"@value\": \"pathology\"}, {\"@language\": \"es\", \"@value\": \"patología\"}, {\"@language\": \"pt-br\", \"@value\": \"patologia\"}, {\"@language\": \"fr\", \"@value\": \"anatomopathologie\"}, {\"@language\": \"es-es\", \"@value\": \"patología\"}]', '[\"Q10.050\",\"Y02.050\"]', '[\"M0030688\",\"M0030689\",\"M0030687\"]', 'M0030686', 'T061103', '[{\"@language\": \"fr\", \"@value\": \"anatomie pathologique\"}, {\"@language\": \"en\", \"@value\": \"cytopathology\"}, {\"@language\": \"es\", \"@value\": \"citopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"citopatologia\"}, {\"@language\": \"en\", \"@value\": \"histopathology\"}, {\"@language\": \"es\", \"@value\": \"histopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"histopatologia\"}, {\"@language\": \"en\", \"@value\": \"biopsy\"}, {\"@language\": \"es\", \"@value\": \"biopsia\"}, {\"@language\": \"pt-br\", \"@value\": \"biópsia\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for description of tissue or cell structure in disease: not for normal tissue ( = / anatomy & histology) nor for normal cells ( = / cytology); not a synonym for \\\"disease\\\"; includes biopsy; for subcellular pathology use / ultrastruct\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para descripción de estructura de tejido o célula en enfermedad: no para tejido normal ( = /anatomía & histología) ni para células normales ( = /citología); no es un sinónimo para \\\"enfermedad\\\"; incluye biopsia; para patología subcelular use /ultraestructura\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para descrição de estrutura de tecido ou célula em doença: não para tecido normal ( = /anatomia & histologia) nem para células normais ( = /citologia); não é um sinônimo para \\\"doença\\\"; inclui biópsia; para patologia subcelular use /ultraestrutura\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PA or PA (SH) or SUBS APPLY PA\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, C & F 1966-74; A, C & F3 1975-86; A, C, F3 & AGING 1987; A, C, F3, AGING, BRONCHOALVEOLAR LAVAGE FLUID & SMOKING 1988; A, C, F3, AGING & SMOKING+ 1989; A1-11, A13-16, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for organ, tissue, or cell structure in disease states.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la structure des organes, des tissus ou des cellules dans les états pathologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, tejidos o estructuras celulares en condiciones patológicas.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, tejidos o estructuras celulares en condiciones patológicas.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, tecidos ou estruturas celulares em estados patológicos.\"}]', '1973-12-27', '2016-06-15', '1966-01-01', NULL, NULL),
(126, NULL, '2021-06-04 19:30:51.267126', 2, '468', 'QFNS000468', 'Qualifier', 1, 'PK', '[{\"@language\": \"en\", \"@value\": \"pharmacokinetics\"}, {\"@language\": \"es\", \"@value\": \"farmacocinética\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacocinética\"}, {\"@language\": \"fr\", \"@value\": \"pharmacocinétique\"}, {\"@language\": \"es-es\", \"@value\": \"farmacocinética\"}]', '[\"Q45.070\",\"Q50.040.060\",\"Y07.070\",\"Y08.040.060\"]', '[\"M0030701\",\"M0030698\"]', 'M0030695', 'T061112', '[{\"@language\": \"en\", \"@value\": \"toxicokinetics\"}, {\"@language\": \"es\", \"@value\": \"toxicocinética\"}, {\"@language\": \"pt-br\", \"@value\": \"toxicocinética\"}, {\"@language\": \"en\", \"@value\": \"tissue distribution\"}, {\"@language\": \"es\", \"@value\": \"distribución tisular\"}, {\"@language\": \"pt-br\", \"@value\": \"distribuição tecidual\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with exogenous chemicals only; includes \\\"dynamics\\\",\\\"absorption\\\", \\\"distribution\\\", \\\"uptake\\\"; on the extent & rate of metabolism; not for pharmacologic effects or pharmacologic action ( = /pharmacology); see MeSH scope note in Introduction; indexing policy: Manual 19.8.53; DF: /pharmacokin or /PK\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con sustancias exógenas; incluye \\\"dinámica\\\", \\\"absorción\\\", \\\"distribución\\\", \\\"captación\\\"; en la extensión & tasa de metabolismo; no para efectos farmacológicos o acción farmacológica ( = /farmacología); vea definición; política de indexación: Manual de la NLM 19.8.53\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com substâncias exógenas; inclui \\\"dinâmica\\\", \\\"absorção\\\", \\\"distribuição\\\", \\\"captação\\\"; na extensão & taxa de metabolismo; não para efeitos farmacológicos ou ação farmacológica ( = /farmacologia); veja definição; política de indexação: Manual da NLM 19.8.53\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PK or PK (SH) or SUBS APPLY PK; use /metabolism or /ME to search /pharmacokinetics 1966-87\"}]', '[{\"@language\": \"en\", \"@value\": \"88; used with Category D 1988 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the mechanism, dynamics and kinetics of exogenous chemical and drug absorption, biotransformation, distribution, release, transport, uptake and elimination as a function of dosage, extent and rate of metabolic processes.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour le mécanisme, la dynamique et la cinétique de l\'absorption, de la biotransformation, de la distribution, de la libération, du transport, de la capture et de l\'élimination des substances chimiques exogènes et des médicaments, en fonction du dosage, de l\'ampleur et de la vitesse des processus métaboliques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para el mecanismo, dinámica y cinética de la absorción, adsorción, biotransformación, distribución, liberación, transporte, ingestión y eliminación de sustancias exógenas y medicamentos en función de la dosificación, extensión y velocidad de los procesos metabólicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para el mecanismo, dinámica y cinética de la absorción, adsorción, biotransformación, distribución, liberación, transporte, ingestión y eliminación de sustancias exógenas y medicamentos en función de la dosificación, extensión y velocidad de los procesos metabólicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para o mecanismo, dinâmica e cinética da absorção, adsorção, biotransformação, distribuição, dinâmica, liberação, transporte, ingestão e eliminação de substâncias exógenas e medicamentos em função da dosagem, extensão e velocidade de processos metabólicos.\"}]', '1987-04-18', '2015-07-01', '1988-01-01', NULL, NULL),
(127, NULL, '2021-06-04 19:30:51.288813', 2, '469', 'QFNS000469', 'Qualifier', 1, 'PD', '[{\"@language\": \"en\", \"@value\": \"pharmacology\"}, {\"@language\": \"es\", \"@value\": \"farmacología\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacologia\"}, {\"@language\": \"fr\", \"@value\": \"pharmacologie\"}, {\"@language\": \"es-es\", \"@value\": \"farmacología\"}]', '[\"Q45\",\"Y07\"]', '[\"M0030702\",\"M0030704\",\"M0030703\"]', 'M0030702', 'T061119', '[{\"@language\": \"en\", \"@value\": \"mode of action\"}, {\"@language\": \"en\", \"@value\": \"mechanism of action\"}, {\"@language\": \"es\", \"@value\": \"modo de acción\"}, {\"@language\": \"es\", \"@value\": \"mecanismo de acción\"}, {\"@language\": \"pt-br\", \"@value\": \"forma de ação\"}, {\"@language\": \"pt-br\", \"@value\": \"mecanismo de ação\"}, {\"@language\": \"en\", \"@value\": \"pharmacologic action\"}, {\"@language\": \"es\", \"@value\": \"acción farmacológica\"}, {\"@language\": \"pt-br\", \"@value\": \"ação farmacológica\"}, {\"@language\": \"en\", \"@value\": \"pharmacodynamics\"}, {\"@language\": \"es\", \"@value\": \"farmacodinámica\"}, {\"@language\": \"pt-br\", \"@value\": \"farmacodinâmica\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; with exogenous chemicals only; includes \\\"effect\\\", \\\"mechanism of action\\\", \\\"mode of action\\\"; not for pharmacokinetics ( = /pharmacokinetics); see also /adverse effects, /poisoning & /toxicity; see MeSH scope note in Introduction; indexing policy: Manual 19.8.54; DF: /pharmacol or /PD\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente con sustancias químicas exógenas; incluye efecto, mecanismo de acción, modo de acción; no para farmacocinética ( = /farmacocinética); vea también /efectos adversos, /envenenamiento, /toxicidad; vea definición; política de indización: Manual 19.8.54\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente com substâncias químicas exógenas; inclui efeito, mecanismo de ação, modo de ação; não para farmacocinética ( = /farmacocinética); veja também /efeitos adversos, /envenenamento, /toxicidade; veja definição; política de indexação: Manual 19.8.54\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PD or PD (SH) or SUBS APPLY PD; use /pharmacology or /PD to search /pharmacodynamics back thru 1966\"}]', '[{\"@language\": \"en\", \"@value\": \"88; was /pharmacodynamics 1966-87; used with Category D 1966 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs and exogenously administered chemical substances for their effects on living tissues and organisms. It includes acceleration and inhibition of physiological and biochemical processes and other pharmacologic mechanisms of action.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments et aux substances chimiques exogènes pour leurs effets sur les tissus vivants et les organismes. Il comprend l\'accélération et l\'inhibition des processus physiologiques et biochimiques et des mécanismes d\'action pharmacologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con fármacos y sustancias químicas administradas por vía exógena para sus efectos en tejidos vivos y organismos. Incluye la aceleración e inhibición de los procesos fisiológicos y bioquímicos y otros mecanismos de acción farmacológicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con fármacos y sustancias químicas administradas por vía exógena para sus efectos en tejidos vivos y organismos. Incluye la aceleración e inhibición de los procesos fisiológicos y bioquímicos y otros mecanismos de acción farmacológicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fármacos e substâncias químicas administradas por via exógena para seus efeitos em tecidos vivos e organismos. Inclui aceleração e inibição dos processos fisiológicos e bioquímicos e outros mecanismos de ação farmacológicos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(128, NULL, '2021-06-04 19:30:51.288813', 2, '470', 'QFNS000470', 'Qualifier', 1, 'PH', '[{\"@language\": \"en\", \"@value\": \"physiology\"}, {\"@language\": \"es\", \"@value\": \"fisiología\"}, {\"@language\": \"pt-br\", \"@value\": \"fisiologia\"}, {\"@language\": \"fr\", \"@value\": \"physiologie\"}, {\"@language\": \"es-es\", \"@value\": \"fisiología\"}]', '[\"Q50\",\"Y08\"]', '[\"M0030706\"]', 'M0030706', 'T061125', '[{\"@language\": \"en\", \"@value\": \"function\"}, {\"@language\": \"es\", \"@value\": \"función\"}, {\"@language\": \"pt-br\", \"@value\": \"função\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; normal \\\"function\\\" only: for function in disease use /physiopathology; with endogenous chemicals only, for their physiologic role; see MeSH scope note in Introduction; indexing policy: Manual 19.8.55; DF: /physiol or /PH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente función normal: para función en enfermedad use /fisiopatología; solamente con sustancias químicas endógenas, para sus funciones fisiológicas; vea definición; política de indización: Manual 19.8.55\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente função normal: para função em doença use /fisiopatologia; somente com substâncias químicas endógenas, para suas funções fisiológicas; veja definição; política de indexação: Manual 19.8.55\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PH or PH (SH) or SUBS APPLY PH\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, B & G 1966; A, B, D & G 1967-69; A, B & D 1970-74; A, B, D & F1-2 1975-86; A, B, D, F1-2, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987-89; A, B, D8, D11-13, D24, F2 & G4-1 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, tissues, and cells of unicellular and multicellular organisms for normal function. It is used also with biochemical substances, endogenously produced, for their physiologic role.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux tissus et aux cellules des organismes unicellulaires ou pluricellulaires pour leur fonction normale. Il s\'applique également aux substances biochimiques endogènes pour leur rôle physiologique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, tejidos y células de organismos unicelulares y multicelulares para el funcionamiento normal. Usado también con sustancias bioquímicas, producidas endógenamente, para su papel fisiológico.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, tejidos y células de organismos unicelulares y multicelulares para el funcionamiento normal. Usado también con sustancias bioquímicas, producidas endógenamente, para su papel fisiológico.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, tecidos e células de organismos unicelulares e multicelulares para função normal. Usado também com substâncias bioquímicas, produzidas endogenamente, para seu papel fisiológico.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(129, NULL, '2021-06-04 19:30:51.304630', 2, '471', 'QFNS000471', 'Qualifier', 1, 'PP', '[{\"@language\": \"en\", \"@value\": \"physiopathology\"}, {\"@language\": \"es\", \"@value\": \"fisiopatología\"}, {\"@language\": \"pt-br\", \"@value\": \"fisiopatologia\"}, {\"@language\": \"fr\", \"@value\": \"physiopathologie\"}, {\"@language\": \"es-es\", \"@value\": \"fisiopatología\"}]', '[\"Q50.050\",\"Y08.050\"]', '[\"M0030707\"]', 'M0030707', 'T061127', '[{\"@language\": \"en\", \"@value\": \"pathophysiology\"}, {\"@language\": \"en\", \"@value\": \"dysfunction\"}, {\"@language\": \"es\", \"@value\": \"disfunción\"}, {\"@language\": \"es\", \"@value\": \"patofisiología\"}, {\"@language\": \"pt-br\", \"@value\": \"disfunção\"}, {\"@language\": \"pt-br\", \"@value\": \"patofisiologia\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for function of organs in disease states only; not a synonym for \\\"disease\\\"; indexing policy: Manual 19.8.56; DF: /physiopathology or /PP\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para função de órgãos em estados de doença; não um sinônimo para doença; política de indexação: Manual 19.8.56\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para función de órganos en estados de enfermedad; no un sinónimo para enfermedad; política de indización: Manual 19.8.56\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PP or PP (SH) or SUBS APPLY PP\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, C & F 1966-74; A, C & F3 1975-87; A, C, F3 & SMOKING 1988; A, C, F3 & SMOKING+ 1989; A1-10, A13-16, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs and diseases for disordered function in disease states.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes et aux maladies pour les fonctions altérées dans les états pathologiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos y enfermedades para las alteraciones del funcionamiento que ocurren en las enfermedades.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos y enfermedades para las alteraciones del funcionamiento que ocurren en las enfermedades.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos e doenças para as alterações do funcionamento que ocorrem em doenças.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(130, NULL, '2021-06-04 19:30:51.304630', 2, '472', 'QFNS000472', 'Qualifier', 1, 'PO', '[{\"@language\": \"en\", \"@value\": \"poisoning\"}, {\"@language\": \"es\", \"@value\": \"envenenamiento\"}, {\"@language\": \"pt-br\", \"@value\": \"envenenamento\"}, {\"@language\": \"fr\", \"@value\": \"intoxication\"}, {\"@language\": \"es-es\", \"@value\": \"envenenamiento\"}]', '[\"Q45.020.010\",\"Q60.040\",\"Y07.020.010\",\"Y10.040\"]', '[\"M0030709\"]', 'M0030708', 'T061130', '[{\"@language\": \"en\", \"@value\": \"poisonous effects\"}, {\"@language\": \"es\", \"@value\": \"efectos venenosos\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos venenosos\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for clinical & veterinary only; for human & animal experiments use /toxicity; see also /adverse effects &  /toxicity\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para clínica & veterinaria; para experimentos en humanos & animales use /toxicidad; vea también /efectos adversos & /toxicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para clínica & veterinária; para experimentos em humanos & animais use /toxicidade; veja também /efeitos adversos & /toxicidade\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PO or PO (SH) or SUBS APPLY PO\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966-67; D & J 1968 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs, chemicals, and industrial materials for human or animal poisoning, acute or chronic, whether the poisoning is accidental, occupational, suicidal, by medication error, or by environmental exposure.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments, aux substances chimiques et aux matériaux industriels pour une intoxication humaine ou animale, aiguë ou chronique, qu\'elle soit accidentelle, professionnelle, suicidaire, due à une erreur de médication ou à une exposition environnementale.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con medicamentos, compuestos químicos y materiales industriales para envenenamiento humano o animal, agudo o crónico, sea este accidental, ocupacional, suicida, por error de medicación o por exposición ambiental.\"}, {\"@language\": \"es\", \"@value\": \"Usado con medicamentos, compuestos químicos y materiales industriales para envenenamiento humano o animal, agudo o crónico, sea éste accidental, ocupacional, suicida, por error de medicación o por exposición ambiental.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com medicamentos, compostos químicos e materiais industriais para envenenamento humano ou animal, agudo ou crônico, seja este envenenamento acidental, ocupacional, suicida, por erro de medicação ou por exposição ambiental.\"}]', '1973-12-27', '2017-07-05', '1966-01-01', NULL, NULL),
(131, NULL, '2021-06-04 19:30:51.320255', 2, '473', 'QFNS000473', 'Qualifier', 1, 'PC', '[{\"@language\": \"en\", \"@value\": \"prevention & control\"}, {\"@language\": \"es\", \"@value\": \"prevención & control\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção & controle\"}, {\"@language\": \"fr\", \"@value\": \"prévention et contrôle\"}, {\"@language\": \"es-es\", \"@value\": \"prevención & control\"}]', '[\"Q65.040\",\"Y11.040\"]', '[\"M0030715\",\"M0030717\",\"M0030716\"]', 'M0030715', 'T061137', '[{\"@language\": \"en\", \"@value\": \"prophylaxis\"}, {\"@language\": \"en\", \"@value\": \"preventive therapy\"}, {\"@language\": \"en\", \"@value\": \"prevention and control\"}, {\"@language\": \"en\", \"@value\": \"preventive measures\"}, {\"@language\": \"es\", \"@value\": \"prevención y control\"}, {\"@language\": \"es\", \"@value\": \"terapia preventiva\"}, {\"@language\": \"es\", \"@value\": \"profilaxis\"}, {\"@language\": \"es\", \"@value\": \"medidas preventivas\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção e controle\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção & controlo\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção e controlo\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia preventiva\"}, {\"@language\": \"pt-br\", \"@value\": \"profilaxia\"}, {\"@language\": \"pt-br\", \"@value\": \"medidas preventivas\"}, {\"@language\": \"en\", \"@value\": \"prevention\"}, {\"@language\": \"es\", \"@value\": \"prevención\"}, {\"@language\": \"pt-br\", \"@value\": \"prevenção\"}, {\"@language\": \"en\", \"@value\": \"control\"}, {\"@language\": \"es\", \"@value\": \"control\"}, {\"@language\": \"pt-br\", \"@value\": \"controle\"}, {\"@language\": \"pt-br\", \"@value\": \"controlo\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; includes \\\"preventive therapy\\\"; includes vaccination; for prevention on epidemiologic or personal level; CATALOGER: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"terapia preventiva\\\"; incluye vacunación; para prevención a nivel epidemiológico o personal; vea definición; regla de indización: Manual de la NLM 19.8.58\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"terapia preventiva\\\"; inclui vacinação; para prevenção a nível epidemiológico ou pessoal; veja definição; regra de indexação: Manual da NLM 19.8.58\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PC or PC (SH) or SUBS APPLY PC\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-67; C, F & G 1968-74; C, F1, F3, G3 & I1 1975-89; C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for increasing human or animal resistance against disease (e.g., immunization), for control of transmission agents, for prevention and control of environmental hazards, or for prevention and control of social factors leading to disease. It includes preventive measures in individual cases.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour l\'augmentation de la résistance humaine ou animale à ces maladies (par exemple, par immunisation), pour le contrôle des agents de transmission, ainsi que pour la prévention et le contrôle des risques environnementaux et des facteurs sociaux pathogènes. Il comprend les mesures préventives prises dans les cas individuels.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores de enfermedades para el aumento de la resistencia humana o animal contra las enfermedades (como, por ejemplo, la inmunización), para el control de agentes transmisores, para la prevención y control de daños ambientales o de factores sociales que conduzcan a la enfermedad. Incluye medidas preventivas en casos individuales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores de enfermedades para el aumento de la resistencia humana o animal contra las enfermedades (como, por ejemplo, la inmunización), para el control de agentes transmisores, para la prevención y control de daños ambientales o de factores sociales que conduzcan a la enfermedad. Incluye medidas preventivas en casos individuales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores de doenças para o aumento da resistência humana ou animal contra as doenças (como, por exemplo, a imunização), para o controle de agentes transmissores, para a prevenção e controle de danos ambientais ou de fatores sociais que conduzam à doença. Inclui medidas preventivas em casos individuais.\"}]', '1973-12-27', '2017-04-11', '1996-01-01', NULL, NULL);
