(132, NULL, '2021-06-04 19:30:51.335850', 2, '474', 'QFNS000474', 'Qualifier', 1, 'PX', '[{\"@language\": \"en\", \"@value\": \"psychology\"}, {\"@language\": \"es\", \"@value\": \"psicología\"}, {\"@language\": \"pt-br\", \"@value\": \"psicologia\"}, {\"@language\": \"fr\", \"@value\": \"psychologie\"}, {\"@language\": \"es-es\", \"@value\": \"psicología\"}]', '[\"Q52\",\"Y37\"]', '[\"M0030721\",\"M0030722\",\"M0030727\",\"M0030724\",\"M0030725\",\"M0030726\",\"M0030720\",\"M0030723\"]', 'M0030719', 'T061144', '[{\"@language\": \"es\", \"@value\": \"aspectos psicológicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicológicos\"}, {\"@language\": \"en\", \"@value\": \"cognitive aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos cognitivos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos cognitivos\"}, {\"@language\": \"en\", \"@value\": \"emotional aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos emocionales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos emocionais\"}, {\"@language\": \"en\", \"@value\": \"psychosomatic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicosomáticos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicossomáticos\"}, {\"@language\": \"en\", \"@value\": \"psychiatric aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psiquiátricos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psiquiátricos\"}, {\"@language\": \"en\", \"@value\": \"psychogenic aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicogénicos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicogênicos\"}, {\"@language\": \"en\", \"@value\": \"psychosocial aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos psicosociales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos psicossociais\"}, {\"@language\": \"en\", \"@value\": \"affective aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos afectivos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos afetivos\"}, {\"@language\": \"en\", \"@value\": \"mental aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos mentales\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos mentais\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"psychiatric\\\", \\\"psychosomatic\\\", \\\"psychogenic\\\", \\\"emotional\\\", \\\"affective\\\", \\\"behavioral\\\"; see MeSH scope note in Introduction; indexing policy: Manual 19.8.59; DF: /psychol or /PX\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye psiquiátrico, psicosomático, psicogénico, emocional, afectivo, conducta; vea definición; política de indización: Manual 19.8.59\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui psiquiátrico, psicossomático, psicogênico, emocional, afetivo, comportamental; veja definição; política de indexação: Manual 19.8.59\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/PX or PX (SH) or SUBS APPLY PX\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category C, E1-6 & F3 1978-79; C, E1-6, F3 & M 1980-86; C, E1-6, F3, M, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, PREGNANCY+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; C, E1-6, F3, M, AGING, ALCOHOL DRINKING, CLIMACTERIC+, FOOD HABITS, HOMOSEXUALITY, PREGNANCY+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; B2, C, E1-6, F3, I3 & M 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with non-psychiatric diseases, techniques, and named groups for psychologic, psychiatric, psychosomatic, psychosocial, behavioral, and emotional aspects, and with psychiatric disease for psychologic aspects; used also with animal terms for animal behavior and psychology.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies non psychiatriques, aux techniques et aux groupes de personnes pour les aspects psychologiques, psychiatriques, psychosomatiques, psychosociaux, comportementaux et émotionnels, ainsi qu\'aux maladies psychiatriques pour les aspects psychologiques. Il s\'applique également aux animaux pour leur comportement et leur psychologie.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades no psiquiátricas, técnicas y denominación de grupos para aspectos psicológicos, psiquiátricos, psicosomáticos, psicosociales, conductuales y emocionales, y con enfermedades psiquiátricas para aspectos psicológicos. Usado también con descriptores animales para el comportamiento y la psicología de los animales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades no psiquiátricas, técnicas y personas para aspectos psicológicos, psiquiátricos, psicosomáticos, psicosociales, conductuales y emocionales, y con enfermedades psiquiátricas para aspectos psicológicos. Usado también con descriptores animales para el comportamiento y la psicología de los animales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças não psiquiátricas, técnicas e [grupos de] pessoas para aspectos psicológicos, psiquiátricos, psicossomáticos, psicossociais, comportamentais e emocionais, e com doenças psiquiátricas para aspectos psicológicos. Usado também com descritores animais para o comportamento e a psicologia dos animais.\"}]', '1977-05-16', '2003-07-24', '1978-01-01', NULL, NULL),
(133, NULL, '2021-06-04 19:30:51.351507', 2, '475', 'QFNS000475', 'Qualifier', 1, 'RE', '[{\"@language\": \"en\", \"@value\": \"radiation effects\"}, {\"@language\": \"es\", \"@value\": \"efectos de la radiación\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos da radiação\"}, {\"@language\": \"fr\", \"@value\": \"effets des radiations\"}, {\"@language\": \"es-es\", \"@value\": \"efectos de la radiación\"}]', '[\"Q53\",\"Y39\"]', NULL, 'M0030732', 'T061157', '[{\"@language\": \"es\", \"@value\": \"efectos de radiación\"}, {\"@language\": \"es\", \"@value\": \"efectos de las radiaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos de radiação\"}, {\"@language\": \"pt-br\", \"@value\": \"efeitos das radiações\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes ionizing & non-ionizing radiation; not for therapeutic effect of radiations ( = /radiotherapy); see MeSH scope note in Introduction; indexing policy: Manual 19.8.60; DF: /rad eff or /RE\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye radiación ionizante & no ionizante; no para efecto terapéutico de la radiación ( = /radioterapía); vea definición; política de indización: Manual 19.8.60\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui radiação ionizante & não ionizante; não para efeito terapêutico da radiação ( = /radioterapia); veja definição; política de indexação: Manual 19.8.60\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RE or RE (SH) or SUBS APPLY RE\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, B & G 1966-67; A, B, D & G 1968-74; A, B, D, F1-2, G4-12 & J 1975-84; A, B1, B3-6, D, F1-2, G4-12 & J 1985 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for effects of ionizing and nonionizing radiation upon living organisms, organs and tissues, and their constituents, and upon physiologic processes. It includes the effect of irradiation on drugs and chemicals.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les effets des radiations ionisantes ou non ionisantes sur les organismes vivants, les organes, les tissus et leurs constituants, ainsi que sur les processus physiologiques. Il inclut les effets de l\'irradiation sur les médicaments et les substances chimiques.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para los efectos de la radiación ionizante y no ionizante en organismos vivos, órganos, tejidos y sus componentes y en sus procesos fisiológicos. Incluye el efecto de la irradiación en fármacos y compuestos químicos.\"}, {\"@language\": \"es\", \"@value\": \"Usado para los efectos de la radiación ionizante y no ionizante en organismos vivos, órganos, tejidos y sus componentes y en sus procesos fisiológicos. Incluye el efecto de la irradiación en fármacos y compuestos químicos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para os efeitos das radiações ionizantes e não ionizantes sobre organismos vivos, órgãos, tecidos e seus componentes e sobre processos fisiológicos. Inclui os efeitos de irradiação sobre fármacos e compostos químicos.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(134, NULL, '2021-06-04 19:30:51.351507', 2, '476', 'QFNS000476', 'Qualifier', 1, 'RT', '[{\"@language\": \"en\", \"@value\": \"radiotherapy\"}, {\"@language\": \"es\", \"@value\": \"radioterapia\"}, {\"@language\": \"pt-br\", \"@value\": \"radioterapia\"}, {\"@language\": \"fr\", \"@value\": \"radiothérapie\"}, {\"@language\": \"es-es\", \"@value\": \"radioterapia\"}]', '[\"Q65.050\",\"Y11.050\"]', '[\"M0030735\",\"M0030736\",\"M0030737\"]', 'M0030735', 'T061165', '[{\"@language\": \"en\", \"@value\": \"radiation therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por radiación\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por radiação\"}, {\"@language\": \"en\", \"@value\": \"X-ray therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por rayos X\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por raios X\"}, {\"@language\": \"en\", \"@value\": \"radioisotope therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia por radioisótopos\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia por radioisótopos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes x-ray, radioisotope, other ionizing radiation & non-ionizing radiation; indexing policy: Manual 19.8.63; DF: /radiother or /RT\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye rayo x, radioisótopo, otra radiacion ionizante & radiacion no ionizante; política de indización: Manual de la NLM 19.8.63\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui raio x, radioisótopo, outra radiação ionizante & radiação não ionizante; política de indexação: Manual da NLM 19.8.63\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RT or RT (SH) or SUBS APPLY RT\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C 1975 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with disease headings for the therapeutic use of ionizing and nonionizing radiation. It includes the use of radioisotope therapy.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour l\'utilisation de radiations ionisantes ou non ionisantes dans un but thérapeutique. Il inclut les traitements par radio-isotopes.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para el uso terapéutico de la radiación ionizante y no ionizante. Incluye el uso de tratamiento con radioisótopos.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para el uso terapéutico de la radiación ionizante y no ionizante. Incluye el uso de tratamiento con radioisótopos.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para o uso terapêutico da radiação ionizante e não ionizante. Inclui o uso de terapia com radioisótopos.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(135, NULL, '2021-06-04 19:30:51.367153', 2, '477', 'QFNS000477', 'Qualifier', 1, 'RH', '[{\"@language\": \"en\", \"@value\": \"rehabilitation\"}, {\"@language\": \"es\", \"@value\": \"rehabilitación\"}, {\"@language\": \"pt-br\", \"@value\": \"reabilitação\"}, {\"@language\": \"fr\", \"@value\": \"rééducation et réadaptation\"}, {\"@language\": \"es-es\", \"@value\": \"rehabilitación\"}]', '[\"Q65.060\",\"Y11.060\"]', NULL, 'M0030738', 'T061169', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for restoration of patient to pre-disease or pre-therapy state; for \\\"re-education\\\" in French; indexing policy: Manual 19.8.64; DF: /rehabil or /RH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para restablecimiento de paciente al estado de preenfermedad o preterapia; para reeducación en francés; política de indización: Manual 19.8.64\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para restabelecimento de paciente ao estado de pré-doença ou pré-terapia; para reeducação em francês; política de indexação: Manual 19.8.64\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/RH or RH (SH) or SUBS APPLY RH\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C & F 1967-74; C & F3 1975-79; C, E4 & F3 1980-89; C1-21, C23, E4 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases and surgical procedures for restoration of function of the individual.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies et aux procédures chirurgicales pour la récupération d\'une fonction chez un individu.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades y procedimientos quirúrgicos para la restauración de las funciones del individuo.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades y procedimientos quirúrgicos para la restauración de las funciones del individuo.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças e procedimentos cirúrgicos para restauração das funções do indivíduo.\"}]', '1973-12-27', '2003-07-22', '1967-01-01', NULL, NULL),
(136, NULL, '2021-06-04 19:30:51.382752', 2, '478', 'QFNS000478', 'Qualifier', 1, 'SC', '[{\"@language\": \"en\", \"@value\": \"secondary\"}, {\"@language\": \"es\", \"@value\": \"secundario\"}, {\"@language\": \"pt-br\", \"@value\": \"secundário\"}, {\"@language\": \"fr\", \"@value\": \"secondaire\"}, {\"@language\": \"es-es\", \"@value\": \"secundario\"}]', '[\"Q35.020.010\",\"Y05.020.010\"]', '[\"M0030758\"]', 'M0030758', 'T061190', '[{\"@language\": \"en\", \"@value\": \"metastatic\"}, {\"@language\": \"es\", \"@value\": \"metastático\"}, {\"@language\": \"pt-br\", \"@value\": \"metastático\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for cancer only; use with organ/neopl precoords & with histol types; use with the secondary organ/neopl precoord & secondary histol type, but not for a primary cancer metastasizing to a secondary site ( = /pathology + NEOPLASM METASTASIS); see MeSH scope note in Introduction; indexing policy: Manual 19.8.65, 24.3.1; DF: /second or /SC\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para cáncer; use con precoords neoplasia/órganos & con tipos histológicos; use con el precod neoplasia/órgano secundario & tipo histológico secundario, pero no para un cáncer metastático primario a un sitio secundario ( = /patología + METÁSTASIS DE LA NEOPLASIA); vea definición; política de indización: Manual 19.8.65\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para câncer; use com precoords neoplasia/órgãos & com tipos histológicos; use com o precod neoplasia/órgão secundário & tipo histológico secundário, mas não para um câncer metastático primário a uma localização secundária ( = /patologia + METASTASE NEOPLÁSICA); veja definição; política de indexação: Manual 19.8.65\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/SC or SC (SH) or SUBS APPLY SC\"}]', '[{\"@language\": \"en\", \"@value\": \"80; used with Category C4 1980 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with neoplasms to indicate the secondary location to which the neoplastic process has metastasized.\"}, {\"@language\": \"fr\", \"@value\": \"S’applique aux tumeurs pour désigner les localisations secondaires résultant du processus métastatique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con neoplasias para indicar la localización secundaria en la cual el proceso neoplásico se ha metastatizado.\"}, {\"@language\": \"es\", \"@value\": \"Usado con neoplasias para indicar la localización secundaria en la cual el proceso neoplásico se ha metastatizado.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com neoplasias para indicar localização secundária na qual o processo neoplásico foi metastatizado.\"}]', '1979-05-24', '2003-07-22', '1980-01-01', NULL, NULL),
(137, NULL, '2021-06-04 19:30:51.388803', 2, '479', 'QFNS000479', 'Qualifier', 1, 'ST', '[{\"@language\": \"en\", \"@value\": \"standards\"}, {\"@language\": \"es\", \"@value\": \"normas\"}, {\"@language\": \"pt-br\", \"@value\": \"normas\"}, {\"@language\": \"fr\", \"@value\": \"normes\"}, {\"@language\": \"es-es\", \"@value\": \"normas\"}]', '[\"Q40.040\",\"Y06.040\"]', '[\"M0030790\",\"M0030791\"]', 'M0030789', 'T061227', '[{\"@language\": \"en\", \"@value\": \"guidelines\"}, {\"@language\": \"es\", \"@value\": \"pautas\"}, {\"@language\": \"pt-br\", \"@value\": \"diretrizes\"}, {\"@language\": \"pt-br\", \"@value\": \"praxe\"}, {\"@language\": \"en\", \"@value\": \"observance\"}, {\"@language\": \"en\", \"@value\": \"criteria\"}, {\"@language\": \"es\", \"@value\": \"criterios\"}, {\"@language\": \"es\", \"@value\": \"criterio\"}, {\"@language\": \"pt-br\", \"@value\": \"critérios\"}, {\"@language\": \"pt-br\", \"@value\": \"critério\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for standards in testing & performance of programs & procedures; with drugs for standards in assay techniques, quality & potency; see MeSH scope note in Introduction; indexing policy: Manual 19.8.67; DF: /stand or /ST      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para normas en pruebas & rendimiento de programas & procedimientos; con fármacos para normas en técnicas de ensayo, calidad & potencia; vea definición; política de indización: Manual 19.8.67\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para normas em testes & desempenho de programas & procedimentos; com fármacos para normas em técnicas de ensaio, qualidade & potência; veja definição; política de indexação: Manual 19.8.67\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/ST or ST (SH) or SUBS APPLY ST\"}]', '[{\"@language\": \"en\", \"@value\": \"68; used with Category D, E, H-J, L & N 1968; D-F, H-J, L & N 1969-74; D, E, F4, G1-3, H-J, L & N 1975-89; D, E, F4, G1-2, I2-3, J & N2 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with facilities, personnel, and program headings for the development, testing, and application of standards of adequacy or acceptable performance and with chemicals and drugs for standards of identification, quality, and potency. It includes health or safety standards in industries and occupations.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux installations, au personnel et aux programmes pour le développement, l’évaluation ou l\'application des normes de conformité ou de performance. Il s\'applique aussi aux substances chimiques et aux médicaments pour les normes d\'identification, de qualité ou d\'efficacité. Il inclut les normes sanitaires et les normes de sécurité dans les industries et les milieux professionnels.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores de instalaciones, personal y programas para el desarrollo, prueba y aplicación de normas de adecuación o rendimiento aceptable, y con sustancias químicas y fármacos para normas de identificación, calidad y potencia. Incluye las normas de salud y seguridad en industrias y profesiones.\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores de instalaciones, personal y programas para el desarrollo, prueba y aplicación de normas de adecuación o rendimiento aceptable, y con sustancias químicas y fármacos para normas de identificación, calidad y potencia. Incluye las normas de salud y seguridad en industrias y profesiones.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores de instalações, pessoal e programas para o desenvolvimento, teste e aplicação de padrões de adequação ou desempenho aceitável e com substâncias químicas e fármacos para padrões de identificação, qualidade e potência. Inclui normas de saúde e segurança em indústrias e ocupações.\"}]', '1973-12-27', '2003-07-24', '1968-01-01', NULL, NULL),
(138, NULL, '2021-06-04 19:30:51.388803', 2, '480', 'QFNS000480', 'Qualifier', 1, 'SD', '[{\"@language\": \"en\", \"@value\": \"supply & distribution\"}, {\"@language\": \"es\", \"@value\": \"provisión & distribución\"}, {\"@language\": \"pt-br\", \"@value\": \"provisão & distribução\"}, {\"@language\": \"fr\", \"@value\": \"ressources et distribution\"}, {\"@language\": \"es-es\", \"@value\": \"provisión & distribución\"}]', '[\"Q40.050\",\"Q55.020\",\"Y06.050\",\"Y09.020\"]', '[\"M0030793\",\"M0030794\",\"M0030795\"]', 'M0030793', 'T061231', '[{\"@language\": \"en\", \"@value\": \"supply and distribution\"}, {\"@language\": \"es\", \"@value\": \"provisión y distribución\"}, {\"@language\": \"pt-br\", \"@value\": \"provisão e distribuição\"}, {\"@language\": \"pt-br\", \"@value\": \"fornecimento & distribução\"}, {\"@language\": \"pt-br\", \"@value\": \"suprimento & distribução\"}, {\"@language\": \"en\", \"@value\": \"supply\"}, {\"@language\": \"es\", \"@value\": \"provisión\"}, {\"@language\": \"pt-br\", \"@value\": \"provisão\"}, {\"@language\": \"pt-br\", \"@value\": \"fornecimento\"}, {\"@language\": \"pt-br\", \"@value\": \"suprimento\"}, {\"@language\": \"en\", \"@value\": \"distribution\"}, {\"@language\": \"es\", \"@value\": \"distribución\"}, {\"@language\": \"pt-br\", \"@value\": \"distribuição\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; includes \\\"availability\\\"; for personnel, services & facilities; for drugs; not for food ( = FOOD SUPPLY) nor for water ( = WATER SUPPLY); CATALOGER: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"disponibilidad\\\"; para personal, servicios & instalaciones; para drogas; no para alimento ( = ABASTECIMIENTO DE ALIMENTOS); no para agua ( = ABASTECIMIENTO DE AGUA); vea definición; regla de indización: Manual de la NLM 19.8.69\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"disponibilidade\\\"; para pessoal, serviços & instalações; para drogas; não para alimento ( = ABASTECIMENTO DE ALIMENTOS); não para água ( = ABASTECIMENTO DE ÁGUA); veja definição; regra de indexação; Manual da NLM 19.8.69\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/SD or SD (SH) or SUBS APPLY SD\"}]', '[{\"@language\": \"en\", \"@value\": \"68; used with Category D, E, L & N 1968-74; D, E, F4, H-J, L & N2-4 1975-87; D, E, F4, H-J, L & N 1988; D, E, F4, G1-3 & H-J 1989; D, E7, J & N2 1990 forward; M 1994\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the quantitative availability and distribution of material, equipment, health services, personnel, and facilities. It excludes food supply and water supply in industries and occupations.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la disponibilité et la distribution de matériel et d\'équipement, ainsi que de services, de personnel et d\'installations sanitaires. Il exclut l\'approvisionnement en nourriture et en eau dans les industries et les milieux professionnels.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la disponibilidad cuantitativa y la distribución de material, equipamiento, servicios de salud e instalaciones. Excluye provisión de alimentos y abastecimiento de agua en industrias y otros servicios.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la disponibilidad cuantitativa y la distribución de material, equipamiento, servicios de salud e instalaciones. Excluye provisión de alimentos y abastecimiento de agua en industrias y otros servicios.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a disponibilidade quantitativa e a distribuição de materiais, equipamentos, serviços de saúde e instalações. Exclui a provisão de alimentos e o abastecimento de água em indústrias e outros serviços.\"}]', '1973-12-27', '2017-04-11', '1968-01-01', NULL, NULL),
(139, NULL, '2021-06-04 19:30:51.404627', 2, '481', 'QFNS000481', 'Qualifier', 1, 'SU', '[{\"@language\": \"en\", \"@value\": \"surgery\"}, {\"@language\": \"es\", \"@value\": \"cirugía\"}, {\"@language\": \"pt-br\", \"@value\": \"cirurgia\"}, {\"@language\": \"fr\", \"@value\": \"chirurgie\"}, {\"@language\": \"es-es\", \"@value\": \"cirugía\"}]', '[\"Q65.070\",\"Y11.070\"]', '[\"M0030796\",\"M0030800\",\"M0030799\",\"M0030797\",\"M0030798\"]', 'M0030796', 'T061234', '[{\"@language\": \"en\", \"@value\": \"operative therapy\"}, {\"@language\": \"en\", \"@value\": \"operative procedures\"}, {\"@language\": \"en\", \"@value\": \"invasive procedures\"}, {\"@language\": \"en\", \"@value\": \"operations\"}, {\"@language\": \"es\", \"@value\": \"terapia operatoria\"}, {\"@language\": \"es\", \"@value\": \"procedimientos operatorios\"}, {\"@language\": \"es\", \"@value\": \"procedimientos invasivos\"}, {\"@language\": \"es\", \"@value\": \"operaciones\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia operatória\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos operatórios\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos invasivos\"}, {\"@language\": \"pt-br\", \"@value\": \"operações\"}, {\"@language\": \"en\", \"@value\": \"peroperative procedures\"}, {\"@language\": \"es\", \"@value\": \"procedimientos peroperatorios\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos peroperatórios\"}, {\"@language\": \"en\", \"@value\": \"perioperative procedures\"}, {\"@language\": \"es\", \"@value\": \"procedimientos perioperatorios\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos perioperatórios\"}, {\"@language\": \"en\", \"@value\": \"preoperative procedures\"}, {\"@language\": \"es\", \"@value\": \"procedimientos preoperatorios\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos pré-operatórios\"}, {\"@language\": \"en\", \"@value\": \"intraoperative procedures\"}, {\"@language\": \"es\", \"@value\": \"procedimientos intraoperatorios\"}, {\"@language\": \"pt-br\", \"@value\": \"procedimentos intraoperatórios\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"operation\\\", \\\"surgical therapy\\\"; for tissue section or coagulation by laser; not for transplantation ( = /transplantation); indexing policy: Manual 19.8.70; DF: /surg or /SU\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"operación\\\", \\\"terapia quirúrgica\\\"; para sección de tejido o coagulación por laser; no para trasplante ( = /trasplante); regla de indización: Manual de la NLM 19.8.70\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"operação\\\", \\\"terapia cirúrgica\\\"; para secção de tecido ou coagulação por laser; não para transplante ( = /transplante); regra de indexação: Manual da NLM 19.8.70\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/SU or SU (SH) or SUBS APPLY SU\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A, C & F 1966-74; A, C & F3 1975; A, B2, C & F3 1976-89; A1-10, A13-14, A16, B2, C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for operative procedures on organs, regions, or tissues in the treatment of diseases, including tissue section by lasers. It excludes transplantation, for which \\\"transplantation\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les actes chirurgicaux pratiqués dans un but thérapeutique sur les organes, les régions anatomiques ou les tissus, y compris la section tissulaire par laser. Il exclut la transplantation, pour laquelle le qualificatif \'transplantation\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para procedimientos quirúrgicos en órganos, regiones o tejidos en el tratamiento de enfermedades, incluida la sección de tejidos por láser. Excluye el trasplante, para el que se utiliza el calificador /trasplante.\"}, {\"@language\": \"es\", \"@value\": \"Usado para procedimientos quirúrgicos en órganos, regiones o tejidos en el tratamiento de enfermedades, incluida la sección de tejidos por láser. Excluye el trasplante, para el que se utiliza el calificador /trasplante.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com procedimentos cirúrgicos em órgãos, regiões ou tecidos no tratamento de doenças, incluindo seccionamento de tecidos com lasers. Exclui o transplante para o qual é usado o qualificador /transplante.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(140, NULL, '2021-06-04 19:30:51.420254', 2, '482', 'QFNS000482', 'Qualifier', 1, 'TU', '[{\"@language\": \"en\", \"@value\": \"therapeutic use\"}, {\"@language\": \"es\", \"@value\": \"uso terapéutico\"}, {\"@language\": \"es\", \"@value\": \"indicación terapéutica\"}, {\"@language\": \"pt-br\", \"@value\": \"uso terapêutico\"}, {\"@language\": \"pt-br\", \"@value\": \"indicação terapêutica\"}, {\"@language\": \"fr\", \"@value\": \"usage thérapeutique\"}, {\"@language\": \"es-es\", \"@value\": \"uso terapéutico\"}]', '[\"Q60\",\"Y10\"]', NULL, 'M0030820', 'T061267', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for treatment or preventive use of drugs or physical agents in clinical or experimental human or animal disease; indexing policy: Manual 19.8.71; DF: /ther use or /TU\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para tratamiento o uso preventivo de drogas o agentes físicos en enfermedades clínicas o experimentales en humanos o animales; política de indización: Manual 19.8.71\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para tratamento ou uso preventivo de drogas ou agentes físicos em doenças clínicas ou experimentais em humanos ou animais; política de indexação: Manual 19.8.71\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TU or TU (SH) or SUBS APPLY TU\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966; D & H 1967-89; D 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs, biological preparations, and physical agents for their use in the prophylaxis and treatment of disease. It includes veterinary use.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments, aux préparations biologiques et aux agents physiques pour leur utilisation dans la prévention et le traitement des maladies. Il inclut l’utilisation vétérinaire.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con fármacos, preparaciones biológicas y agentes físicos para su uso en la profilaxis y tratamiento de las enfermedades. Incluye el uso veterinario y experimental en animales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con fármacos, preparaciones biológicas y agentes físicos para su uso en la profilaxis y tratamiento de las enfermedades. Incluye el uso veterinario y experimental en animales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fármacos, preparações biológicas e agentes físicos para seu uso na profilaxia e tratamento das doenças. Inclui o uso veterinário e experimental em animais.\"}]', '1973-12-27', '2004-07-13', '1966-01-01', NULL, NULL),
(141, NULL, '2021-06-04 19:30:51.435873', 2, '483', 'QFNS000483', 'Qualifier', 1, 'TH', '[{\"@language\": \"en\", \"@value\": \"therapy\"}, {\"@language\": \"es\", \"@value\": \"terapia\"}, {\"@language\": \"pt-br\", \"@value\": \"terapia\"}, {\"@language\": \"fr\", \"@value\": \"thérapie\"}, {\"@language\": \"es-es\", \"@value\": \"terapia\"}]', '[\"Q65\",\"Y11\"]', '[\"M0030821\"]', 'M0030821', 'T061268', '[{\"@language\": \"en\", \"@value\": \"treatment\"}, {\"@language\": \"en\", \"@value\": \"disease management\"}, {\"@language\": \"es\", \"@value\": \"tratamiento\"}, {\"@language\": \"es\", \"@value\": \"manejo de la enfermedad\"}, {\"@language\": \"pt-br\", \"@value\": \"tratamento\"}, {\"@language\": \"pt-br\", \"@value\": \"gerenciamento da doença\"}, {\"@language\": \"fr\", \"@value\": \"traitement\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for general or unspecified therapy & multiple therapies; for tissue therapy & therapy with biological products; not for drug therapy ( =/drug therapy), nor for diet therapy ( = /diet therapy), nor for surgical therapy ( = /surgery), nor for radiotherapy ( = /radiotherapy), nor for rehabilitative therapy ( = /rehabilitation); indexing policy: Manual 19.8.72; DF: /ther or /TH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para terapias generales o no especificadas & terapias múltiples; para terapia en tejido & terapia con productos biológicos; no para terapia o tratamiento con fármacos ( = /tratamiento farmacológico) ni para dietoterapia ( = /dietoterapia), no para tratamiento quirúrgico ( = /cirugía) ni para radioterapia ( = /radioterapia) ni para terapia de rehabilitación ( = /rehabilitación); política de indización: Manual 19.8.72\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para terapias gerais ou não especificadas & terapias múltiplas; para terapia em tecido & terapia com produtos biológicos; não para terapia ou tratamento com fármacos ( = /tratamento farmacológico) nem para dietoterapia ( = /dietoterapia), não para terapia cirúrgica ( = /cirurgia) nem para radioterapia ( = /radioterapia) nem para terapia de reabilitação ( = /reabilitação); política de indexação: Manual 19.8.72\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TH or TH (SH) or SUBS APPLY TH\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C & F 1966-74; C & F3 1975-87; C, F3 & SMOKING 1988; C, F3 & SMOKING+ 1989; C & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for therapeutic interventions except drug therapy, diet therapy, radiotherapy, and surgery, for which specific subheadings exist. The concept is also used for articles and books dealing with multiple therapies.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les traitements autres que le traitement médicamenteux, la diétothérapie, la radiothérapie et la chirurgie, pour lesquels il existe des qualificatifs spécifiques. Il s\'emploie aussi pour les articles et les ouvrages concernant les thérapies multiples.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para intervenciones terapéuticas excepto cirugía, dietoterapia, farmacoterapia, y radioterapia, para los cuales existen calificadores específicos. El concepto también se usa para artículos y libros que se refieren a múltiples terapias.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para intervenciones terapéuticas excepto cirugía, dietoterapia, farmacoterapia, y radioterapia, para los cuales existen calificadores específicos. El concepto también se usa para artículos y libros que se refieren a múltiples terapias.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para intervenções terapêuticas, exceto cirurgia, dietoterapia, farmacoterapia e radioterapia, para as quais existem qualificadores específicos. Usado também para terapias múltiplas.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(142, NULL, '2021-06-04 19:30:51.435873', 2, '484', 'QFNS000484', 'Qualifier', 1, 'TO', '[{\"@language\": \"en\", \"@value\": \"toxicity\"}, {\"@language\": \"es\", \"@value\": \"toxicidad\"}, {\"@language\": \"pt-br\", \"@value\": \"toxicidade\"}, {\"@language\": \"fr\", \"@value\": \"toxicité\"}, {\"@language\": \"es-es\", \"@value\": \"toxicidad\"}]', '[\"Q45.020.020\",\"Y07.020.020\"]', '[\"M0030827\",\"M0030826\"]', 'M0030825', 'T061274', '[{\"@language\": \"en\", \"@value\": \"toxic potential\"}, {\"@language\": \"es\", \"@value\": \"potencial tóxico\"}, {\"@language\": \"pt-br\", \"@value\": \"potencial tóxico\"}, {\"@language\": \"en\", \"@value\": \"margin of safety\"}, {\"@language\": \"es\", \"@value\": \"margen de seguridad\"}, {\"@language\": \"pt-br\", \"@value\": \"margem de segurança\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for experimental human & animal studies; includes margin of safety & experimental exposure to environmental agents; see also /adverse effects &  /poisoning\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para estudios experimentales en seres humanos & animales; incluye margen de seguridad & exposición experimental a agentes ambientales; vea también /efectos adversos & /envenenamiento\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para estudos experimentais em seres humanos & animais; inclui margem de segurança & exposição experimental a agentes ambientais; veja também /efeitos adversos & /envenenamento\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TO or TO (SH) or SUBS APPLY TO\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category D 1966-67; D & J 1968 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with drugs and chemicals for experimental human and animal studies of their ill effects. It includes studies to determine the margin of safety or the reactions accompanying administration at various dose levels. It is used also for exposure to environmental agents. Poisoning should be considered for life-threatening exposure to environmental agents.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux médicaments et aux substances chimiques pour les études expérimentales de leurs effets néfastes chez l\'homme et l\'animal. Il inclut les études de détermination des marges de sécurité ou des réactions accompagnant leur administration à différentes doses. Il s’emploie aussi pour l\'exposition aux agents environnementaux. Pour une exposition aux agents environnementaux entraînant un risque vital, le qualificatif \'intoxication\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con fármacos y sustancias químicas en estudios experimentales humanos o animales sobre sus efectos patógenos. Incluye estudios para determinar el margen de seguridad o las reacciones que acompañan a la administración de distintas dosis. También se usa para estudios de exposición a agentes ambientales. El envenenamiento debe considerarse en la exposición a agentes ambientales que amenazan la vida.\"}, {\"@language\": \"es\", \"@value\": \"Usado con fármacos y sustancias químicas en estudios experimentales humanos o animales sobre sus efectos patógenos. Incluye estudios para determinar el margen de seguridad o las reacciones que acompañan a la administración de distintas dosis. También se usa para estudios de exposición a agentes ambientales. El envenenamiento debe considerarse en la exposición a agentes ambientales que amenazan la vida.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com fármacos e substâncias químicas para estudos experimentais humanos ou animais sobre seus efeitos danosos. Inclui estudos para determinar a margem de segurança ou as reações que acompanham a administração de várias dosagens. Usado também para estudos de exposição a agentes ambientais. O envenenamento deve ser considerado para exposição a agentes ambientais que ameaçam a vida.\"}]', '1973-12-27', '2017-07-05', '1966-01-01', NULL, NULL),
(143, NULL, '2021-06-04 19:30:51.451510', 2, '485', 'QFNS000485', 'Qualifier', 1, 'TM', '[{\"@language\": \"en\", \"@value\": \"transmission\"}, {\"@language\": \"es\", \"@value\": \"transmisión\"}, {\"@language\": \"pt-br\", \"@value\": \"transmissão\"}, {\"@language\": \"fr\", \"@value\": \"transmission\"}, {\"@language\": \"es-es\", \"@value\": \"transmisión\"}]', '[\"Q35.090\",\"Y05.090\"]', NULL, 'M0030829', 'T061278', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for transmission & mechanism of transmission of disease from man to man, from man to animal, from animal to man or animal to animal; indexing policy: Manual 19.8.74; DF: /transm or /TM\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para transmisión & mecanismo de transmisión de enfermedad de hombre para hombre, de hombre para animal, de animal para hombre, o de animal para animal; política de indización: Manual de la NLM 19.8.74\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para transmissão & mecanismo de transmissão de doença de homem para homem, de homem para animal, de animal para homem, ou de animal para animal; política de indexação: Manual da NLM 19.8.74\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TM or TM (SH) or SUBS APPLY TM\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category C 1975-89; C1-3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with diseases for studies of the modes of transmission.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux maladies pour les études concernant leur mode de transmission.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades para el estudio de las formas de transmisión.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades para los estudios de las formas de transmisión.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças para os estudos das formas de transmissão.\"}]', '1974-10-23', '2003-07-22', '1975-01-01', NULL, NULL),
(144, NULL, '2021-06-04 19:30:51.451510', 2, '486', 'QFNS000486', 'Qualifier', 1, 'TR', '[{\"@language\": \"en\", \"@value\": \"transplantation\"}, {\"@language\": \"es\", \"@value\": \"trasplante\"}, {\"@language\": \"es\", \"@value\": \"trasplantación\"}, {\"@language\": \"pt-br\", \"@value\": \"transplante\"}, {\"@language\": \"pt-br\", \"@value\": \"transplantação\"}, {\"@language\": \"fr\", \"@value\": \"transplantation\"}, {\"@language\": \"es-es\", \"@value\": \"trasplante\"}]', '[\"Q65.070.010\",\"Y11.070.010\"]', '[\"M0030831\"]', 'M0030830', 'T061279', '[{\"@language\": \"en\", \"@value\": \"grafting\"}, {\"@language\": \"en\", \"@value\": \"grafts\"}, {\"@language\": \"es\", \"@value\": \"injerto\"}, {\"@language\": \"es\", \"@value\": \"injertos\"}, {\"@language\": \"pt-br\", \"@value\": \"enxerto\"}, {\"@language\": \"pt-br\", \"@value\": \"enxertos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"grafts\\\" & \\\"grafting\\\" from one site to another in the same subject, from one to another of same species, from one to another of a different species; indexing policy: Manual 19.8.75; DF: /transpl or /TR\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye injertos de un sitio para otro en el mismo sujeto, de un para otro de misma especie; de uno para otro de diferentes especies; política de indización: Manual 19.8.75\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui enxertos de um local para outro no mesmo sujeito, de um para outro de mesma espécie; de um para outro de diferentes espécies; política de indexação: Manual 19.8.75\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TR or TR (SH) or SUBS APPLY TR\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category A 1966-89; A2-11, A13-16 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, tissues, or cells for transplantation from one site to another within the same subject, or from one subject to another of the same species or different species.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux tissus ou aux cellules pour leur transfert d\'un emplacement à un autre chez un même individu, ainsi que pour leur transfert d\'un individu à un autre de la même espèce ou d\'une espèce différente.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con órganos, tejidos o células para el trasplante de un sitio a otro en el mismo individuo o de un individuo a otro de la misma especie o de especies diferentes.\"}, {\"@language\": \"es\", \"@value\": \"Usado con órganos, tejidos o células para el trasplante de un sitio a otro en el mismo individuo o de un individuo a otro de la misma especie o de especies diferentes.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, tecidos ou células para o transplante de um local a outro no mesmo indivíduo ou de um indivíduo a outro da mesma espécie ou de espécies diferentes.\"}]', '1973-12-27', '2003-07-24', '1966-01-01', NULL, NULL),
(145, NULL, '2021-06-04 19:30:51.467130', 2, '487', 'QFNS000487', 'Qualifier', 1, 'TD', '[{\"@language\": \"en\", \"@value\": \"trends\"}, {\"@language\": \"es\", \"@value\": \"tendencias\"}, {\"@language\": \"pt-br\", \"@value\": \"tendências\"}, {\"@language\": \"fr\", \"@value\": \"tendances\"}, {\"@language\": \"es-es\", \"@value\": \"tendencias\"}]', '[\"Q40.060\",\"Y06.060\"]', '[\"M0030835\",\"M0030834\"]', 'M0030833', 'T061283', '[{\"@language\": \"en\", \"@value\": \"futurology\"}, {\"@language\": \"es\", \"@value\": \"futurología\"}, {\"@language\": \"pt-br\", \"@value\": \"futurologia\"}, {\"@language\": \"en\", \"@value\": \"forecasting\"}, {\"@language\": \"es\", \"@value\": \"predicción\"}, {\"@language\": \"pt-br\", \"@value\": \"previsões\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"forecasting\\\" & \\\"futurology\\\"; for a continuum from past to present, present to future; see MeSH scope note in Introduction; indexing policy: Manual 19.8.76; DF: /trends or /TD      CATALOG: may be subdivided geographically\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"previsión\\\" & \\\"futurología\\\"; para un continuum del pasado para presente, del presente para futuro; vea definición; regla de indización: Manual de la NLM 19.8.76\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"previsão\\\" & \\\"futurologia\\\"; para um continuum do passado para presente, do presente para futuro; veja definição; regra de indexação: Manual da NLM 19.8.76\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/TD or TD (SH) or SUBS APPLY TD\"}]', '[{\"@language\": \"en\", \"@value\": \"78; used with Category F4, G1-3, I & N 1978-79; E, F4, G1-3, I & N 1980-86; E, F4, G1-3, I, L & N 1987; E, F4, G1-3, I, L, N & SMOKING 1988; E, F4, G1-3, I, L, N & SMOKING+ 1989; E, F4, G1-2, I2-3 & N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the manner in which a subject changes, qualitatively or quantitatively, with time, whether past, present, or future. It excludes discussions of the course of disease in particular patients.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour traduire la manière dont un sujet évolue, qualitativement ou quantitativement, avec le temps, que ce soit au passé, au présent ou au futur. Il exclut les discussions concernant l\'évolution d\'une maladie chez les patients.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la manera en la que un tema cambia, cualitativa y cuantitativamente, con el tiempo, sea pasado, presente o futuro. Excluye discusiones sobre el curso de una enfermedad en pacientes individuales.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la forma como un tema cambia, cualitativa y cuantitativamente, con el tiempo, sea pasado, presente o futuro. Excluye discusiones sobre el curso de una enfermedad en pacientes individuales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a forma como um assunto muda, qualitativa ou quantitativamente com o tempo, seja passado, presente ou futuro. Exclui discussões sobre o curso de uma doença em pacientes individuais.\"}]', '1977-05-16', '2003-07-25', '1978-01-01', NULL, NULL);
INSERT INTO `thesaurus_qualifier` (`id`, `created_time`, `updated_time`, `thesaurus`, `decs_code`, `identifier`, `type`, `active`, `abbreviation`, `label`, `treeNumber`, `concept`, `preferredConcept`, `preferredTerm`, `synonym`, `annotation`, `onlineNote`, `historyNote`, `scopeNote`, `date_created`, `date_revised`, `date_established`, `created_by_id`, `updated_by_id`) VALUES
(146, NULL, '2021-06-04 19:30:51.486801', 2, '488', 'QFNS000488', 'Qualifier', 1, 'UL', '[{\"@language\": \"en\", \"@value\": \"ultrastructure\"}, {\"@language\": \"es\", \"@value\": \"ultraestructura\"}, {\"@language\": \"pt-br\", \"@value\": \"ultraestrutura\"}, {\"@language\": \"fr\", \"@value\": \"ultrastructure\"}, {\"@language\": \"es-es\", \"@value\": \"ultraestructura\"}]', '[\"Q10.020.020\",\"Y02.020.020\"]', '[\"M0030844\"]', 'M0030844', 'T061295', '[{\"@language\": \"en\", \"@value\": \"subcellular structure\"}, {\"@language\": \"en\", \"@value\": \"submicroscopic anatomy\"}, {\"@language\": \"es\", \"@value\": \"anatomía submicroscópica\"}, {\"@language\": \"es\", \"@value\": \"estructura subcelular\"}, {\"@language\": \"pt-br\", \"@value\": \"anatomia submicroscópica\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura subcelular\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for normal or pathological subcellular structure\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para estructura normal o patológica subcelular\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para estrutura normal ou patológica subcelular\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/UL or UL (SH) or SUBS APPLY UL\"}]', '[{\"@language\": \"en\", \"@value\": \"75; used with Category A & B 1975; A, B & C4 1976-77; A1-11, A13-16, B & C4 1978-86; A1-11, A13-16, B, C4, CALCULI+, DNA+ & RNA+ 1987-88; A1-11, A13-16, B1, B3-6, C4, CALCULI+, NUCLEIC ACIDS+ & PROTEINS+ 1989; A2-11, A13-16, B1, B3-6 & C4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with tissues and cells (including neoplasms) and microorganisms for microanatomic structures, generally below the size visible by light microscopy.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux tissus, aux cellules normales ou tumorales et aux micro-organismes pour les structures micro-anatomiques, généralement non visibles au microscope optique.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con tejidos y células (incluidas las neoplasias) y microorganismos para estructuras microanatómicas, generalmente por debajo del tamaño visible por microscopía óptica.\"}, {\"@language\": \"es\", \"@value\": \"Usado con tejidos y células (incluidas las neoplasias) y microorganismos para estructuras microanatómicas, generalmente por debajo del tamaño visible por microscopía óptica.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com tecidos e células (incluindo neoplasias) e micro-organismos para estruturas microanatômicas, geralmente abaixo do tamanho visível por microscopia ótica.\"}]', '1974-10-23', '2016-06-15', '1975-01-01', NULL, NULL),
(147, NULL, '2021-06-04 19:30:51.489310', 2, '489', 'QFNS000489', 'Qualifier', 1, 'UR', '[{\"@language\": \"en\", \"@value\": \"urine\"}, {\"@language\": \"es\", \"@value\": \"orina\"}, {\"@language\": \"pt-br\", \"@value\": \"urina\"}, {\"@language\": \"fr\", \"@value\": \"urine\"}, {\"@language\": \"es-es\", \"@value\": \"orina\"}]', '[\"Q05.040\",\"Q50.040.070\",\"Y01.040\",\"Y08.040.070\"]', '[\"M0030850\",\"M0030849\"]', 'M0030848', 'T061301', '[{\"@language\": \"en\", \"@value\": \"urinary levels\"}, {\"@language\": \"es\", \"@value\": \"niveles urinarios\"}, {\"@language\": \"pt-br\", \"@value\": \"níveis urinários\"}, {\"@language\": \"en\", \"@value\": \"urinary aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos urinarios\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos urinários\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; for \\\"in urine\\\" or \\\"urine in\\\" animals or diseases; includes the presence of cells & endogenous & exogenous chemical substances; not for the presence of microbes or parasites in the urine in disease ( = /microbiology or /parasitology); see MeSH scope note in Introduction; indexing policy: Manual 19.8.79; DF: /urine or /UR\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para en orina u orina en animales o enfermedades; incluye la presencia de células & sustancias químicas endógenas & exógenas; no para la presencia de microbios o parásitos en la orina en enfermedad ( = /microbiología o /parasitología); vea definición; política de indización: Manual 19.8.79\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para em urina ou urina em animais ou doenças; inclui a presença de células & substâncias químicas endógenas & exógenas; não para a presença de micróbios ou parasitos na urina em doença ( = /microbiologia ou /parasitologia); veja definição; política de indexação: Manual 19.8.79\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/UR or UR (SH) or SUBS APPLY UR\"}]', '[{\"@language\": \"en\", \"@value\": \"67; used with Category C, D & F 1967-74; B2, C, D & F3 1975-86; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+ & PUERPERIUM+ 1987; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING 1988; B2, C, D, F3, AGING, CLIMACTERIC+, INFANT, NEWBORN+, PREGNANCY+, PREGNANCY, ANIMAL+, PUBERTY+, PUERPERIUM+ & SMOKING+ 1989; B2, C, D1-24 & F3 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for the presence or analysis of substances in the urine, and also for the examination of, or changes in, the urine in disease.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour la présence de substances dans l\'urine ou leur analyse, ainsi que pour l\'examen ou les modifications de l\'urine en cas de maladie.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado para la presencia o análisis de sustancias en la orina y también para el examen de la orina y sus alteraciones en las enfermedades.\"}, {\"@language\": \"es\", \"@value\": \"Usado para la presencia o análisis de sustancias en la orina y también para el examen de la orina y sus alteraciones en las enfermedades.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado para a presença ou análise de substâncias na urina e também para exame de la orina e suas alterações em doença.\"}]', '1973-12-27', '2003-07-24', '1967-01-01', NULL, NULL),
(148, NULL, '2021-06-04 19:30:51.489310', 2, '490', 'QFNS000490', 'Qualifier', 1, 'VE', '[{\"@language\": \"en\", \"@value\": \"veterinary\"}, {\"@language\": \"es\", \"@value\": \"veterinaria\"}, {\"@language\": \"pt-br\", \"@value\": \"veterinária\"}, {\"@language\": \"fr\", \"@value\": \"médecine vétérinaire\"}, {\"@language\": \"es-es\", \"@value\": \"veterinaria\"}]', '[\"Q70\",\"Y41\"]', NULL, 'M0030860', 'T061316', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for pets & domestic, wild & zoo animals in veterinary medicine; for laboratory animals only if of concern to the veterinarian, not as experimental animals; see MeSH scope note in Introduction; indexing policy: Manual 19.8.81; DF: /vet or /VE\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para animales domésticos, regalones, salvajes & de zoológico en medicina veterinaria; para animales de laboratorio solamente si relacionado a veterinaria, no como animales de experimentos; vea definición; política de indización: Manual 19.8.81\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para animais domésticos, de estimação, selvagens & de zoológico em medicina veterinária; para animais de laboratório somente se relacionado a veterinária, não como animais de experimentos; veja definição; política de indexação: Manual 19.8.81\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/VE or VE (SH) or SUBS APPLY VE\"}]', '[{\"@language\": \"en\", \"@value\": \"66; used with Category C 1966; C & E 1967-74; C1-21, C23 & E 1975-86; C1-21, C23, E, DISEASE OUTBREAKS & DISEASE RESERVOIRS 1987-89; C1-21, C23 & E 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used for naturally occurring diseases in animals, or for diagnostic, preventive, or therapeutic procedures used in veterinary medicine.\"}, {\"@language\": \"fr\", \"@value\": \"S\'emploie pour les maladies naturelles chez les animaux, ainsi que pour les procédures diagnostiques, préventives ou thérapeutiques utilisées en médecine vétérinaire.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con enfermedades que ocurren naturalmente en animales, o para procedimientos diagnósticos, preventivos o terapéuticos en medicina veterinaria.\"}, {\"@language\": \"es\", \"@value\": \"Usado con enfermedades que ocurren naturalmente en animales, o para procedimientos diagnósticos, preventivos o terapéuticos en medicina veterinaria.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com doenças que ocorrem naturalmente em animais, ou para procedimentos diagnósticos, preventivos ou terapêuticos em medicina veterinária.\"}]', '1973-12-27', '2003-07-22', '1966-01-01', NULL, NULL),
(149, NULL, '2021-06-04 19:30:51.504969', 2, '491', 'QFNS000491', 'Qualifier', 1, 'SN', '[{\"@language\": \"en\", \"@value\": \"statistics & numerical data\"}, {\"@language\": \"es\", \"@value\": \"estadística & datos numéricos\"}, {\"@language\": \"es\", \"@value\": \"estadística y datos numéricos\"}, {\"@language\": \"pt-br\", \"@value\": \"estatística & dados numéricos\"}, {\"@language\": \"fr\", \"@value\": \"statistiques et données numériques\"}, {\"@language\": \"es-es\", \"@value\": \"estadística & datos numéricos\"}]', '[\"Q55\",\"Y09\"]', '[\"M0030890\",\"M0030854\",\"M0030892\"]', 'M0030890', 'T061359', '[{\"@language\": \"en\", \"@value\": \"statistics and numerical data\"}, {\"@language\": \"pt-br\", \"@value\": \"estatística e dados numéricos\"}, {\"@language\": \"en\", \"@value\": \"utilization\"}, {\"@language\": \"en\", \"@value\": \"use\"}, {\"@language\": \"es\", \"@value\": \"utilización\"}, {\"@language\": \"es\", \"@value\": \"uso\"}, {\"@language\": \"pt-br\", \"@value\": \"utilização\"}, {\"@language\": \"pt-br\", \"@value\": \"uso\"}, {\"@language\": \"en\", \"@value\": \"numerical data\"}, {\"@language\": \"es\", \"@value\": \"datos numéricos\"}, {\"@language\": \"pt-br\", \"@value\": \"dados numéricos\"}]', '[{\"@language\": \"en\", \"@value\": \"subheading only; for statistics on non-disease headings only (statistics on diseases =  /epidemiology);  not for \\\"statistics on supply & demand\\\" ( =  /supply & distribution)\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; solamente para estadísticas en descriptores que no son enfermedades (estadísticas en enfermedades = /epidemiología); no para \\\"estadísticas sobre la oferta y la demanda\\\" ( = /provisión & distribución)\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; somente para estatísticas em descritores que não são doenças (estatísticas em doenças = /epidemiologia); não para \\\"estatísticas sobre oferta e procura\\\" ( = /provisão & distribuição)\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; main heading/SN or SN (SH) or SUBS APPLY SN\"}]', '[{\"@language\": \"en\", \"@value\": \"89; used with Category E, F1-2, F4, G1-3 & H-N 1989; E, F4, G1-2, I, J, M & N2-4 1990 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with non-disease headings for the expression of numerical values that describe particular sets or groups of data. It includes level of use of equipment and supplies, facilities and services and procedures and techniques. It excludes supply or demand for which \\\"supply & distribution\\\" is used\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux descripteurs autres que ceux de maladies pour exprimer les valeurs numériques décrivant des ensembles ou groupes particuliers de données. Il exclut la répartition du personnel, pour laquelle le qualificatif \'main-d\'œuvre\' est utilisé, ainsi que les ressources et les besoins, pour lesquels le qualificatif \'ressources et distribution\' est employé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con descriptores (excepto los de enfermedades) para expresar valores numéricos que describen conjuntos o grupos de datos. Excluye la distribución de recursos humanos para la que se usa el calificador \\\"/recursos humanos\\\" y excluye la provisión o demanda para los que se usa \\\"/provisión y distribución\\\".\"}, {\"@language\": \"es\", \"@value\": \"Usado con descriptores (excepto los de enfermedades) para expresar valores numéricos que describen conjuntos o grupos de datos. Excluye la distribución de recursos humanos para la que se usa el calificador \\\"/recursos humanos\\\" y excluye la provisión o demanda para los que se usa \\\"/provisión y distribución\\\".\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com descritores (exceto os de doenças) para expressar valores numéricos que descrevam grupos de dados. Exclui a distribuição de recursos humanos para a qual se usa o qualificador \\\"/recursos humanos\\\" e exclui a provisão ou demanda para os quais se usa \\\"/provisão & distribuição\\\".\"}]', '1988-06-02', '2018-07-12', '1989-01-01', NULL, NULL),
(150, NULL, '2021-06-04 19:30:51.520609', 2, '492', 'QFNS000492', 'Qualifier', 1, 'CH', '[{\"@language\": \"en\", \"@value\": \"chemistry\"}, {\"@language\": \"es\", \"@value\": \"química\"}, {\"@language\": \"pt-br\", \"@value\": \"química\"}, {\"@language\": \"fr\", \"@value\": \"composition chimique\"}, {\"@language\": \"es-es\", \"@value\": \"química\"}]', '[\"Q15\",\"Y03\"]', '[\"M0030906\",\"M0030909\",\"M0030910\",\"M0030907\",\"M0030908\"]', 'M0030905', 'T061380', '[{\"@language\": \"en\", \"@value\": \"chemical structure\"}, {\"@language\": \"es\", \"@value\": \"estructura química\"}, {\"@language\": \"pt-br\", \"@value\": \"estrutura química\"}, {\"@language\": \"en\", \"@value\": \"chemical content\"}, {\"@language\": \"es\", \"@value\": \"contenido químico\"}, {\"@language\": \"pt-br\", \"@value\": \"conteúdo químico\"}, {\"@language\": \"en\", \"@value\": \"chemical properties\"}, {\"@language\": \"es\", \"@value\": \"propiedades químicas\"}, {\"@language\": \"pt-br\", \"@value\": \"propriedades químicas\"}, {\"@language\": \"en\", \"@value\": \"chemical characterization\"}, {\"@language\": \"es\", \"@value\": \"caracterización química\"}, {\"@language\": \"pt-br\", \"@value\": \"caracterização química\"}, {\"@language\": \"en\", \"@value\": \"chemical composition\"}, {\"@language\": \"es\", \"@value\": \"composición química\"}, {\"@language\": \"pt-br\", \"@value\": \"composição química\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; includes \\\"chemical structure\\\", \\\"chemical composition\\\", \\\"chemical properties\\\" or \\\"chemical characterization\\\"; includes \\\"chemical composition\\\" or \\\"chemical content\\\" of organs & tissues, organisms & plants; not for chemical analysis or determination ( = /analysis) nor chemical synthesis or manufacture ( = /chemical synthesis) nor chemical isolation or purification ( = /isolation & purification); see MeSH scope note in Introduction; indexing policy: Manual 19.8.15; DF: /chem or /CH\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; incluye \\\"estructura química\\\", \\\"composición química\\\", \\\"propiedades químicas\\\" o \\\"caracterización química\\\"; incluye \\\"composición química\\\" o \\\"contenido químico\\\" de órganos & tejidos, organismos & plantas; no para determinación o análisis químico ( = /análisis) ni para manufactura o síntesis química ( = / síntesis química) ni para aislamiento o purificación química ( = / aislamiento & purificación); vea definición; regla de indización: Manual de la NLM 19.8.15\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; inclui \\\"estrutura química\\\", \\\"composição química\\\", \\\"propriedades químicas\\\" ou \\\"caracterização química\\\"; inclui \\\"composição química\\\" ou \\\"conteúdo químico\\\" de órgãos & tecidos, organismos & plantas; não para determinação ou análise química ( = /análise) nem para fabricação ou síntese química ( = / síntese química) nem para isolamento ou purificação química ( = / isolamento & purificação); veja definição; regra de indexação: Manual da NLM 19.8.15\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use main heading/CH or CH (SH) or SUBS APPLY CH\"}]', '[{\"@language\": \"en\", \"@value\": \"91; used with Category A2-16, C4 & D 1991; A2-16, B1, B3-6, C4 & D 1992 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with chemicals, biological, and non-biological substances for their composition, structure, characterization, and properties; also used for the chemical composition or content of organs, tissue, tumors, body fluids, organisms, and plants. Excludes chemical analysis and determination of substances for which \\\"analysis\\\" is used; excludes synthesis for which \\\"chemical synthesis\\\" is used; excludes isolation and purification of substances for which \\\"isolation & purification\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux substances chimiques, biologiques ou non biologiques pour leur composition, leur structure, leur caractérisation et leurs propriétés. Il s\'emploie aussi pour la composition chimique ou le contenu des organes, des tissus, des tumeurs, des liquides biologiques, des organismes et des végétaux. Il exclut l\'analyse chimique et la détermination de substances, pour lesquelles le qualificatif \'analyse\' est utilisé. Il exclut la synthèse, pour laquelle le qualificatif \'synthèse chimique\' est employé. Il exclut l\'isolement et la purification de substances, pour lesquels le qualificatif \'isolement et purification\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con sustancias químicas y sustancias biológicas y no biológicas, para su composición, estructura, caracterización y propiedades. Usado también para la composición química o el contenido de órganos, tejidos, tumores, fluidos corporales, organismos y plantas. Excluye el análisis químico y la determinación de sustancias, para los que se usa /análisis. Excluye la síntesis, para la que se usa \\\"/síntesis química\\\". Excluye el aislamiento y purificación de sustancias para los que se usa \\\"/aislamiento & purificación\\\".\"}, {\"@language\": \"es\", \"@value\": \"Usado con compuestos químicos, sustancias biológicas y no biológicas, para su composición, estructura, caracterización y propiedades. Usado también para la composición química o el contenido de órganos, tejidos, tumores, fluidos corporales, organismos y plantas. Excluye el análisis químico y la determinación de sustancias, para los que se usa /análisis. Excluye la síntesis, para la que se usa \\\"/síntesis química\\\". Excluye el aislamiento y la purificación de sustancias para los que se usa \\\"/aislamiento & purificación\\\".\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com compostos químicos, substâncias biológicas e não biológicas, para sua composição, estrutura, caracterização e propriedades. Também usado para a composição química ou o conteúdo de órgãos, tecidos, tumores, fluidos corporais, organismos e plantas. Exclui a análise química e a determinação de substâncias, para as quais se usa /análise. Exclui a síntese, para a qual se usa \\\"/síntese química\\\". Exclui o isolamento e a purificação de substâncias, para os quais se usa \\\"/isolamento & purificação\\\".\"}]', '1990-08-29', '2003-07-24', '1991-01-01', NULL, NULL),
(151, NULL, '2021-06-04 19:30:51.520609', 2, '493', 'QFNS000493', 'Qualifier', 1, 'AG', '[{\"@language\": \"en\", \"@value\": \"agonists\"}, {\"@language\": \"es\", \"@value\": \"agonistas\"}, {\"@language\": \"pt-br\", \"@value\": \"agonistas\"}, {\"@language\": \"fr\", \"@value\": \"agonistes\"}, {\"@language\": \"es-es\", \"@value\": \"agonistas\"}]', '[\"Q15.010\",\"Q45.030\",\"Y03.010\",\"Y07.030\"]', NULL, 'M0030947', 'T061435', NULL, '[{\"@language\": \"en\", \"@value\": \"subhead only; for exogenous & endogenous substances; do not confuse with /antagonists & inhibitors; see MeSH scope note in Introduction; indexing policy: Manual 19.8.4; DF: /agon or /AG\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; para sustancias exógenas & endógenas; no confunda con /antagonistas & inhibidores; vea definición; regla de indización: Manual de la NLM 19.8.4\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para substâncias exógenas & endógenas; não confunda com /antagonistas & inibidores; veja definição; regra de indexação: Manual da NLM 19.8.4\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/AG or AG (SH) or SUBS APPLY AG\"}]', '[{\"@language\": \"en\", \"@value\": \"95; used with Category D 1995 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with chemicals, drugs, and endogenous substances to indicate substances or agents that have affinity for a receptor and intrinsic activity at that receptor. (From Textbook of Pharmacology, 1991, p.16)\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux substances chimiques, aux médicaments et aux substances endogènes pour désigner les substances ou les agents ayant une affinité pour un récepteur et une activité intrinsèque au niveau de ce récepteur.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con sustancias químicas, fármacos y sustancias endógenas para indicar sustancias o agentes que tienen afinidad por un receptor y actividad intrínseca en ese receptor. (Traducción libre del original: Textbook of Pharmacology, 1991, p.16)\"}, {\"@language\": \"es\", \"@value\": \"Usado con sustancias químicas, fármacos y sustancias endógenas para indicar sustancias o agentes que tienen afinidad por un receptor y actividad intrínseca en ese receptor. (Traducción libre del original: Textbook of Pharmacology, 1991, p.16)\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com substâncias químicas, fármacos e substâncias endógenas para indicar substâncias ou agentes que têm afinidade por um receptor e atividade intrínseca com esse receptor.\"}]', '1994-06-01', '2003-07-22', '1995-01-01', NULL, NULL),
(152, NULL, '2021-06-04 19:30:51.536227', 2, '494', 'QFNS000494', 'Qualifier', 1, 'VI', '[{\"@language\": \"en\", \"@value\": \"virology\"}, {\"@language\": \"es\", \"@value\": \"virología\"}, {\"@language\": \"pt-br\", \"@value\": \"virologia\"}, {\"@language\": \"fr\", \"@value\": \"virologie\"}, {\"@language\": \"es-es\", \"@value\": \"virología\"}]', '[\"Q35.070.010\",\"Y05.070.010\"]', '[\"M0030949\"]', 'M0030948', 'T061436', '[{\"@language\": \"en\", \"@value\": \"viruses\"}, {\"@language\": \"es\", \"@value\": \"virus\"}, {\"@language\": \"pt-br\", \"@value\": \"vírus\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; see also /microbiology (for bacteria, rickettsia & fungi) & /parasitology; see MeSH scope note in Introduction; indexing policy: Manual 19.8.82; DF: /virol or VI\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador; vea también /microbiología (para bacterias, rickettsia & hongos) & /parasitología; vea definición; regla de indización: Manual de la NLM 19.8.82\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador; veja também /microbiologia (para bactérias, rickettsia & fungos) & /parasitologia; veja definição; regra de indexação: Manual da NLM 19.8.82\"}]', '[{\"@language\": \"en\", \"@value\": \"search policy: Online Manual; use: main heading/VI or VI (SH) or SUBS APPLY VI\"}]', '[{\"@language\": \"en\", \"@value\": \"95; used with Category A, B1-3, B6, C & F3 1995 forward\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with organs, animals, and higher plants and with diseases for virologic studies. For bacteria, rickettsia, and fungi, \\\"microbiology\\\" is used; for parasites, \\\"parasitology\\\" is used.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux organes, aux animaux, aux végétaux supérieurs et aux maladies pour les études virologiques. Pour les bactéries, les rickettsies et les champignons, le qualificatif \'microbiologie\' est employé. Pour les parasites, le qualificatif \'parasitologie\' est utilisé.\"}, {\"@language\": \"es-es\", \"@value\": \"Utilizado con órganos, animales y plantas superiores y con enfermedades, para estudios virológicos. Para bacterias, rickettsias y hongos se utiliza el calificador \\\"/microbiología\\\" y para parásitos, /parasitología.\"}, {\"@language\": \"es\", \"@value\": \"Utilizado con órganos, animales y plantas superiores y con enfermedades, para estudios virológicos. Para bacterias, rickettsias y hongos se utiliza el calificador \\\"/microbiología\\\" y para parásitos, /parasitología.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com órgãos, animais e plantas superiores e com doenças para estudos virológicos. Para bactérias, rickettsia e fungos usar o qualificador /microbiologia. Para parasitos usar /parasitologia.\"}]', '1994-07-08', '2003-07-24', '1995-01-01', NULL, NULL),
(153, NULL, '2021-06-04 19:30:51.551819', 2, '495', 'QFNS000495', 'Qualifier', 1, 'ES', '[{\"@language\": \"en\", \"@value\": \"ethics\"}, {\"@language\": \"es\", \"@value\": \"ética\"}, {\"@language\": \"pt-br\", \"@value\": \"ética\"}, {\"@language\": \"fr\", \"@value\": \"éthique\"}, {\"@language\": \"es-es\", \"@value\": \"ética\"}]', '[\"Q30\",\"Y25\"]', '[\"M0421312\"]', 'M0421311', 'T490705', '[{\"@language\": \"en\", \"@value\": \"ethical aspects\"}, {\"@language\": \"es\", \"@value\": \"aspectos éticos\"}, {\"@language\": \"pt-br\", \"@value\": \"aspectos éticos\"}]', '[{\"@language\": \"en\", \"@value\": \"subhead only; see MeSH scope note in Introduction; DF: /eth or /ES\"}, {\"@language\": \"es\", \"@value\": \"solamente calif; vea su nota de alcance\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualif; veja sua nota de escopo\"}]', NULL, '[{\"@language\": \"en\", \"@value\": \"2003\"}]', '[{\"@language\": \"en\", \"@value\": \"Used with techniques and activities for discussion and analysis with respect to human and social values.\"}, {\"@language\": \"fr\", \"@value\": \"S\'applique aux techniques et aux activités pour les débats et les analyses concernant les valeurs humaines et sociales.\"}, {\"@language\": \"es-es\", \"@value\": \"Usado con técnicas y actividades para la discusión y el análisis con respecto a valores humanos y sociales.\"}, {\"@language\": \"es\", \"@value\": \"Usado con técnicas y actividades para la discusión y el análisis con respecto a valores humanos y sociales.\"}, {\"@language\": \"pt-br\", \"@value\": \"Usado com técnicas e atividades para a discussão e a análise com respeito a valores humanos e sociais.\"}]', '2002-07-02', '2004-07-13', '2003-01-01', NULL, NULL),
(154, NULL, '2021-06-04 19:30:51.551819', 2, '496', 'QFNS000496', 'Qualifier', 1, 'PL', '[{\"@language\": \"en\", \"@value\": \"policies\"}, {\"@language\": \"es\", \"@value\": \"políticas\"}, {\"@language\": \"pt-br\", \"@value\": \"políticas\"}, {\"@language\": \"es-es\", \"@value\": \"políticas\"}, {\"@language\": \"fr\", \"@value\": \"politiques\"}]', '[\"Q51\",\"Y36\"]', NULL, 'FQ00000476', 'engqual000001000', NULL, '[{\"@language\": \"en\", \"@value\": \"subheading only\"}, {\"@language\": \"es\", \"@value\": \"solamente calificador\"}, {\"@language\": \"pt-br\", \"@value\": \"somente qualificador\"}]', NULL, '[{\"@language\": \"en\", \"@value\": \"88\"}]', '[{\"@language\": \"en\", \"@value\": \"A group of objectives aimed at forming a specific program of action and which conditions its execution.\"}, {\"@language\": \"es-es\", \"@value\": \"Conjunto de objetivos dirigidos a formar un determinado programa de acción y que condicionan su ejecución.\"}, {\"@language\": \"es\", \"@value\": \"Conjunto de objetivos dirigidos a formar un determinado programa de acción y que condicionan su ejecución.\"}, {\"@language\": \"pt-br\", \"@value\": \"Conjunto de objetivos dirigidos a formar determinado programa de ação e que condicionam sua execução.\"}]', '1988-01-01', '1988-01-01', '1988-01-01', NULL, NULL),
(155, NULL, '2021-06-04 19:30:51.584079', 2, '701', 'QFNS000701', 'Qualifier', 1, 'PR', '[{\"@language\": \"pt-br\", \"@value\": \"protocolos\"}, {\"@language\": \"es\", \"@value\": \"protocolos\"}, {\"@language\": \"en\", \"@value\": \"protocols\"}, {\"@language\": \"en\", \"@value\": \"convention\"}]', '[\"Q40.040.098\"]', '[\"FQ00000478\"]', 'FQ00000477', 'engq000028', '[{\"@language\": \"pt-br\", \"@value\": \"praxe\"}, {\"@language\": \"pt-br\", \"@value\": \"cerimonial\"}, {\"@language\": \"en\", \"@value\": \"ritual\"}, {\"@language\": \"es\", \"@value\": \"ceremonial\"}, {\"@language\": \"es\", \"@value\": \"ordenanza\"}]', '[{\"@language\": \"pt-br\", \"@value\": \"somente qualificador; para protocolos usados em procedimentos padronizados\"}, {\"@language\": \"en\", \"@value\": \"qualifier only\"}]', NULL, NULL, '[{\"@language\": \"pt-br\", \"@value\": \"Conjunto de normas que orientam e regulam como são feitos procedimentos.\"}, {\"@language\": \"es\", \"@value\": \"Secuencia detallada de un proceso de actuación científica, técnica, médica, etc.\"}, {\"@language\": \"en\", \"@value\": \"Set of rules that guide and regulate how procedures are done.\"}]', '2019-11-29', NULL, NULL, NULL, NULL);
